INSERT INTO `singer` VALUES ('1011143', 'iKON', 'iKON(아이콘)，是韩国YG娱乐于2015年推出的男子组合，历经出道生存节目《WIN》和《MIX & MATCH》，最终由B.I（队长）、BOBBY（《Show Me The Money 3》冠军）、金振焕、宋允亨、具俊会、金东赫和郑粲右七人组成。 2015年9月15日出道时以《取向狙击》横扫韩国Melon等8大音乐排行榜，并囊括韩国五大颁奖典礼MMA、MAMA、首尔歌谣大赏、金唱片大赏和Gaon Chart K-POP大奖的新人赏，完成“新人赏大满贯”。2016年1月13日于日本出道后，亦获得最佳新人赏的殊荣。2018年1月25日发布的第二张正规专辑《Return》之主打歌《Love Scenario》除了横扫韩国Melon等7大音乐排行榜外，更连续位居实时榜单一位达41日，突破近十年来韩国乐坛史的最长纪录。同年2月9日更被美国《时代杂志》选为现时K-POP（韩国流行音乐）界中的6大团体之一。\n                 \n2019年6月12日，成员B.I因毒品事件而退出组合。组合现以6人体制继续活动。', 'http://p1.music.126.net/o0VHwTH1R2JIvya9U3tbEg==/109951165050893150.jpg');
INSERT INTO `singer` VALUES ('10142', '玄觞', '玄觞，歌手，代表作《妻书》个人专辑《心·弦》', 'http://p2.music.126.net/GnobBzNJ6lpaP4OgOPx5AA==/18722483999235305.jpg');
INSERT INTO `singer` VALUES ('1015114', '任东', '时光带不走理想的歌...', 'http://p2.music.126.net/3__1AhrsQEM3mLcIhQXusA==/109951165778496201.jpg');
INSERT INTO `singer` VALUES ('102954', 'The Glitch Mob', 'The Glitch Mob是成立于2006年来自美利坚的三人电音团体，成员分别为Edit，Kaddy和Ooah，他们之前各自都发行过多张专辑。他们有着自己对音乐的独到理解，以及控制调节节奏营造氛围的天份，创作出了动感十足、节奏感强烈的电子曲风，前前后后出过不少单曲。他们的音乐充满了张力和活力洋溢的年轻气息，常常被运用于电影配乐、游戏音乐、舞蹈编排和各种热力四射的场合。', 'http://p2.music.126.net/zlVToYrzAQEuBaGemdUmJA==/109951165081214100.jpg');
INSERT INTO `singer` VALUES ('1030001', '周深', '周深，1992年9月29日出生，贵州贵阳人，浙江卫视《中国好声音》第三季学员，所属那英团队。\n2014年，参加浙江卫视《中国好声音》第三季第二期，以一首齐豫的《欢颜》获得导师们的赞赏；9月1日在《中国好声音重返巅峰》节目，带着一首《美错》，赢得了陈晓东和王治平的充分的肯定；10月7日，参加《好声音总决赛》，凭借《贝加尔湖畔》获得“中国好声音”年度金曲。2015年春节大年初一北京卫视春晚献唱多语版《Let it go》支持北京申办冬奥会。2015年4月为电影《何以笙箫默》片头片尾配唱人声SOLO《You Are My Sunshine》。7月发行首张翻唱专辑《回味》并举办新专辑首唱会。8月发行个人全新单曲《玫瑰与小鹿》。', 'http://p1.music.126.net/ddFj3yFd0VifrxbenUL4kA==/109951165048013094.jpg');
INSERT INTO `singer` VALUES ('1032247', '赵钶', '赵钶（Key)，1992年2月1日出生于陕西省西安市，水瓶座，身高174，体重118斤，粉丝名称:颗粒，中国内地流行乐男歌手，毕业于西安音乐学院。\n从小学习音乐，在四岁的时候就参加合唱团，电子琴培训班，小时候的梦想就是上音乐学院，14岁那年被父母送到音乐学院正式学习音乐，18岁正式考入西安音乐学院，从小的音乐熏陶，造就了他出众的音乐修养，在歌曲改编，演唱方面，都有着自己独特的魅力。\n2010年，参加“第二届天声我才K歌争霸赛”，获全国总决赛亚军。2011年，参加深圳卫视“第八届中国音乐金钟奖流行音乐大赛”，获得西安赛区男子组八强。2014年，参加浙江卫视歌唱选秀节目《中国好声音第三季》的比赛，最终获得杨坤组16强；同年，推出首支个人单曲《廉价的爱》。2015年，推出首张个人EP专辑《赵钶》，同年，主演青春励志网络剧《音乐碉堡了》。2016年，凭借歌曲《再见我》获得“艾飞音乐奖”年度最受欢迎流行艺人奖的提名。', 'http://p1.music.126.net/lSUKuoI_ii_BYySVreRJrg==/109951162913432165.jpg');
INSERT INTO `singer` VALUES ('1039222', '梅粮新', '只是一个兴趣使然的音乐人罢了 \n微博/B站 @梅粮新\n后援群“313900287”\n合作联系 Merothy505@outlook.com', 'http://p1.music.126.net/K3UNTz8tsGLSOIivd6aP2w==/109951164969934574.jpg');
INSERT INTO `singer` VALUES ('1039314', '叶里', '叶里，独立音乐人，唱作人，嗓音独特，磁性且有辨识度，喜欢以“玩”的方式去做自己喜欢的音乐，其创作的歌曲曲风众多，大多都带有中国元素，将传统和新潮非常完美地融合在了一起。\n 主要经历：\n 2009年开始创作原创歌曲，2013年发布第一张个人同名纪念专辑《叶里》，2014年正式成为全职音乐人，先后陆续在成都和杭州举办个人专场歌会，并于2015年参加滚石原创歌手大赛，从海选到总决赛，最终凭借原创歌曲《落花不过身外客，流水从来是凉薄》和《不敢提及你的名字，怕扰了相思》荣获滚石原创歌手大赛“最佳作词奖”和虾米寻光计划“虾米寻光奖”。目前已创作发行三张原创音乐专辑，分别是《故事》（2014年）、《长歌名行不行》（2015年）、《天地》（2017年）和《我的意中人》（2018年）。主要作品：《无归》、《不敢提及你的名字，怕扰了相思》、《锦上》。\n\n联系方式：\n微博：@叶里_ \n公众微信：yeliliya', 'http://p1.music.126.net/WiZXE2MmrcoIjHoIj9sPMg==/109951163745499413.jpg');
INSERT INTO `singer` VALUES ('1043105', 'Punch', 'Punch(펀치)，本名배진영，出生于1993年2月19日的韩国新人女歌手，曾参与多部热门韩剧OST演唱。', 'http://p1.music.126.net/S912K5EoEiGUE9p3lmM5YQ==/109951165792264807.jpg');
INSERT INTO `singer` VALUES ('1045123', 'Alan Walker', '艾兰·奥拉夫·沃克（Alan Olav Walker），1997年8月24日出生于英国英格兰北安普敦郡，挪威DJ、音乐制作人。\n2014年11月，在YouTube上推出个人电音作品《Fade》而出道。2015年12月，通过索尼音乐发行个人第一首正式单曲《Faded》，该首歌曲的MV在YouTube上的点击量突破了12亿。2016年6月，发行人声伴唱电音单曲《Sing Me To Sleep》 。同年11月6日，获得MTV欧洲音乐奖“最佳挪威艺人”奖[4]  。2017年2月22日，《Faded》入围第37届全英音乐奖“年度英国单曲”奖 。同年5月，发布首支由男声伴唱的电音作品《Tired》 。', 'http://p2.music.126.net/bx2BUByvazqs3g5QbAJq0Q==/109951166656423669.jpg');
INSERT INTO `singer` VALUES ('1047064', 'KBShinya', '视频网站知名UP主，网络歌手。', 'http://p2.music.126.net/34uF4vg0f4LuDmqgnOpksQ==/3251255906655620.jpg');
INSERT INTO `singer` VALUES ('1047088', '小魂', '小魂，国风歌手，5sing中国原创音乐基地认证音乐人、推荐歌手、热门音乐人；其嗓音极具辨识度，有“自带后期”之称。且风格多变，时而温柔多情，时而大气豪放，时而潇洒飘逸。代表作《风起兰陵》、《策权天下》、《主宰》、《龙战苍穹》、《战魂云隐》等', 'http://p1.music.126.net/8eZIJkhOt6I3vCBuTPaz3Q==/109951164366684991.jpg');
INSERT INTO `singer` VALUES ('1047237', '五音Jw', '五音Jw，独立原创音乐人，知名网络歌手。声音细腻且富有辨识度，可荡气回肠，亦可温润如晚风，在流行与古风之间切换自如。代表作《明月天涯》、《步戏》、《忆江南》、《相思门》等。2015年发行个人首张原创音乐专辑《聆音》。2017年发行全新原创音乐专辑《万人景仰》。', 'http://p1.music.126.net/iOOnnH5Irpe76VL83KpW-g==/109951163058968523.jpg');
INSERT INTO `singer` VALUES ('1047282', '泠鸢yousa', '歌姬+填词者，见习画师+pv师\n音乐主页：http://1462744.5sing.com/', 'http://p2.music.126.net/vl1zrnMv9EaiHcFmSIJ1Fg==/2946691214429184.jpg');
INSERT INTO `singer` VALUES ('1047389', '上上', '中国内地男歌手/原创音乐人，《声入人心2》成员，CCTV《渴望现场》冠军，代表作《青春大概》《天空之梦》等。', 'http://p1.music.126.net/bpV_J5dZsthFe1miB64V8A==/109951165954012138.jpg');
INSERT INTO `singer` VALUES ('1047400', 'Code Kunst', '코드 쿤스트(Code Kunst) 本名조성우，AOMG旗下歌手、制作人。', 'http://p2.music.126.net/-b2W7NBGH4Fi4Buf51JbYA==/109951163542960025.jpg');
INSERT INTO `singer` VALUES ('1048004', '林斜阳', '古风歌手。代表作墨宝《奇妙娘》、《素衣》、《炎夏令》、《好梦如旧》等', 'http://p2.music.126.net/-7sNNuRJFsFSGOrC4oJWFg==/7881299349031069.jpg');
INSERT INTO `singer` VALUES ('1049217', 'Hoang Thuy Linh', '黄垂玲（Hoang Thuy Linh）出生地越南，她是越南国立电影大学导演系一年级学生。在主演《金瑛的日记》（Vang Anh\'s Diaries）走红，深得高中生和大学生好评。 据传黄垂玲因为和在美国旧男友的性爱视频在网上传播，视频出现后，引起越南国内一片哗然，所以电视剧《金瑛的日记》被停。', 'http://p2.music.126.net/JVvcTVg3EOZXQkp3MuN7Mw==/7742760882927410.jpg');
INSERT INTO `singer` VALUES ('1050282', '房东的猫', '快乐的民谣小组合 ：）\n唱作二人组，由吉他手吴佩岭（少年佩）和主唱王心怡（红鼻子小黑）组成。出道四年，已发行三张创作专辑《房东的猫》《柔软》《这是你想要的生活吗》，斩获不少奖项，去年他们带着新作品开启了「生活」场馆巡演，也大受好评。 房东的猫的音乐初听感觉非常的干净与清澈，平静中带着治愈。随着时间的推移与作品的累积，可以看出她们在不断寻求更多的可能性的同时，却始终都具备着温暖的基调与感人的力量，这是非常难能可贵的。并且她们的音乐在台湾、香港乃至马来西亚等地也十分受欢迎，是近年来为数不多能在港台地区进行馆级演出，去参加海外国际音乐节的新生代创作型音乐人。\n若有相关问题请私信微博：@青柴工作室', 'http://p1.music.126.net/Ypy6DuNsM9dUDAi-daXjmg==/2540971374930594.jpg');
INSERT INTO `singer` VALUES ('1050518', 'ILLENIUM', '来自美国丹佛的制作人ILLENIUM是目前最成功的跨界电子音乐艺人之一，他的作品高居美国舞曲榜前几名、播放量多达40亿，同时他也成为了各大世界顶级音乐节主咖。\n继他的首张专辑《Ashes》之后，ILLENIUM凭借他2017年的专辑《Awake》在主流音乐领域占据了一席之地。其中包括他的经典作品Crawl Outta Love，Fractures还有和Gryffin，Daya一起合作的Feel Good，都取得了重大成功。《Awake》在12个国家的iTunes电子专辑榜都居于榜首，获得了1亿多的播放量。\n2019年ILLENIUM发行了他的第三张专辑《Ascend》，也是他在主流厂牌的首秀。作为2019年最重磅的电子音乐发行（10亿多播放量）之一，该专辑荣登Billboard的“最佳舞蹈/电子专辑”排行榜榜首，并在Billboard 200获得前20名。专辑包括他与The Chainsmokers，Lennon Stella合作的热门歌曲Takeaway，与Jon Bellion合作的Good Things Fall Apart，与Bahari 合作的Crashing，与X Ambassadors合作的In Your Arms和Take You Down（记录了他过去与吸毒的斗争）。\nILLENIUM被认为是最近十年Billboard最佳舞曲/电子音乐艺人之一，他通过现场演出把梦幻般的音乐带给观众，征服了Coachella, Lollpalooza, Bonnaroo以及EDC等大型音乐节的观众。2019年的Ascend巡演中，他组建的5人乐队，在各大世界级演出场馆都一票难求，如纽约麦迪逊广场花园，洛杉矶斯台普斯中心，以及丹佛Red Rocks剧场（连续三晚演出）等。', 'http://p2.music.126.net/J97CFG2Cs0-X9eFbc46aQA==/109951166200418247.jpg');
INSERT INTO `singer` VALUES ('105286', 'Wiener Philharmoniker', '维也纳爱乐乐团（Wiener Philharmoniker，VPO）是目前最顶尖的古典交响乐团之一，成立于1842年，以纯正的德奥风格以及细腻美妙的音色闻名于世。乐团成员均来自维也纳国家歌剧院（Wiener Staatsoper），乐团常驻地为著名的维也纳音乐之友协会大厅（即“金色大厅”）。', 'http://p2.music.126.net/G-86Vk3yidhgEhd-Ez9B7g==/109951166111360463.jpg');
INSERT INTO `singer` VALUES ('1053061', 'NATAN', null, 'http://p2.music.126.net/KtYb4U3ab6qiBX4oUVmxWQ==/109951164137788296.jpg');
INSERT INTO `singer` VALUES ('1053145', 'CLC', 'CLC（씨엘씨）是韩国Cube娱乐旗下的一队七人女子音乐组合，现有七位成员包括承姬、有真、丞延、Sorn、睿恩、Elkie(已退队)及恩彬。CLC 于2015年3月19日正式出道，原始成员包括承姬、有真、丞延、Sorn、睿恩。2016年起2月29日加入两位成员回归，分别是Elkie及恩彬。团名“CLC”为“CrystaL Clear”之缩写，期许成员们能像水晶一样永远保持在洁净、闪耀的模样，出道前曾被称作“Cube Girls”。于2015年3月19日正式出道。\n2021年2月3日，CUBE娱乐正式宣布庄锭欣退出CLC组合；11月16日，成员Sorn合约到期并退出组合。', 'http://p1.music.126.net/g60PnTDCY1-BVvY9cT2Cbg==/109951165276521241.jpg');
INSERT INTO `singer` VALUES ('1053279', 'あいみょん', '爱缪（あいみょん Aimyon，1995年3月6日－）是日本女性创作歌手、作曲家及作词家，出生于兵库县西宫市，所属经纪公司为ENS Entertainment。', 'http://p1.music.126.net/0RMoHPQmrFptHqGg3N2qcw==/109951166652784583.jpg');
INSERT INTO `singer` VALUES ('1055016', 'OH MY GIRL', 'OH MY GIRL 是韩国WM Entertainment于2015年4月20日推出的首个新人女子团体，由崔孝定（HyoJung）、金美贤（Mimi）、柳諟我（YooA）、玄胜熙（SeungHee）、金祉呼（Jiho）、裵洧彬（Binnie）、崔乂园（ARin）七人组成。', 'http://p2.music.126.net/XYof3TicH_TP2wElyhMDNQ==/109951165965632791.jpg');
INSERT INTO `singer` VALUES ('1056002', '三无MarBlue', '知名唱见，哔哩哔哩UP主，独立音乐人，声线多变。', 'http://p1.music.126.net/Q4Kkm_AGui94QPsLsGOkuw==/109951165036531800.jpg');
INSERT INTO `singer` VALUES ('1058162', 'Two Popetorn', 'Popetorn Soonthornyanakij（ภพธร สุนทรญาณกิจ），小名：Two（ตู่），出生于1980年12月25日，泰国男演员、男歌手、词曲作者，影视作品有《公众系列》、《雀之灵》等。', 'http://p2.music.126.net/wDNPKY0t_w7aGSWqa-O8gQ==/2892815092873964.jpg');
INSERT INTO `singer` VALUES ('106157', 'Gun Napat', 'Gun Napat Injaiuea，1990年10月23日出生，泰国歌手、演员。2010年参加泰国THE STAR6 选秀比赛获得冠军，成为泰国超人气的歌坛新人。主要作品有泰剧《云中宝座》《船屋》《日落湄南河》等。', 'http://p1.music.126.net/SilkIXhndxq4udqkSAYbNQ==/109951165644755356.jpg');
INSERT INTO `singer` VALUES ('1063083', 'Deep Chills', '作为热带浩室中最著名的人物之一，位于米兰的Deep Chills去年凭借他的热门单曲“Run Free”开始风靡一时，在全球累积了超过6000万的视频观看次数，在许多国家和地区进入了排行榜，并在Shazam排行榜上排名第一。', 'http://p1.music.126.net/z44oBysdj4N38Rxlbx5TkQ==/18746673255070061.jpg');
INSERT INTO `singer` VALUES ('1064050', 'Official髭男dism', 'Official鬍子男dism，简称“胡子男”，2012年成军，2018年加入PONY CANYON正式出道。首支单曲<ノーダウト>(No Doubt)被选为日剧《行骗天下JP》主题曲。2019年，Official鬍子男dism又为该日剧同名电影演唱主题曲<Pretender>。歌曲接连34周在Oricon居榜首位，并成为当年最早突破2亿点击量的曲目。首张正规专辑<Traveler>于2019年10月9日发行，并一举拿下O榜周冠。2019年，他们登上了NHK第70届红白歌会，并在2020年初发行单曲<I LOVE...>，该单曲被选为TBS电视剧《将恋爱进行到底》主题曲。作为2020年度最受关注的J-POP音乐人之一，Official鬍子男dism前进的脚步将不会停止。', 'http://p1.music.126.net/ZboentRJYhE6SbZIhExylA==/109951165708932736.jpg');
INSERT INTO `singer` VALUES ('106600', 'Ten Nararak', '', 'http://p2.music.126.net/Y6Row2fV5QGJdq802TP2Ug==/3286440257902054.jpg');
INSERT INTO `singer` VALUES ('1078007', 'Monogem', 'Monogem 原名 Jen Hirsh，洛杉矶唱作人。2017年发行备受期待的 EP《100％》，同时推出 Remix 版本。单曲《Wild》MV 由 Coco Arquette（美剧《老友记》中 Monica 扮演者Courteney Cox 的女儿）主演，并获得 Good Morning America、E！、Daily Mail UK、Alternative Press、NYLON 和 Perez Hilton等各大国际媒体大力推荐。', 'http://p1.music.126.net/4negQF765TUHyCgcp3pxcg==/109951163950837367.jpg');
INSERT INTO `singer` VALUES ('1080132', 'SEVENTEEN', 'SEVENTEEN是韩国Pledis Entertainment公司于2015年5月26日推出的男子组合，团名“SEVENTEEN”代表13名成员+ 3个分队+ 1个团体= 17，其中3个分队分别为嘻哈队、表演队、主唱队。\n组合由崔胜哲（S.COUPS）、尹净汉（JEONGHAN）、洪知秀（JOSHUA）、文俊辉（JUN）、权顺荣（HOSHI）、全圆佑（WONWOO）、李知勋（WOOZI）、李硕珉（DK）、金珉奎（MINGYU）、徐明浩（THE8）、夫胜宽（SEUNGKWAN）、崔翰率（VERNON）、李灿（DINO）13名成员组成，其中有10位韩国成员，1位韩裔美籍成员(洛杉矶)1位美韩混血和2位中国成员。\n2015年5月29日，发布首张迷你专辑《17 CARA》并正式出道；9月10日，发布第二张迷你专辑《BOYS BE》。2016年1月14日，SEVENTEEN获得第25届首尔歌谣大赏新人奖；1月21日，SEVENTEEN获得第30届韩国金唱片金唱片新人赏奖。', 'http://p1.music.126.net/nWNzhdAxuHu1vOvaEh8HeQ==/109951166108106942.jpg');
INSERT INTO `singer` VALUES ('1081889', 'Why', '韩国男歌手。', 'http://p1.music.126.net/zMYZQT7mkMMj4h_4xHOWxQ==/109951163464405434.jpg');
INSERT INTO `singer` VALUES ('1084238', 'Lightscape', 'Lightscape来自加拿大的卡尔加里(Calgary,Canada)，音乐风格是Chillstep，在soundcloud上的简介是：\n“Every earthly stream runs dry But your love is a waterfall that fills me”', 'http://p2.music.126.net/Ot5wmXT-V-w4SUTmkCm12A==/7998947092614102.jpg');
INSERT INTO `singer` VALUES ('1085053', '变奏的梦想', '中国传统乐器与现代音乐风格的融合。\n所有作品未经允许暂不接受填词授权、二次创作等。\n商务邮箱：yinshu_wang@163.com\n商务QQ：860019570', 'http://p2.music.126.net/46eg9XFJOPJWH_nVEVf13A==/109951165419506198.jpg');
INSERT INTO `singer` VALUES ('1086095', 'てにをは', '8月23日生まれ、広島県出身。\n「ルリビタキの巣」がデビュー作。\nそれ以降、かなりのハイペースで作品を投稿しているP。\n名前は、助詞の「てにをは」に由来している。言葉の響きが摩訶不思議で好みだったこと、他に同名の人物もいそうになかったから付けた、とのこと。\n使用ボカロは、ミク、GUMI、リン、レン、flower。\n曲に関してはロック曲が多め。また、言葉遊びや、韻を踏んだ歌詞が特徴的。\n「怪異物ノ怪音楽箱」で念願の初殿堂入りを達成する。\n「古書屋敷殺人事件」から始まる「女学生探偵シリーズ」を展開中。\n2013年6月には同シリーズの楽曲をまとめたアルバム『女学生探偵ロック』でメジャーデビューを果たした。\n2018年3月29日、「古書屋敷殺人事件」にて自身初のミリオンを達成した。', 'http://p2.music.126.net/VdFXOmTEhyWJUxVg8tHhxw==/109951165603984673.jpg');
INSERT INTO `singer` VALUES ('1087025', '于海航', '游戏音乐制作人，游戏配乐师，毕业于中央音乐学院，曾任网易游戏公司高级游戏音频设计师。秦央Music Studio 创始人。主要音乐作品《秦时明月世界》《惊梦》《率土之滨》《天下3》《一拳超人》《时空中的绘旅人》《斗破苍穹》等', 'http://p1.music.126.net/6yBrg6-dKdQnynxuLHE8AA==/109951166558435373.jpg');
INSERT INTO `singer` VALUES ('1087651', 'とあ', 'とあとは、VOCALOIDを用いた楽曲を投稿している楽曲製作者の1人である。\n\n2013年2月20日、初音ミクオリジナル曲「*キセキ*」をニコニコ動画に投稿し、ボカロPデビューを果たす。\n使用VOCALOIDは初音ミク・GUMI。TwitterによるとIA・MAYU・杏音鳥音も所持している模様。\n\n2014年6月12日に投稿した14作目「ツギハギスタッカート 百アイコン」が大ヒットし、自身初のVOCALOID殿堂入り楽曲となる。', 'http://p1.music.126.net/6sHOMcQ2VH4pOvS1aoIodQ==/109951165547322405.jpg');
INSERT INTO `singer` VALUES ('10880', '朱晓玫', '朱晓玫（1949年－），法国华裔钢琴家，钢琴教授。目前居住在法国巴黎塞纳河畔，任教于巴黎音乐学院。', 'http://p2.music.126.net/5bewjSHLyu0fsDFwAdGq9Q==/109951165964956481.jpg');
INSERT INTO `singer` VALUES ('1097163', 'Dark Moon', '独立音乐人，坐标石景山区。主玩MIDI制作 电子 管弦 金属 摇滚 流行等 https://darkmoonyagami.bandcamp.com/', 'http://p1.music.126.net/11ABwOHnOCImjBxI2bwSAg==/109951165562013454.jpg');
INSERT INTO `singer` VALUES ('1108042', 'J_ust', '韩国男歌手，风格INDIE。本名서석우，于1992年12年29日在大邱广域市出生，2015年发行迷你专辑[#DearMuse #201507_08 #PinkRibbon]正式出道。', 'http://p2.music.126.net/CHayPN42Fq2BQCGKaBUxHQ==/109951164831297957.jpg');
INSERT INTO `singer` VALUES ('11127', 'Beyond', 'Beyond，中国香港摇滚乐队，成立于1983年，由黄家驹、黄贯中、黄家强、叶世荣组成。\n1983年参加“山叶吉他比赛”获得冠军并正式出道。1986年自资发行乐队首张专辑《再见理想》。1988年凭借粤语专辑《秘密警察》在香港乐坛获得关注；同年凭借歌曲《大地》获得十大劲歌金曲奖。1989年凭借歌曲《真的爱你》获得十大中文金曲奖、十大劲歌金曲奖。1990年凭借歌曲《光辉岁月》获得十大劲歌金曲奖。1991年主演电影《Beyond日记之莫欺少年穷》；同年9月在香港红磡体育馆举办“Beyond Live 1991 生命接触演唱会”。1992年赴日本发展演艺事业。1993年凭借粤语专辑《乐与怒》中的歌曲《海阔天空》获得十大中文金曲奖；6月30日，黄家驹去世，乐队以三名成员的组成形式继续发展。\n1994年发行专辑《二楼后座》。1995年至1999年发行的《Sound》《请将手放开》《不见不散》等五张专辑标志着乐队音乐风格的转变。1996年起连续四年获得叱咤乐坛流行榜叱咤乐坛组合金奖。1999年乐队宣布暂时解散。2002年获得第25届十大中文金曲金曲银禧荣誉大奖。2003年正式复出乐坛，并举办“Beyond超越Beyond”世界巡回演唱会。2004年凭借歌曲《长空》获得香港电影金像奖最佳原创电影歌曲奖。2005年举行“Beyond The Story Live 2005”世界巡回告别演唱会；同年乐队正式解散。2010年获得华语金曲奖“30年经典评选”的全部奖项 。\n演艺事业外，Beyond热心公益慈善。1991年前往非洲探访第三世界的穷困人民，并成立第三世界基金。', 'http://p2.music.126.net/EawqbkXCxGmxZ6nnqTKxKw==/109951165566992331.jpg');
INSERT INTO `singer` VALUES ('1115046', 'Tiên Tiên', 'Tiên Tiên本名Huỳnh Nữ Thủy Tiên(黄女水仙)，越南女歌手、作曲家，1991年1月23\n日出生于越南林同省。代表作品有《Em Không Thể》《Đi Về Đâu》《Say You Do》等。', 'http://p2.music.126.net/rGr2N5RZ-6A47vDeG1QTtQ==/109951165668498208.jpg');
INSERT INTO `singer` VALUES ('1115075', '西瓜JUN', '西瓜JUN，唱作人，独立音乐人。原创代表作：《狂野想乡》《忘记》《长生诀》', 'http://p1.music.126.net/M-_RXaKA5bgvQ9CfGeT4bQ==/109951163009254045.jpg');
INSERT INTO `singer` VALUES ('1115185', 'Lulleaux', 'Lulleaux 准备在旋律电子音乐的宝座上安定下来。刚刚从法学院毕业，他一直致力于混音和原创作品，以他清新的音乐之声震撼所有人。在过去的 3 年里，Lulleaux 在热带/深海波中建立了一个稳定的名字，但在 2017 年，我们将听到来自他实验室的更广泛的声音和风格。他于 2017 年 1 月以出色的 LNY TNZ 混音“Burn It Down”（Big & Dirty Rec.）开启了这一新的音乐方向，随后于 2 月在 EPIC 阿姆斯特丹唱片公司（Martin Garrix，Hardwell a.o.）上发行。请继续关注这位荷兰天才的更多新鲜声音。\n\nLulleaux 在他还是个孩子的时候就第一次展示了他的音乐潜力，学习弹奏钢琴和键盘。从那时起，年轻人的生活发生了变化，音乐就在那里。永远。\n\n2013 年，他发现了制作软件和转盘。他的混音带名为 Radieaux，在很短的时间内变得非常流行。 2014 年 6 月，Lulleaux 对 Anna Graceman 的“Words”进行了混音，该作品在 SoundCloud 上获得了 160 万播放量并被 Kygo 收录。\n\n在 Kygo、Sam Feldt、Bakermat 和旋律世界中更多 DJ 的支持下，Lulleaux 很快表明他知道如何提供强大的盗版和混音带，这使他在网上广受欢迎。他的 DJ 演出也很受欢迎，在音乐节和俱乐部演出，他知道如何使用他的唱机带领观众进行一场梦幻之旅。\n\n他已经建立了令人印象深刻的追随者。他出演了 Sam Feldt 的“Been a While EP”（Spinnin Records），为 Benny Benassi（Ultra Records）进行了混音，现在有多个原作准备发行。在他与 FDVM 合作制作名为“Up To You”的 Dirty Soul 之后，Sony Music 发行了“Never Let You Down”，Dirty Soul Records 推出了强力民谣“Fade Into The Sun”，这是他展示他能够创作的广泛音乐的方式生产。', 'http://p1.music.126.net/sA33daGGyd2N0J0ph5lbEw==/109951163038159947.jpg');
INSERT INTO `singer` VALUES ('1132127', '萧忆情Alex', '五婶：http://5sing.kugou.com/xiaoyiqing 暂时只接原创歌，有事请联系工作室QQ：3200399271 评论、私信每天都会看哟~', 'http://p1.music.126.net/IyXzb0oVsTC9JuQINHY2jg==/109951162864771217.jpg');
INSERT INTO `singer` VALUES ('1132392', '马思唯', '被纽约时报赞誉为“中国Hip-Hop界突破性明星说唱组合 - Higher Brothers” 的团队领袖，中国说唱代表人物之一 - 马思唯从21岁出道至今，已发布4张高水准个人Mixtape《P.E.I VOL.1》、《P.E.I VOL.2》、《P.E.I VOL.3》、《AFewGoodKids》，1张Higher Brothers Mixtape 《Higher Brothers》，2张团队正式专辑《Black Cab》、《Five Stars》，1张个人正式专辑《黑马王子》，并凭借“花花公子”，“Lover Boy 88”，“Made in China”, “WeChat” 等数首单曲屡次在全球范围掀起狂潮，全球试听超过2亿5千万次：从2017年与团队Higher Brothers发布首张正式专辑《Black Cab》开始，国内外巡演“座无虚席”；其中与KnowKnow合作的单曲“Lover Boy 88” 更是成为现象级夏日恋爱金曲；再到《Five Stars》专辑中与优秀Hip-hop音乐人们的合作包括Schoolboy Q，Denzel Curry，Soulja Boy，J.I.D等；2019年与Snoop Dogg合作发布单曲“Friends and Foes”，成为首个与欧美rapper共同为美剧打造主题曲的中国rapper；2020年发布大热专辑《黑马王子》，马思唯用一个又一个的作品向世人展示真正Made In China的顶级Hip-hop音乐，更是帮助Higher Brothers一举摘得网易云2018年度最佳说唱团体。2020年夏天首次以导师身份与黄子韬，Rich Brian, KnowKnow, 李宇春，MC Hotdog同台加入bilibili首档S+级综艺《说唱新世代》。并于2020年年末登上《时尚先生fine》杂志封面，作为封面人物之一出席时尚先生第17届MAHB年度盛典，荣获年度榜Young(音乐)奖项。 \n马思唯以音乐为马，和Higher Brothers作为中国说唱几乎唯一向西方乐坛输出的代表，走遍了全世界的各个角落。2021年带着第二张个人专辑《黑马》强势回归的马思唯，还将为我们带来哪些惊喜，让我们共同拭目以待。', 'http://p1.music.126.net/febcTfRaSHEHUIb0V45aPw==/109951165663083705.jpg');
