INSERT INTO `singer` VALUES ('1145042', '黑屋乐队', '中国内地摇滚乐队，2015年成立。以独立流行的音乐风格记录着独属于这个时代背景下青年眼中的人生百态，并期待通过与更多同龄人的交流及合作将这样的“世界观”完善起来。呼吁千奇的个性得到包容的同时，也坚信时间会让周遭变得更好。这或许是一个容易“浮躁”的时代，也总归要有人静下心来。', 'http://p2.music.126.net/dLRknYX1HkrJR-bUpXU6Mw==/109951165964542127.jpg');
INSERT INTO `singer` VALUES ('1150188', 'SHAUN', '韩国 DJ 兼音乐制作人 SHAUN 出生于1990年1月12日，2010年以单曲《Over and Over》出道。他出演过韩国Mnet电视台的DJ生存节目《Headliner》，所属社将他称为韩国的Ed Sheeran、Calvin Harris。他也是独立乐团 THE KOXX 的键盘手。这些年来 SHAUN 一直展现出他作为一个DJ、音乐人、作曲家和制作人的多样天赋，尤其是他精彩绝伦的现场表演，吸引了大量世界各地的粉丝。在2015年夏天，他通过出演韩国 Mnet 电视台的一档DJ生存综艺节目《Headliner》正式亮相，同时也作为一名歌曲制作人，参与过 BOA、EXO、SHINEE、F(X)、少女时代、4MINUTE、EPIKHIGH、李承焕和高润荷等韩国一线艺人的歌曲制作。2013年SHAUN 通过西班牙音乐厂牌 Mirage Records 发行个人独唱单曲《Silence》和《Curta in call》。2018年6月17日发行首张 EP《TAKE》，在韩国获得巨大成功，其中的《Way Back Home》是2018年 K-pop 领域最成功的单曲，排名甚至超过了防弹少年团 BTS 和 BLACKPINK。在YouTube平台，这首单曲抒情的 MV、UGC 视频剪辑和众多翻唱版本已累计获得上亿关注。《Way Back Home》连续五周在韩国 Melon 榜单上排名第一；SHAUN 也作为“2018年度突破独唱歌手”在韩国Melon上连续40天排名第一，是独唱歌手突破记录中登顶第一名时间最长的歌手。', 'http://p2.music.126.net/PGId74nWoBfvpksW0lAcwA==/109951165953626410.jpg');
INSERT INTO `singer` VALUES ('1156435', 'MΣ$†ΛMN ΣKCПØNΛ†', 'МΣ$†ΛMN ΣKCПØNΛ† 是一项不同寻常的音乐项目 \n作品通常为即兴创作或改编\n\n该项目的作者是来自俄罗斯鞑靼斯坦共和国的音乐制作人: Yan Belov.（男）', 'http://p2.music.126.net/5n4bb143nzYv_IiNG8kfpA==/109951163830380273.jpg');
INSERT INTO `singer` VALUES ('1161043', 'TWICE', 'TWICE是JYP Entertainment于2015年10月20日推出的女子演唱组合，由林娜琏、俞定延、平井桃（Momo）、凑崎纱夏（Sana）、朴志效、名井南（Mina）、金多贤、孙彩瑛、周子瑜9名成员组成。2015年10月20日以首张迷你专辑《THE STORY BEGINS》正式出道，官方粉丝名称为“ONCE”，应援色为浅杏黄色（Apricot）与霓虹洋红色（Neon Magenta），应援物为白底配以应援色为灯色的棒棒糖形态幻彩手灯（Candy Bong）。团名“TWICE”由公司创办者JYP取名，寓意为“观众的眼睛和耳朵能获得双倍的感动”。', 'http://p2.music.126.net/MGAzA7fVYOzBW0o46tFzOQ==/109951166646635121.jpg');
INSERT INTO `singer` VALUES ('1161187', 'Mr. Polska', 'Dominik Włodzimierz Groot (Toruń, 20 juli 1989), beter bekend onder zijn artiestennaam Mr. Polska, is een Nederlands-Pools rapper. Mr. Polska staat onder contract bij het Nouveau Riche-label en maakt deel uit van het hiphopcollectief van dit label.', 'http://p1.music.126.net/xX6_XrFm1-SzBg-7fgYhQg==/109951163639154496.jpg');
INSERT INTO `singer` VALUES ('1170007', 'Sơn Tùng M-TP', '山松M-TP本名阮青松，越南青年男歌手，1994年7月5日出生于越南太平省，2012年毕业于胡志明市音乐学院，同年正式出道，2017年成立娱乐公司MTP Entertainment。M代表music(音乐），T代表Tài năng（才能），P代表Phong cách（风格）。代表作品有《Lạc Trôi（漂浮）》、《Nơi Này Có Anh（这里有我）》《Chạy Ngay Đi（快逃吧）》等。\n', 'http://p1.music.126.net/YZKNaonM46B_r5DmWMjzWg==/109951163555322838.jpg');
