INSERT INTO `singer` VALUES ('11980037', 'MiyaGi', 'miyagi，俄罗斯rapper，生日：1990年12月13日，射手座，出生地：俄罗斯弗拉季高加索地区\nMiyagi (Rapper) was born on the 13th of December, 1990. He was born in 1990s, in Millennials Generation. His birth sign is Sagittarius and his life path number is 8. Miyagi’s birth flower is Narcissus and birthstone is Tanzanite, Turquoise, Zircon and Topaz. What does this all mean? Let’s find out!\nHis father is a well-known surgeon and the Head of the Center for Orthopedics and Aesthetic Surgery in North Ossetia. Azamat graduated from the medical academy. He started his career in rap industry in 2007. Between 2007—2013 he performed under the stage name \"Shau\", then he changed it to MiyaGi. He took his new name in honor of Mr. Miyagi, a character from the movie \"The Karate Kid\". In 2009, Azamat joined the Dope Records creative association. In August 2014, MiyaGi founded his own label \"Asata\", which, in addition to him, consisted of well-known Russian rapers Namo Minigan and Amigo. In September 2017, he released the first reggae solo single “Sunshine”. On May 18, 2018, after a long break, the single \"Сонная Лощина\" was released. In 2018, 3 more singles were released: “Captain”, “Sorry”, “Родная пой”. Azamat became a featuring artist on his friend\'s (KADI) track “Colors”. On January 4th he released his first club track \"Fantasy\". In April, two singles from the upcoming album were released: \"Angel\" and \"Bismarck\", featured by TumaniYO and KADI. On May 10, the track “Trenchtown” was released. On June 21, Miyagi\'s debut album “Buster Keaton” was released, which included 13 tracks, as well as joint tracks with members of Hajime Records: Andy Panda, HLOY, TumaniYO and KADI. On September 13th, a reggae-style track called Jamm was released.', 'http://p1.music.126.net/FkeNWe5CrG2t6g45QCMNag==/3263350521307093.jpg');
