INSERT INTO `singer` VALUES ('12023319', 'Cigarettes After Sex', 'CAS是由Greg Gonzalez于2008年在得克萨斯州埃尔帕索成立的美国梦流行乐队。 乐队以其轻柔，淡淡，通常像梦境般的音乐风格而闻名，通常基于浪漫和爱情主题的歌词以及冈萨雷斯的声音被描述为“雌雄同体”。虽然作为ambient流行乐团销售，但CAS也被认为是shoegaze，ambient流行乐，慢节奏和独立摇滚。乐队的首张延伸专辑（EP）于2012年发行，歌曲“ Nothing\'s Gonna Hurt You Baby”最终因商业许可而广受欢迎。 在2015年发行独立单曲《 Affection》之后，乐队于2017年6月发行了自己的同名首张录音室专辑，获得好评。在2019年8月，乐队宣布了他们的第二张录音室专辑《 Cry》以及单曲《 Heavenly》。 专辑于2019年10月25日发行', 'http://p1.music.126.net/s5cAljsrxnuNOl-ES_quog==/109951163042654233.jpg');
