INSERT INTO `singer` VALUES ('1203045', '艾热 AIR', '歌手、音乐制作人，擅长说唱而不仅仅止于说唱的新生代唱作人。\n代表作：〈乌云中〉、〈巨人〉、〈星球坠落〉。\n成长、突破、蜕变，不愿被定义，不局限说唱，音乐从不设限。\n业界评价：不可估量的艾热！他带来的是一种对HipHop的最全新的认知，是一种态度。不会步步紧逼的引人夺目，不张扬，不虚饰，不在狭小的生活圈里模仿。用最大的热情与爱意，心有所定，专注做事。', 'http://p2.music.126.net/2aCqy2k9cIMzJDd0TU9CMg==/109951164513946258.jpg');
INSERT INTO `singer` VALUES ('12031090', '新乐府', '“新乐府”是十三月文化经过多年音乐作品积淀、吸取中国传统文化精髓，打造出的世界音乐厂牌，具有强烈的中国元素属性。团结顶尖音乐家，对中国戏曲及民族民间音乐进行挖掘与采样，通过对现代国际音乐的理解，二度创作出具有鲜明中国 DNA 的国际水准的世界音乐。 现有板块【新乐府|粤剧】、【新乐府|昆曲】、【新乐府|评弹】、【新乐府|国粹Remix】、【新乐府|艺术家合作】、【新乐府|中外艺术家跨界即兴合作】。新的一年新乐府将更具备国际化视野。', 'http://p1.music.126.net/sTOJXVsAJltNg2wrWcydhQ==/109951162968428523.jpg');
INSERT INTO `singer` VALUES ('12039128', '肥皂菌丨珉珉的猫咪丨', ' 5SING翻唱基地第一位韩翻推荐歌手,拥有全站第一首韩翻编辑推荐歌曲Love Action以及多首电台推荐曲目(06年入主5sing,昵称:珉珉的猫咪).08年开始于百度东方神起吧合作,推出填词纪念视频系列,成为东方神起吧专用歌手.(期间代表作 Forever Love,together,Proud,I\'ll be there 等,部分作品用于09年深圳无爱豆的演唱会中).\n09年开始接触日翻,组织的H.T Family出过诸如RE:BRIDGE~Return to oneself~等代表作,成为5SING为数不多的中日韩三翻歌者;2014年初开始尝试在B站投稿.主类型为动漫OP/ED,B站昵称由来是初稿不会做视频用的肥皂一图流,之后索性就这么叫了.\n声音属于高亢的自燃类型,适合各类舞曲,燃曲以及正直的歌曲(?).对于安静的曲风会唱出不同的感觉.\n三次元的身份是一名声乐老师,所以常被人称作肥皂老师,常用的昵称还有chiyoko,猫酱,帅哥等.', 'http://p1.music.126.net/LGvKWqg5JEUagYTtEtKXqw==/1415071473077182.jpg');
INSERT INTO `singer` VALUES ('12041119', 'PENTAGON', 'PENTAGON，是韩国CUBE娱乐推出的男子偶像组合，现由赵珍虎、李会泽（HUI）、梁洪硕、高信源、吕畅九（YEOONE）、闫桉、安达祐人（YUTO）、姜炯求（KINO）、郑禹奭九名成员组成。该组合拥有歌唱、综艺、演技、舞蹈、外语五大方面的完美实力，目标是成为2016歌坛的全能型偶像团体。\n2016年4月26日零时，CUBE娱乐通过官方SNS及V APP频道公开“PENTAGON Trailer ~come into the world~ ”预告视频，宣布将推出10人组新男团PENTAGON。 成员有韩国籍的珍虎、HUI、洪硕、E\'Dawn、信源、Yeo One、KINO、禹奭，日本籍的YUTO，以及中国籍的闫桉。 2016年5月2日，出道真人秀节目《PENTAGON MAKER》正式播出。2016年10月10日，发行首张迷你专辑《PENTAGON》，正式出道。', 'http://p1.music.126.net/oIFTnOqiAjUIGFUe8gP0gg==/109951165806343966.jpg');
