INSERT INTO `singer` VALUES ('12079173', '小时姑娘', '歌手，时不语工作室创始人。代表作：《爱殇》（电视剧《东宫》片头曲）、《爱晚亭边》（电视剧《蓬莱间》画中仙单元主题曲、《烟火人间》（影视剧《玉昭令》插曲）、《他》（电视剧《如果岁月可回头》插曲）、《我不知道的事》（电影《精灵闺蜜》片尾曲）、《等风与你》（电影《战玄武》主题曲）、流量单曲《望》、《去追一只鹿》、《天生无畏》。合作过的游戏IP：王者荣耀、剑网3、逆水寒等。参加B站首届跨年晚会【2019最后的夜】见·东方组曲演出，2020年参加第四届共青团中央网络青晚演出，2020年参加王者荣耀五周年庆典演出等。微博@小时姑娘呐', 'http://p2.music.126.net/pEAXxkp6IslvwSOFOuuL0w==/109951166589952403.jpg');
INSERT INTO `singer` VALUES ('12079219', '李佳隆', '梦游少年JelloRio 李佳隆，13年开始接触说唱，16年加入重庆本地说唱厂牌WAVE MUZIK，吸收“川渝不分家”精髓， 作品风格可狠可柔、可说可唱，风格融合却不显突兀。2017年签约出人头地音乐厂牌，是圈内公认的“中国说唱黑马”。', 'http://p2.music.126.net/hJMa1G_pMN7f0pOtpWIkvQ==/109951163282069894.jpg');
INSERT INTO `singer` VALUES ('12083011', 'DJ COKE', '网易云独家签约音乐人.中国知名赛事DJ.战马街舞挑战赛主题曲制作人.中国街舞盛典最具人气DJ亚军.D80crew popper.\n舞战东北，WIB城市街舞大赛，WDG国际街舞大赛，Up tempo华北赛区，末日之战，战马街舞挑战赛，JPJD国际街舞大赛，HHI世界街舞锦标赛，德国DoOnlyGood China，日本YO!t\'s Free，韩国Korea Summer Wars，新加坡Marksman', 'http://p2.music.126.net/GVpYDxkDmuVh9i_rXBUn3Q==/109951164390025529.jpg');
