INSERT INTO `singer` VALUES ('12085066', 'ZIV', '来自西安的全能唱作人，早年间为福克斯、高天佐、大喜、李迦南等艺人编曲；后为白敬亭、Tia袁娅维、YoungG养鸡等艺人制作词曲；曾于梁老师Tsong、Al Rocco等艺人合作单曲。\n现已发表原创作品45首，393次进入官方热歌榜、新歌榜、人气榜、飙升榜以及原创榜，网易云总播放量破2亿，粉丝近10万。\n其中代表作《Melody》曾获得抖音飙升榜第二，热歌榜第四，抖音使用人数高至300w。', 'http://p1.music.126.net/2XJ3rWm9nBQ6RI5GTYHtzQ==/109951165606309796.jpg');
INSERT INTO `singer` VALUES ('12096061', '金请夏', '金请夏，1996年2月9日出生于韩国首尔，韩国女歌手，女子演唱组合I.O.I成员。\n2015年12月17日，参与演唱《PRODUCE 101》主题曲《PICK ME》。2016年4月1日，以40多万票在《PRODUCE 101》获得第4名，并成为限定组合I.O.I成员；5月4日，随组合发布首张迷你专辑《Chrysalis》；7月，参加舞蹈比赛节目《Hit The Stage》；8月9日，随组合发行单曲《Whatta Man (Good man)》，首批发行的3万张专辑在短时间内售罄。', 'http://p2.music.126.net/C2FY6XGVUYCPQT_MWzeDwA==/109951165745491254.jpg');
INSERT INTO `singer` VALUES ('12107172', 'Jah Khalib', 'Jah Khalib（Bakhtiyar Mammadov，1993年9月29日）生于哈萨克斯坦阿拉木图，是一个有才华的音乐制作人和卓越的表演者，更是一名杰出的rapper，在哈萨克斯坦的嘻哈音乐领域占有一席之地！', 'http://p1.music.126.net/zd5rd2MqOpaG57vGZONGVQ==/109951166132572549.jpg');
INSERT INTO `singer` VALUES ('12108460', 'Choco And Vanilla', 'Choco And Vanilla，韩国女歌手，独立音乐人，2016年6月13日发表首张单曲专辑《This Ain`t A Love Song》。', 'http://p1.music.126.net/SIBgbB2gDsycjbPRLudjJw==/109951163095246336.jpg');
