INSERT INTO `singer` VALUES ('12121101', 'J. Lisk', '大家好，我是J Lisk。我来自加利福尼亚。我自己学中文，但我仍然不太流利。 我非常喜欢音乐，健身以及学习语言和文化+旅游。我去过中国，并参观了北京，成都和香港。 希望我能尽快回来。加油 J. Lisk官方网易帐号 艺人 工作事宜 演出请联系: officialjlisk@gmail.com INS: jliskmusic 微博: JLisk音乐', 'http://p1.music.126.net/P9gUAsMvIvOe4b2cIBN1hA==/109951166034763987.jpg');
INSERT INTO `singer` VALUES ('12121252', '车银优', '车银优（차은우/Cha EunWoo），1997年3月30日出生于京畿道安养市，韩国歌手、演员，为韩国男子团体ASTRO成员之一，队内担任副唱、门面。就读于成均馆大学演技艺术系。\n2014年在电影《噗通噗通我的人生》中饰演宋慧乔、姜栋元的儿子亚凛，初次在屏幕上亮相。2015年，主演网络剧《To be continued》。2016年2月，随Astro组合发行首张迷你专辑《Spring Up》，正式出道；10月，担任MBC音乐节目《show音乐中心》固定主持人。11月，主演网络剧《我的浪漫暧昧食谱》。2017年，出演KBS综艺电视剧《最佳的一击》。2018年，主演JTBC浪漫爱情剧《我的ID是江南美人》，在剧中饰演男主角都景硕。在2020年底，tvN播出的《女神降临》中饰演男主角李秀浩。', 'http://p2.music.126.net/Qp7WYP4NJCpVZtcUURHv9g==/109951163471518614.jpg');
INSERT INTO `singer` VALUES ('12121368', 'DPR LIVE', '横空出世的 DPR LIVE. 朴宰范、loco、crush、Dean等 众多代表韩国嘻哈的热门艺人参与他的出道专辑Coming to You Live，因此被称之为艺人认可的艺人.', 'http://p1.music.126.net/LQ3NTbrOnQk9QUSaIzqmhA==/109951166191933557.jpg');
INSERT INTO `singer` VALUES ('12128924', '陈涛', '既然轻松看出\n你的话题极少\n何必故作遍造一套\n再去逗你乐趣\n兴奋到极点\n眼泪会流出来\n一个人会心痛\n可无悔死心不改', 'http://p1.music.126.net/BGlOMYs3JxEpYdguBf50og==/109951165614642852.jpg');
INSERT INTO `singer` VALUES ('12138269', '毛不易', '毛不易，原名王维家，1994年10月1日出生于黑龙江省齐齐哈尔市泰来县，中国内地流行乐男歌手，毕业于杭州师范大学护理专业。2017年，参加选秀娱乐节目《明日之子》的比赛，获得全国总决赛冠军，从而正式进入演艺圈；9月1日，推出首张个人音乐专辑《巨星不易工作室 No.1》；11月11日，推出个人原创单曲《项羽虞姬》。', 'http://p1.music.126.net/W5LXS0-I-P9Wk6lQpS6HGA==/109951165787072463.jpg');
