INSERT INTO `singer` VALUES ('12155133', 'EXO-CBX', 'EXO-CBX是SM娱乐旗下韩国男子音乐组合EXO在2016年组成的子团体，组合名称是由三位成员Xiumin、伯贤Baekhyun和Chen的英文名开头字母组成，并于10月31日推出首张迷你专辑《Hey Mama!》。2017年5月24日，EXO-CBX于日本出道并发行第一张日语迷你专辑《GIRLS》，9月22日，EXO-CBX为日剧《最后的生命：即使你明天消失》演唱OST《Cry》。2018年1月，EXO-CBX公布他们将展开首次日本竞技场巡演《Magical Circus》。', 'http://p1.music.126.net/G7c6MtYNZxbbJzOhtoEc6g==/109951165770594931.jpg');
