INSERT INTO `singer` VALUES ('12170236', 'MOMOLAND', 'MOMOLAND（朝鲜语：모모랜드），是MLD娱乐（前称Dublekick Company）于2016年透过与Mnet合作的练习生竞争节目《SURVIVAL MOMOLAND를 찾아서》选出的女子演唱团体，由10位少女在节目中挑战不同任务，争取出道机会，最终选出 慧彬、Nancy、妍雨、娜允、娥仁、珠园、JANE 七名成员。后来再加入两名成员 泰河、Daisy。\n2017年3月28日，加入在《SURVIVAL MOMOLAND를 찾아서》落选，JYP娱乐练习生出身的Daisy。\n2017年4月10日，加入PRODUCE 101、STARSHIP娱乐练习生、宇宙少女预备成员出身的泰河（JYJ成员金俊秀的堂妹）。\n2019年11月30日，官方宣布妍雨和泰河退出组合。Daisy目前则和公司还处于协商中，因此MOMOLAND将以6人体制活动。', 'http://p1.music.126.net/XLpixDwmjGRjEDd8Jakjjw==/109951165054872650.jpg');
INSERT INTO `singer` VALUES ('12172312', '高宇Slient', 'WeChat： Rap8000', 'http://p1.music.126.net/U7ybJw6Pta-ZXJBxmXs2BA==/109951165350004560.jpg');
INSERT INTO `singer` VALUES ('12174521', '音阙诗听', '微博：@音阙诗听 合作：hz@interestingcn.com\n音阙诗听音乐社团，成立于2016年11月1日，由殇小谨与李俊羽发起组织，围绕中国特色音乐实验室，塑造全新的互联网音乐实验团体。', 'http://p1.music.126.net/9AxOvJQqBkMY0pHC9VbPCw==/109951162809089968.jpg');
INSERT INTO `singer` VALUES ('12175308', 'はるまきごはん', '春卷饭（はるまきごはん）\n从作词、作曲、编曲到插画、视频、动画制作，所有创作均由1人完成，同时对作品质量也有着极高的要求。虽然名字颇具pop感，但一直以来作品中展现的多是伤感且情感充沛的世界。\nVOCALOID和自身的演唱，用两种方式演绎作品，演唱会借助原创动画打造戏剧化的效果，收获了极高的评价。同时也为众多知名艺人提供乐曲，2020年还为家乡札幌举办的“SNOW MIKU 2020”创作了官方主题曲。', 'http://p2.music.126.net/CjLpDXZSwImjOr8E3UbJrw==/109951166522070028.jpg');
