INSERT INTO `singer` VALUES ('12193174', 'Capper', 'Capper，本名张砚拙（yanzhuo Zhang），2000年6月21日生于古都西安的职业说唱歌手、街头平面设计师。 Capper,whose real name is yanzhuo Zhang,was born on June 21,2000 in Xi\'an,Shanxi Province,the first ancient capital of China,sa a professional rapper and street graphic designer in the \'00\'s. 微博：@是啊Capper\n网易云音乐：Capper\nins：cappermadeinfuture\n邮箱：cappermadeinfuture@gmail.com 工作邀约联系方式：186-2325-2124', 'http://p2.music.126.net/CMVy97f0811PcgIxzMfQ5Q==/109951163899074424.jpg');
