INSERT INTO `singer` VALUES ('12283512', '刘悦spam-生番', 'spam的意义 ：Specially Processed Assorted Music(特别的音乐合成加工)\n2007年先后出过两张个人mixtape,2010年组建了石景山首个说唱团队\'1043\'，2012年推出团队mixtape\'脏的·经历大小演出多场，包含section6等众多地下hiphoplive及音乐节。2011年开始对hiphop beat制作产生浓厚兴趣，12年团队发行·脏的\'mixtape中同名主打歌·脏的·的伴奏就是spam早期采样作品，2014年开始接触akai mpc开始制作更为专业的采样beat及原创beat,15年与黄硕、梁维嘉进行创作合作，推出原创单曲(shout out)及(破而后立)16年合作单曲(busta rap)并制作(北京地牢)伴奏、17年推出合作单曲(underground shit)备受好评。16-17年先后推出了四张伴奏合集一一(福禄寿)、(just so so)、(末代皇帝）、(westing)，18年正式加入丹镇北京厂牌-aka. “生番”', 'http://p2.music.126.net/4j4EXjEqdRjcUeJvD61l2g==/109951163443300508.jpg');
