INSERT INTO `singer` VALUES ('12322107', 'THE TOYS', 'THE TOYS (เดอะทอยส์)，大名：ธันวา บุญสูงเนิน (Thanwa Boonsungnern)，小名：Toy (ทอย)，出生于1995年12月1日，泰国男歌手、词曲作者、音乐制作人，代表作品《去年冬天 (หน้าหนาวที่แล้ว)》《雨季之前 (ก่อนฤดูฝน)》《Lalaloy (ลาลาลอย)》，目前所属What The Duck唱片公司。', 'http://p1.music.126.net/BZbEQk3GWui4W6fpsAvRTQ==/109951166422415709.jpg');
