INSERT INTO `singer` VALUES ('12334348', '菅田将暉', '菅田将晖（すだ まさき，1993年2月21日－），日本男演员，出身于大阪府，隶属于TOP COAT旗下。2009年饰演特摄《假面骑士W》的两名主角之一，开始演员生涯。', 'http://p2.music.126.net/dfL_edu47LniHOU0DJSuOQ==/109951166501639975.jpg');
