INSERT INTO `singer` VALUES ('123641', '辉星', '在韩国快速窜起的新生代R&B天王“辉星”（WHEESUNG），其表现不仅获致从乐迷到音乐工作者的全面肯定，并得到饶舌天皇徐泰智（Seo Taiji）与情歌之王申升勋（Shin Seung Hun）的背书推荐，单凭首张专辑便已获得“韩国的Brian Mc K night”的封号，其个人网站也写下了二十日内百万人次登入的空前流量，出道声势凌驾所有韩国当今天王天后，是只手创造韩乐优质新世代的超级新男声。', 'http://p1.music.126.net/KTzg4kfXbuSN_huJcM6F2A==/109951163049264906.jpg');
INSERT INTO `singer` VALUES ('12370187', 'Nanon Korapat', '格拉帕·格潘\nKorapat Kirdpan\n性别：男\n星座：射手座\n出生日期：2001-12-18\n出生地：泰国，曼谷\n更多外文名：กรภัทร์ เกิดพันธุ์（泰文）\n家庭成员：爸爸，妈妈，妹妹\n简介\n格拉帕·格潘（Nanon），2001年12月18日出生于泰国暖武里府，泰国男演员。', 'http://p1.music.126.net/cirowLZKiwOYbjJfVO88nw==/109951166606600450.jpg');
