INSERT INTO `singer` VALUES ('123825', 'July', 'July，本名李东勋，是韩国歌手、作曲家。1980年2月6日出生于韩国釜山广域市，曾经就读于韩国梁山大学建筑设备系，中途辍学。July于2006年1月23日发行了个人第一张专辑《旧爱》，现在所属社为digitalrecord。', 'http://p1.music.126.net/riqcGiqW9IV46wHxmzrSeg==/767459116209516.jpg');
