INSERT INTO `singer` VALUES ('124026', 'KCM', 'KCM，韩国歌手，代表作品：《爱你至死不渝(Feat. Soul Dive)》《太阳的眼泪》《Smile Again》。', 'http://p2.music.126.net/IVZR4ziRdD0Vzo3CIY0TuQ==/666304046454886.jpg');
INSERT INTO `singer` VALUES ('124097', 'Yiruma', '李闰珉在韩国出生英国长大，曾就学于英国伦敦\'The Purcell School\' 特别音乐学校，后来毕业于 \'King\'s College of London University\' ，主修作曲。在他的音乐作品里，展现了兼融东方的抒情与西方的典雅细致的音乐风格。因主修古典钢琴与作曲，Yiruma展现他傲人的古典才情与欧洲人善感的特质；同时，纯净与清新的东方特色也呈现在他的音色里。藉由细致的音乐性探触，他精致的演奏技巧，予人一种非凡艺术家的深刻印象。YIRUMA是韩国偶像剧大导尹锡湖御用钢琴手。代表作品：《Love Scene》《First Love》《Kiss The Rain》', 'http://p1.music.126.net/VjoFMSiKmpxkx76zs9IOsQ==/7850513023495609.jpg');
INSERT INTO `singer` VALUES ('12413', '慕寒', '慕寒，古风音乐人。\n代表作：《落霞云归》《别赋》《盛世回首》等。微博：@慕寒mio', 'http://p2.music.126.net/2RS_QCaTXUGWSvczFkchpA==/109951163621635232.jpg');
INSERT INTO `singer` VALUES ('124470', 'October', 'October（악토버）(原名:곽민호) ，于1995年2月3日出生首尔，是韩国New Age钢琴演奏家和作曲家。', 'http://p1.music.126.net/Pk4zj48v0EH8moaOgPVV2g==/5929666209030782.jpg');
INSERT INTO `singer` VALUES ('124492', 'PSY', '朴载相，艺名PSY，别名鸟叔，出生于1977年12月31日，毕业于美国伯克利音乐学院，2001年正式的出道，2010年8月签入YG Entertainment，是韩国很著名的R&B实力派歌手，“鸟叔”之名大概是源自于他2001年1月18日发行的正式一辑《PSY来自神经质的世界》中的歌曲《鸟》，这首歌当时在席卷韩国，让鸟叔人气飙升。让鸟叔真正在全球火起来的，是2012年的《江南Style》，2012年11月8日，韩国歌手PSY的《江南Style》获得了吉尼斯认证,打破youtube吉尼斯世界纪录.被评为史上最多网民“Like”数最多的视频。2013年，朴载相推出单曲《绅士》。2014年6月，朴载相与饶舌歌手Snoop Dogg携手合作了《HANGOVER》 。2015年7月，发行个人第七张正式专辑。2017年5月10日，发行第8张正规专辑《4X2=8》。', 'http://p2.music.126.net/z99zyKqj7L-yMjf3Loe-5Q==/109951166214543571.jpg');
INSERT INTO `singer` VALUES ('12453329', '功夫胖KungFuPen', 'FREE MY SOUL', 'http://p2.music.126.net/Iv2PD2gnImLarxnpeLeN1A==/109951165210084191.jpg');
INSERT INTO `singer` VALUES ('124542', '朴宰范', '朴宰范（正确中文译名为朴载范）美籍韩裔，韩国最大艺人公司 SidusHQ旗下艺人。2008年以偶像组合2pm队长身份出道，2009年退队，2010年初与JYP解除合约，现为solo歌手、B-boy dancer、rapper、音乐制作人，songwriter, composer, model, choreographer。2010年3月因在youtube上传了自己改编歌词并且翻唱的B.O.B的《Nothing on you》，在不到24小时的时间内达到了200万的点击率，而一跃被国际认知，奠定了其在欧美的人气。2010年6月，朴宰范重返韩国，独立担当自己专辑的作词作曲制作人，成为了韩国歌坛新一代实力派偶像歌手。2013年创建音乐厂牌AOMG，2017年创建音乐厂牌H1GHER MUSIC', 'http://p2.music.126.net/KMeSNIoEP5JEo2T004VQUg==/109951166055278681.jpg');
