INSERT INTO `singer` VALUES ('124730', 'San E', '姓名：San E 本名：郑山（音译） 2010年 第七届韩国大众音乐奖 最优秀 Hip-Hop奖   　　JYP娱乐精心打造的第一个说唱歌手San E在即将出道前夕公开了搞笑照片吸引众目光。 ', 'http://p1.music.126.net/30Zd9PoVubW6JWjIFg0-TA==/18651015743360550.jpg');
INSERT INTO `singer` VALUES ('12475709', 'Robin Hustin', '罗宾·胡斯汀是一位20岁的荷兰DJ兼制作人。出生于卢森堡市，5岁开始敲鼓，2015年16岁时开始创作自己的音乐。', 'http://p2.music.126.net/Qi7PNVzAqVSMgIMBuqwLeQ==/18722483999729539.jpg');
INSERT INTO `singer` VALUES ('12487204', '一二三', null, 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('12514278', '那吾克热-NW', '那吾克热·玉素甫江（那吾克热-NW），中国内地流行说唱男歌手，毕业于北京第二外国语学院。\n2014年12月，推出首张个人音乐专辑《征途》（《MUSAPE》），从而正式进入演艺圈。2015年，参加CCTV-3原创音乐真人秀节目《中国好歌曲第二季》，最终获得刘欢组5强；同年，推出个人原创单曲《疯人院》。2016年，推出首张个人EP专辑《Hi 那吾》。2017年，出演了音乐剧《阿尔兹记忆的爱情》；同年，推出个人硬核说唱EP专辑《空袭》。2018年，参加爱奇艺音乐选秀节目《中国新说唱》，最终获得总决赛亚军；12月18日，获得中国时尚权力榜年度先锋说唱歌手奖。2019年5月11日，获得音乐先锋榜三十一载荣耀盛典最佳说唱歌手奖。', 'http://p1.music.126.net/MET9PrjxHdzl_1vdtRW0HA==/109951163755419545.jpg');
INSERT INTO `singer` VALUES ('125175', 'Ailee', '李艺真（이예진 )，英文名Amy Lee，艺名Ailee（에일리），美籍韩裔歌手、演员。1989年5月30日出生于美国科罗拉多州丹佛，在新泽西州成长，毕业于苏格兰平原高中，曾就读佩斯大学，现休学中。经纪公司为YMC Entertainment，2012年2月9日以单曲《Heaven》正式出道。', 'http://p1.music.126.net/DwK6UMMBoyAJSjU8tKK6hw==/109951165095951320.jpg');
INSERT INTO `singer` VALUES ('125216', '白智英', '白智英，出生于1976年3月25日，擅长拉丁曲风，并以深情沙哑的嗓音而闻名，因参与演唱了许多热播韩剧的主题曲而被观众所熟知，被誉为韩国“OST女王”。白智英出道专辑的主打曲《SORROW》，是舞曲味道较浓的Pop、Drums、Bass曲风的混音音乐，也是旋律柔和的动听佳作。主打曲是表达利用因特网创造新世界的N世代的心声，是很适合边聊天边欣赏的歌曲。2001年底，白智英被前经理人兼男友公开两人上床的录像带后，所有演艺工作暂时被停止。2006年，经过长期的沉淀，白智英终于爆发并凭借《不再爱了》一举拿下Mnet KM 2006 最佳女歌手奖，事业走向了全新的开始。代表作：《不要忘记我》、《那个女人》、《像中枪一样》等。', 'http://p2.music.126.net/4tO5OizGSkk1FGonOQcjXQ==/109951164575365079.jpg');
INSERT INTO `singer` VALUES ('12531080', 'R!N/Gemie', 'R!N/Gemie,1994年6月8日生日，出生于爱媛县松山市。日本女性歌手。\n', 'http://p1.music.126.net/57YtLIar-Sy4YNT5Uh1Myg==/109951163124213955.jpg');
INSERT INTO `singer` VALUES ('12533932', 'Tanir', null, 'http://p2.music.126.net/d_ak67m4vMkXE8U9WpWA9w==/109951164567396272.jpg');
INSERT INTO `singer` VALUES ('125394', '洪真英', '洪真英(홍진영，Hong Jin Young），1985年8月9日出生于光州广域市，韩国女歌手、演员。‘SWAN’组合成员。毕业于朝鲜大学。\n2006年，洪进英以电视剧《渊盖苏文》出道。2007年与韩智娜、许允美、金妍智三人成立‘SWAN’组合。2009年于《Mnet亚洲音乐大奖》中获得最佳Trot奖。2012年，荣获第12届大韩民国传统歌谣大赏优秀歌手赏。2013年，取得朝鲜大学贸易学博士学位。2014年3月11日开始录制《我们结婚了》，假想丈夫为演员南宫民。同年获得mbc演艺大赏Variety部门女子优秀奖，2015年，获得第29届金唱片最佳trot奖。', 'http://p1.music.126.net/yJRK3-QwRYUxlcbwg7A8sw==/109951163940812989.jpg');
INSERT INTO `singer` VALUES ('12541250', 'Arthur Rubinstein', '阿图尔·鲁宾斯坦（波兰语：Artur Rubinstein，英语：Arthur Rubinstein，1887年1月28日－1982年12月20日），美籍波兰裔犹太人，著名钢琴演奏家，是20世纪最杰出、也是“艺术生命”最长的钢琴家之一。鲁宾斯坦被称为“最正宗的肖邦”，他一生不断地录制肖邦的作品，使自己的气质与肖邦的气质真正合而为一。他的演奏有温暖亲切的抒情、敏锐的分句加上丰富的音色与浓郁的诗意的特色。除肖邦之外，他演奏的贝多芬、勃拉姆斯和柴科夫斯基都注重于抒情性，有自己的特色。鲁宾斯坦不仅是杰出的钢琴家，也是杰出的室内乐大师，他与海菲茨、富尔曼及后来的皮亚蒂戈尔斯基组成的三重奏被称为“百万美元三重奏”，是二十世纪最伟大的室内乐团之一。他还与瓜纳里四重奏团成员合作组成钢琴四重奏、五重奏，录制了大量优秀唱片。', 'http://p2.music.126.net/iaqhBp0XUF_YSpoDK89NOw==/109951163250149252.jpg');
INSERT INTO `singer` VALUES ('12544125', 'Janos Sebestyen', null, 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('12561265', 'ASCA', 'ASCA（アスカ、1996年9月5日 - ）は、日本の女性歌手、大倉明日香によるソロプロジェクトである。愛知県出身。', 'http://p2.music.126.net/eVy7YaIQ2vy2JRT192D5QA==/109951166048545952.jpg');
INSERT INTO `singer` VALUES ('12561282', 'Rhymastic', 'Vu Duc Thien（1991年4月8日出生），别名Rhymastic（称为Rhym）或Young Crizzal（YC），说唱歌手、音乐家、歌手、音乐制作人，越南男性，SpaceSpeakers团队成员。当他能够表达各种流派、音乐主题和说唱时，许多人认为他是越南非常全面的说唱歌手。', 'http://p2.music.126.net/WC-rO-Rkg4JMUYNITNTX0Q==/109951166073899292.jpg');
INSERT INTO `singer` VALUES ('125686', '李宝蓝', '李宝蓝，韩国女歌手，女子组合SeeYa成员，2017年1月发行个人首张数字单曲专辑《엎질러진 물처럼》。', 'http://p1.music.126.net/nVnmpcYhZqbYIxmcckUNQg==/109951163079232018.jpg');
INSERT INTO `singer` VALUES ('12570417', '那奇沃夫', 'monarkkluvvs e&m trappin‘on you wolf gang', 'http://p1.music.126.net/Dm_L6BDLfy5j7vkTiJomYA==/109951166674895412.jpg');
INSERT INTO `singer` VALUES ('125783', 'NS允智', '金允智，艺名NS允智（NS Yoon-G），1988年9月6日出生于韩国首尔，韩国solo女歌手。从小学四年级时就去了美国，一直到大学毕业后才回到韩国。她拥有着与姜智英一样的美貌以及修长的身材，现在已经成为韩国网络的热门话题。09年9月24日NS允智节奏感十足的出道单曲《头痛》让人能够联想起走同样歌路的女星孙丹菲，同时通过这首歌曲的舞台表演也充分展现出金允智的舞蹈实力。12年伊始一首《变成魔女的理由》破格大变身，为她树立了魔女形象，逐渐为大众所知。12年11月发表与朴宰范合作单曲《IF YOU LOVE ME》成为热门话题，令人中毒的旋律以及超高的完成度让这首歌成为NS允智最成功以及最受国民喜爱的代表作。14年4月，再次携手二段横踢强势回归，带来融合性感怀旧的探戈与嘻哈节奏主打曲《Yasisi》预告公开立刻成为Naver热门搜索。令人羡慕的身材以及稳定的舞台表现巩固了代表性感女歌手的地位。', 'http://p1.music.126.net/7C-Jv6N6F4CT5gPcHFjxqg==/7897792022883418.jpg');
INSERT INTO `singer` VALUES ('125829', '朴春', '朴春（Bom Park），韩国女歌手，女子组合2NE1的成员之一。1984年3月24日出生于韩国首尔市，毕业于美国Lesley大学心理学系，所属YG Entertainment公司。出道前曾与李孝利，李准基一起出演了三星公司的广告，不久播出後，广告里跳舞的女孩立刻成了人们疯狂检索的对象。原本以为朴春会在这个大好时机以Dance歌手出道，随後开始一系列华丽的宣传。但出乎人们意料的是，不久後这个跳舞的女孩就消失在了人们的视线中，做回了她的普通练习生，3年後才重新以新的面貌出现。作为2NE1的主唱，朴春拥有一把极特别的好声音。', 'http://p1.music.126.net/uQ73MCkb1qAEBt6tbOJX7w==/109951163923110281.jpg');
INSERT INTO `singer` VALUES ('12594368', 'Георгий Виноградов', '乔治·巴甫洛维奇·维诺格拉多夫（俄语：Гео́ргий Па́влович Виногра́дов), 俄罗斯荣誉艺术家，俄罗斯男高音：莫斯科广播电台的二战知名流行歌手、录音艺术家和亚历山德罗夫合唱团的独奏家。', 'http://p1.music.126.net/bdylxO5GOPxSntY0XCgvwA==/109951165921424178.jpg');
INSERT INTO `singer` VALUES ('126011', '尹美莱', '尹美莱在现在的韩国是首屈一指的女RAPPER，绝对的大前辈，老公更是RAP圈内的大佬，两个人堪称韩国HIP POP 音乐的最高结合，可以毫不夸张地说是韩国的Beyonce和Jay-Z。', 'http://p1.music.126.net/mNwB377o44Rl92EcVZ_f1A==/3246857838689096.jpg');
INSERT INTO `singer` VALUES ('12605500', '盛宇DamnShine', '盛宇（DamnShine）中国著名说唱组合C-BLOCK队长、中国最具影响力的说唱厂牌SUP MUSIC创始人、华语音乐人、演员、词曲创作者、MV导演、制作人、国家级二级运动员。中国规模最大的HIP-HOP音乐节“YOLO青年文化节”创始人、中国头部服装潮牌“BIPOLAR”主理人、街头篮球俱乐部“FlyBoy胡来波”创始人兼球员、 “IELO”CLUB老板\n\n2018年纪录片《从无到有》，记录盛宇和美国说唱同行的交流与演出\n2019年和陌陌、VICE联合推出4集公路音乐纪录片《陌路同途》，记录C-BLOCK\n新歌《很高兴认识你》创作过程获得2019“金瞳奖”“最佳原创内容栏目纪录片+最佳系列微电影”银奖 2018年创作单曲《长河》并入围网易云音乐热歌榜\n2019年为公安部人民检察网“劝止酒驾”公益活动创作公益歌曲《醉酒的满哥》\n2019年获得融合嘻哈颁奖典礼·最受欢迎说唱团体\n2019年为爱奇艺极速版创作广告单曲《越快越AI》并拍摄MV\n2019年为斗牛APP创作广告单曲《牛得拿来斗》并拍摄MV\n2020年参加“网易云点亮现场行动”线上音乐会，数据夺冠，票房&弹幕有效观看均创新高\n2020年为伊利经典创作广告单曲《Let it go》并拍摄MV\n2020年为腾讯游戏《NBA2Kol2》创作广告弹幕《野草蛮生》并拍摄MV\n2021年参与拍摄湖南卫视纪录片《傲椒的湘菜》\n2021获得“硬地围炉夜”网易云音乐原创盛典·年度乐队/团体奖\n2021年担任QQ音乐“地下八英里”全国总决赛评委\n2021年为20集电视连续剧《我是真的爱你》创作插曲《Respect》，该剧由北京卫视、东方为主播出\n2021年受联合国艾滋病规划署、中国预防性病艾滋病基金会、淡蓝公益委托创作公益歌曲《孤影》并拍摄MV\n2019 《中国新说唱》选手，获得季军 2020 《中国新说唱》担任嘉宾大魔王 2020 晚会《元宵一家亲》，创作并演唱抗疫歌曲《屋檐》\n2020 参加CCTV 综艺频道《我要上春晚》获得直通春晚资格 2021 直播晚会《抖音 新潮好物夜》\n2021 《天天向上》，创作并演唱开场曲《CSC love》\n2021 《少年说唱企划》担任导师 2021 《拳力以赴的我们》最佳人气热门拳手', 'http://p1.music.126.net/JtSxF-ZWrW4eJYliquZgWw==/109951166598176534.jpg');
INSERT INTO `singer` VALUES ('126066', '泫雅', '金泫雅，出生于1992年06月06日，以前为CUBE Entertainment旗下艺人，现为P NATION经纪公司旗下艺人。前女子组合4MINUTE成员之一。外表甜美可爱的她舞蹈性感、节奏强劲，被称为大韩民国最会跳舞的女艺人。泫雅原是Wonder Girls成员，2009年6月18日，以4minute组合成员身份正式复出，以首张单曲《HOT ISSUE》正式出道。2010年1月4日泫雅发表了她的个人单《Change》。2012客串了Psy的《江南style》，后来又演唱了女版《哥哥就是我的Style》。而泫雅个人第二张迷你专辑《MELTING》一经发出，主打歌《Ice Cream》在YouTube里的点击量不到三天就打破了韩国神曲“江南style”的记录，成为了韩国娱乐界在国际的代表人物之一。代表作品：《Change》《Bubble Pop》《Icecream》等。', 'http://p2.music.126.net/e9BlvbsNX7bk6m871ZejEw==/109951165672045631.jpg');
INSERT INTO `singer` VALUES ('12623251', '老番茄', '游戏区up主，微博@_老番茄_', 'http://p2.music.126.net/D86y6oyBHQghPJWB9v5gow==/109951163020567376.jpg');
INSERT INTO `singer` VALUES ('126312', 'AOA', 'AOA（韩语：에이오에이；Ace of Angels的首字母缩写，直译“王牌天使”）是韩国FNC娱乐旗下第一支女子音乐组合和女子舞蹈团体，也是FNC第一支音乐与舞蹈共同活动的团体，最初由8名成员组成，现任成员包括智珉、酉奈、惠晶、雪炫和澯美，由智珉担任队长。成员们都有著一个特别的天使名字。而天使故事就是七位天使与连结地面之门的钥匙持有者，半天使Y发生的奇妙故事。七位天使经常透过水晶球看人类的世界，透过水晶球她们喜爱上了人类的音乐，忍不住好奇的Y，於是利用手上的钥匙，开启了地面之门，与七位天使来到地球。', 'http://p1.music.126.net/hO0sc9Q3p_QGM2UFvCv8RA==/109951164512160358.jpg');
INSERT INTO `singer` VALUES ('126339', 'BIGBANG', 'BIGBANG（빅뱅），韩国男子演唱组合，现以G-DRAGON（权志龙）、T.O.P（崔胜铉）、TAEYANG（东永裴）、DAESUNG（姜大声）四名成员的组成形式展开活动，组合原成员SEUNGRI（李胜贤）于2019年3月退出。2006年8月19日，组合以五人组形式在YG Family世界巡回演唱会首尔站上正式出道，并于同年12月22日发行首张正规专辑《BIGBANG VOL.1  SINCE 2007》。2007年5月开始进行全国巡回演唱会，并于7月推出第一张迷你专辑《Always》。2008年8月8日发行MINI专辑《STAND UP》，专辑中的歌曲《一天一天》在KTF连续六周蝉联第一名。2009年赴日本发展。2011年成为历史上第一个获得MTV欧洲音乐奖“Worldwide Act”的亚洲组合，并于2012年上半年登上美国格莱美官方网页，成为首个被格莱美介绍的韩国歌手。2012年2月发行迷你5辑《ALIVE》。2015年回归韩国歌坛；同年5月至8月发行数字专辑《MADE》，四张MINI专辑总销量超过340万。2016年8月20日在韩国首尔举办出道十周年纪念演唱会。2016年12月8日发行正规数字专辑《MADE FULL ALBUM》。', 'http://p2.music.126.net/dCeCerm-oUWn46Lq_yVKag==/109951165566707494.jpg');
INSERT INTO `singer` VALUES ('126345', 'Brave Girls', 'Brave Girls（朝鲜语：브레이브걸스）是韩国Brave娱乐在2011年推出的五人女子团体，最初由恩英、书雅、艺真、瑜真、慧兰组成，现任成员有玟莹、侑廷、恩智、裕那。2011年4月8日发行首张单曲《The Difference》，并于音乐银行正式出道。Brave Girls的官方歌迷名称为Fearless，意思是战斗中勇敢无畏。', 'http://p2.music.126.net/bqj2ocOo9TeXVbxwS0v51Q==/109951166096512548.jpg');
INSERT INTO `singer` VALUES ('126524', 'CNBLUE', 'CNBLUE(씨엔블루)，韩国FNC娱乐旗下的乐团组合，现由3名成员包括郑容和（队长）、姜敏赫和李正信组成。\n       \nCNBLUE是Code Name BLUE的简称，其中BLUE是Burning（李宗泫）+Lovely（姜敏赫）+Untouchable（李正信）+Emotional（郑容和）的合成词，寓意团员的特质都是不同。\n              \nCNBLUE官方爱好者名为BOICE，是CNBLUE的BLUE +VOICE的合成词，寓意歌迷就是CNBLUE的声音，另一意思是希望歌迷的声音永远与CNBLUE同在。没有官方应援色，官方应援物名为BLISH（有不同版本深浅不一的蓝色毛巾），是CNBLUE的BLUE +STYLISH的合成词，寓意歌迷都是闪闪发亮。', 'http://p2.music.126.net/s6pZXLgLu3nYO8HRTWtMYA==/109951165923697458.jpg');
INSERT INTO `singer` VALUES ('126600', 'Tiger JK', 'Tiger JK，本名：徐正权，是韩国最著名的HipHop歌手之一，前音乐组合Drunken Tiger成员。', 'http://p1.music.126.net/QcKbVSJ7EysOU128H60fvg==/3223768093595135.jpg');
INSERT INTO `singer` VALUES ('126721', 'EXID', 'EXID （이엑스아이디）是韩国AB娱乐（2014年更名为Gamgak娱乐）于2012年2月成立的五人女子音乐组合，初出道由LE、正花、 哈妮、有智（U ji）、多美（蕙妍）和海岭组成，官方歌迷名称为“LEGGO”。但出道后的两个月多美、有智和海岭退出组合，公司在8月加入惠璘和率智成为EXID的新成员。2014年6月27日，EXID转至Yedang娱乐公司(现更名为Banana Culture)旗下继续后续演艺活动。', 'http://p1.music.126.net/5EgjkLY-5nm09iwiTar3Qg==/109951163680276684.jpg');
INSERT INTO `singer` VALUES ('12675137', '舒涵', '16岁创作人生第一首歌曲，22岁发行个人首张EP，疗愈女声，在这唱给你听，相信音乐，用音乐证明自己的存在。', 'http://p2.music.126.net/mQQDJmvDKn9_e8Jb76cjZQ==/109951163033079071.jpg');
INSERT INTO `singer` VALUES ('126783', 'FIESTAR', 'FIESTAR（韩语：피에스타）为韩国的6人女子团体，成员来自韩国和中国，每位成员都历经了至少四年的练习生生涯，成员为金珍熙（Jei）、曹璐（CaoLu）、金惠美（Hyemi）、林敏智（Linzy）、李艺智（Yezi）安敏知（cheska）【已退队】，经纪公司为LOEN娱乐。曾和IU等前辈一起组成Loen Tree，为公司发行夏日特别专辑《夏日故事》（Summer Story）。', 'http://p2.music.126.net/1Ew8kvsC-D-gVOG3zAkuJA==/109951163537754854.jpg');
INSERT INTO `singer` VALUES ('12709194', 'Ocean Media', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('12709897', 'Tilly Birds', 'Tilly Birds is a Thai band with a Brit-rock genre that dares to defy everything in music industry.', 'http://p2.music.126.net/BxyIMVjGd4UwT55JQwOCoQ==/109951165549454927.jpg');
INSERT INTO `singer` VALUES ('127249', 'MYNAME', 'MYNAME（韩文：마이네임）是R&B组合Fly to the Sky成员Fany培养的新人偶像组合，简称MN，是韩国男子演唱团体，由经纪公司H2media成立，成员包括建雨、仁秀、世容、俊圭与蔡晋，MYNAME于2011年10月末出道，而他们的首张单曲专辑《Message》于2011年10月28日在韩国发行，但这张单曲专辑并不是公开发售，只能透过参加签名会才能购买。2012年5月5日在日本的官网公布了他们的粉丝名称\"MYgirl\"，有着 “MYNAME + girl\" 的意思，就是想要各位粉丝都要成为他们的女孩的意思。', 'http://p2.music.126.net/bUgP5DkqvyHeQJ473Epf3A==/109951163537804409.jpg');
INSERT INTO `singer` VALUES ('12730273', 'TOYOKI', '✧✧✧2-DIMENSIONAL STAR✧✧✧ @TOYOKIIII @TOYOKIIII @TOYOKIIII', 'http://p1.music.126.net/WVn4BDIYFxj56MTvbNo43g==/109951165479943791.jpg');
INSERT INTO `singer` VALUES ('127485', '七公主', '来自韩国的七公主，也被称为韩国历史上年龄最小的组合。第一批成员最大的9岁，最小的5岁、第五批成员最大的13岁，最小的9岁。2009年七公主正式解散，但是其中，优秀的成员李英幼已经归属BOF KOREA 公司，并且推出了专辑《lovely》。', 'http://p1.music.126.net/l_25T8HVr_MVyDsqz8V9KA==/5981343255608292.jpg');
INSERT INTO `singer` VALUES ('12788674', 'KEY.L刘聪', 'Key to Love\n混迹长沙的创作歌手。\nSUP_MUSIC创始人之一。\nC-BLOCK成员之一。 在Trap横行的年代，KEY.L选择把Trap的精髓抽离出来，而不是一味跟风。\n一路在C-BLOCK打磨，不管是自成一派的江湖style还是道系style，KEY.L一直做着街头的音乐。 2019.1.11号发行首张个人专辑「KEY to L」\n这把钥匙已经开启新的旅程 【微博】：刘聪的KEY 2019.1.11 发行首张个人专辑 「KEY to L」\n2020.10.10 发行第二张个人专辑「街区故事」 KEY.L刘聪 如货币般流通\n2021年，获得硬地围炉夜·网易云音乐原创盛典“最受欢迎男音乐人奖”\n2021年8月12日，参演音乐节目《披荆斩棘的哥哥》', 'http://p2.music.126.net/q-s8gygLEeqQQvi4OvadBw==/109951165816744411.jpg');
INSERT INTO `singer` VALUES ('12789336', '土人儿TRE', '老大爷，每天只睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉睡觉', 'http://p2.music.126.net/-e3wGF7RbeLKOem9TF3RVQ==/109951165051910579.jpg');
INSERT INTO `singer` VALUES ('128176', '4MINUTE', '4MINUTE，韩国CUBE Entertainment公司旗下女子组合，由成员南智贤、许嘉允、全智允、金泫雅、权昭贤组成，风格以糖果朋克风为主。4MINUTE于2009年6月18日以首张单曲《HOT ISSUE》正式出道。2009年8月20日，4MINUTE公开了第一张韩语迷你专辑《FOR MUZIK》。2010年1月8日，成员金泫雅公开了个人solo《Change》，歌曲与龙俊亨（BEAST）合作。2010年5月19日，4MINUTE公开了第二张韩语迷你专辑《HIT YOUR HEART》。2011年4月5日，4MINUTE公开了首张韩语正规专辑《4MINUTES LEFT》。2012年12月15日同公司BEAST的张贤胜组成Trouble Maker的限定组合，赢得音乐市场的热潮。2012年4月9日第三张迷你专辑《VOLUME UP》公开发售，主打为《VOLUME UP》，MV于4月9日0时连同音源公开发布。2012年夏季，成员金泫雅参与了歌手PSY歌曲《江南Style》的音乐影片演出，而PSY也在8月时公布了金泫雅参与演唱的女版《哥哥你就是我的Style》。代表作品：	《Hot Issue》《Muzik》《HUH》《What\'s your name》等。', 'http://p2.music.126.net/S1JjqJRjPd5MyTfklkfwMQ==/3405187516346683.jpg');
INSERT INTO `singer` VALUES ('128245', '野菊花', '韩国独立乐队。由主唱全仁权，鼓手周灿权以及贝斯手崔圣园组成，所属社野菊花company，于1985年发行1辑[行进]出道，2014年获得第28届金唱片执行委员特别奖。', 'http://p2.music.126.net/lMsIty76YTpFhRD3Iie_tw==/580542139487857.jpg');
INSERT INTO `singer` VALUES ('12828299', 'Rothy', 'Rothy，한국 solo가수, 1999년 5월 6일 생. 대학에  한림연예예술고등학교 실용음악과에 다니고 있다. \\\n2017년에 대뷔했다. 싱글 앨범 [Stars]를 발행했다.', 'http://p2.music.126.net/GtZKG7rxpiJmB9xLyfdFtQ==/109951165231440534.jpg');
INSERT INTO `singer` VALUES ('12852319', '小田音乐社', '小田音乐社成立于2020年2月23日，由社长田昊（爱写歌的小田），副社长林晓渝、戾格，以及许多优秀的音乐人共同组成。社团内设有编曲、歌手、词作、混音、cv、pv、画师、美工等部门。社团的音乐作品因表现形式的不同而各有其独特之处，在抖音平台推出的《未命名》系列、《把评论唱成歌》、《比稿》、《填词》等游戏，使得每一个刷到小田音乐社视频且热爱音乐的人，都有机会参与到音乐创作的过程中来，并从中体会到音乐创作带来的乐趣，与此同时也产生了许许多多广为传播的优秀作品。如《回到夏天》、《如一》、《沈园外》、《误红妆》等。', 'http://p2.music.126.net/z3C6Viy0MFZNpkwdFaJzUg==/109951164089872597.jpg');
