INSERT INTO `singer` VALUES ('12977', '逃跑计划', '逃跑计划，乐队的前身是孔雀乐队，成立于2004年底，直到2007年夏天贝司手小刚的加入，乐队得以正式确立，并且乐队的音乐风格较之前也有所改变，以Indie pop(独立流行)为主，其间也融入了New wave(新浪潮)；Post punk(后朋) 等新音乐形式的元素，使得乐队的音乐在保留了原来唯美旋律的同时更加新鲜，时尚，更有活力。成员：吉他：马晓东 鼓手：李洪涛 贝斯：刚昂 键盘：菲璐 主唱：毛川', 'http://p2.music.126.net/kk_0Iy-QxjKt3Ca_pryJGA==/109951165752930430.jpg');
