INSERT INTO `singer` VALUES ('13363', '小舟与旅行者', '小舟 原名 陈衍舟\n2006年签约鸟人唱片\n2007年于鸟人唱片发行专辑《老炮情歌》 同年参加《迷笛音乐节》\n2008年制作发行《三个哈密人》\n2009年邀吴俊德制作民谣专辑小舟与旅行者——《在远方》，\n2010年签约大藏唱片合作发行\n2012年与旅行者乐团在丽江合作录制《罗布泊》小舟与旅行者，并与2013年2月全国发行\n2013年6月签约中国移动咪咕音乐原创音乐人\n2013年10月参加央视9套拍摄纪录片《公路音乐之旅》\n2014年10月参加敦煌《大漠音乐节》12月《丝路庭州音乐节》\n现乐队成员：\n林杰 弹拨乐\n郝卫东 打击乐\n阿迪力 民族弦乐\n阿力 大浦\n周胜军 弹拨乐 管乐\n乐队风格：\n世界民谣（以各民族的传统乐器来演绎小舟的原创音乐）', 'http://p1.music.126.net/PKEdhGzF_1S-oHBVxBhWHA==/7907687627521643.jpg');
