INSERT INTO `singer` VALUES ('13595', '中国娃娃', '中国娃娃（泰语：ไชน่า ดอลส์，英语：China Dolls）是一组流行音乐女子二人组合。\n最初由陈冠桦（娃娃）和李晓燕（贝儿）于1999年在泰国组成，签约于泰国Exact GMM，凭借首张泰语专辑《Muay Nee Kah》同名主打歌在泰国一曲成名，重新填词之后在台湾及中国大陆、新加坡、马来西亚等地发行的国语专辑《单眼皮女生》及同名主打歌红遍整个华语歌坛。\n2010年由陈冠桦（娃娃）和新成员刘佩君（丹淳）组成第二代，并发行全新国语专辑《亮晶晶》。\n2013年6月21日，娃娃和贝儿宣告重组，并参加由GMM Grammy主办的三十周年庆祝演唱会[2]，现于泰国发展演艺事业。\n2021年全面回归，举办线上见面会《Nihao Nihao China Dolls X 20th Anniversary》和发行新单曲！', 'http://p1.music.126.net/jADAKAAJ-rUHLMC5Wyfdvg==/109951166347515030.jpg');
