INSERT INTO `singer` VALUES ('14055085', '(G)I-DLE', '(G)I-DLE，(韩语：(여자)아이들），是韩国Cube娱乐旗下的五人女子音乐组合，六位成员包括曺薇娟、Minnie、田小娟、宋雨琦、叶舒华、徐穗珍（已退队），将于2018年5月2日，以迷你一辑《I AM》、主打 《LATATA》出道。团名写法为“(G)I-DLE”（韩语：(여자)아이들），读音为“I-DLE”（韩语：아이들）。团体中文名称为“(女)孩子们”，有着将各位不同个性的女孩子聚集起来的意义。', 'http://p2.music.126.net/8_j04h0AcYDYMzcp0G6dkg==/109951166283410865.jpg');
INSERT INTO `singer` VALUES ('14077324', '黄霄雲', '黄霄云，1998年12月22日出生于贵州省黔南布依族苗族自治州罗甸县龙坪镇，中国内地流行乐女歌手、影视演员，2015年，浙江卫视《中国好声音第四季》获得汪峰组四强、全国16强。2016年，在青春校园网络剧《薛定谔的猫》中饰演艾晓欣。2017年，发行了单曲《征战》、《还可以爱吗》。', 'http://p2.music.126.net/CYDr2e6zMXBtZlKSFQe21g==/109951164935181925.jpg');
INSERT INTO `singer` VALUES ('14177760', 'twocolors', 'twocolors是由来自柏林的Pierro及Emil两位作曲家组成的组合，这个组合独特之处就在于他们能将电子乐与旋律流行乐交汇融合。Twocolors从2015年开始独立创作，制作并发行他们自己的音乐。他们的代表单曲《Follow You》在Spotify上的播放量达到了一千一百万，在YouTube上的播放量则达到了三百四十万。', 'http://p1.music.126.net/94ItU8iaVN3dP1s6yAOyAQ==/109951165353878418.jpg');
