INSERT INTO `singer` VALUES ('14485169', 'Ka-Re', 'Ka Re 土库曼斯坦歌手，现住居在莫斯科。代表作品于«Polovina» ，他的歌曲就一直广受，中亚、中东、中国(新疆) 歌迷的喜爱。', 'http://p2.music.126.net/wQxaRSHvxRddT_KP9gMhxQ==/109951165321334842.jpg');
INSERT INTO `singer` VALUES ('145965', 'Aaron Smith', 'Aaron Smith是来自美国芝加哥的独立音乐制作人。', 'http://p2.music.126.net/T0HI5Y7Fk0vEGzb9p6c0OQ==/109951165022069189.jpg');
INSERT INTO `singer` VALUES ('14610', '黒うさP', '黒うさP（くろうさピー），使用VOCALOID『初音ミク』『鏡音リン・レン』『KAITO』『MEIKO』 『巡音ルカ』制作翻唱和原创乐曲的音乐制作人。此外，他还作为同人作家White Flame进行作词作曲和编曲。作品中名曲众多，PV也都制作的相当华丽；特别是『千本樱』 一曲几乎家喻户晓。', 'http://p2.music.126.net/L12yd0wCfgphTS0DZ8Llpw==/109951165547308196.jpg');
INSERT INTO `singer` VALUES ('14670', 'かいりきベア', '', 'http://p2.music.126.net/aIrUdjQB57pIJ7EWzu56Fw==/109951164625233891.jpg');
INSERT INTO `singer` VALUES ('14839429', 'Pháo', 'Phao生于2003年，真名Nguyễn Diệu Huyền，也被称为“地下公主”，在《说唱王》节目中获得导师的四次选秀权后，她获得了极大的关注。\n\n在现实生活中，Phao还是一个开朗友善的女生。她定期参加学校的集体活动以及underground音乐演出。', 'http://p2.music.126.net/1M39pvIaSF0TLQr425361A==/109951165544967787.jpg');
INSERT INTO `singer` VALUES ('15022053', '88rising', '在Rich Brian，Keith Ape和Higher Brothers等新晋潮流新声背后的前卫互联网新锐团队——88rising，是亚洲最具代表性的前瞻思想艺术家和创作者汇集的开拓性媒体平台之一。以连接东西方文化为主旨的88rising以其“大量病毒式传播的视频点击和与美国知名艺术家合作”而闻名（CNN报道）。由世界各地的创意人组成的领导团队屡获殊荣，88rising通过代表亚洲及各地区的独特文化景观，在展示亚洲文化这一方面“显然的填补了空白”（福布斯报道）。', 'http://p2.music.126.net/bj_rmuuX2T_3CWtYeWo_5A==/109951164445634644.jpg');
INSERT INTO `singer` VALUES ('15169', 'otetsu', '『otetsu』（おてつ）とは、VOCALOIDを用いたオリジナル曲を中心に発表しているP(プロデューサー)である。', 'http://p2.music.126.net/uYBcvVj_DykLkn9gUzvwIg==/109951163279823978.jpg');
INSERT INTO `singer` VALUES ('15229', 'ピノキオピー', '匹诺曹P（日语：ピノキオピー）是日本的作曲家、插画家、人物设计师。经纪公司是P._nc、所属唱片公司是U/M/A/A。从2009年开始，在视频分享网站上发表使用使用VOCALOID制作的乐曲，以ピノキオピー的身份开始活动。在2012年正式发布专辑《Obscure Questions》。名字源于首次投稿作品《ハナウタ》长鼻子的初音未来插图。', 'http://p1.music.126.net/VY6H5YCq3Zw5TC32SxQGpQ==/109951163880022721.jpg');
INSERT INTO `singer` VALUES ('152298', 'Ilona Prunyi', '', 'http://p1.music.126.net/ftSv0csYHzZ8UE2rbLLavg==/109951163753391787.jpg');
INSERT INTO `singer` VALUES ('15248022', 'すりぃ', null, 'http://p1.music.126.net/jxYgnWEzw_3ySzMbID43Vg==/109951165955980439.jpg');
INSERT INTO `singer` VALUES ('15260', 'ryuryu', 'ryuryu，日本VOCALOID乐曲创作者。别名义りゅーりゅー、びにゅP。', 'http://p1.music.126.net/RSOVHjUmL8Aa5gIRFIrABA==/109951165566364223.jpg');
INSERT INTO `singer` VALUES ('15284598', 'KAIZ', '来自越南的人气DJ制作人、神曲制造机KAIZ，是越南当地酒吧O2O Hanoi的常驻DJ。2010年至2015年就读于Trưng Nhị Secondary School，2016年12月与越南流行女歌手Hương Giangg订婚。2020年因重制混音越南女歌手Pháo的洗脑单曲《2 Phút Hơn》迅速蹿红，擅长浩室House电子舞曲的他轻易抓住听众的听觉神经，令人过耳难忘，这也是他爆红的原因所在。', 'http://p1.music.126.net/CK6L97xPztm1c-0LALRVpw==/109951165620940867.jpg');
INSERT INTO `singer` VALUES ('15290', '澤野弘之', '澤野 弘之（さわの ひろゆき、1980年9月12日 - ）日本作曲家、編曲家、作詞家。出生于东京都。以电视剧、动画、电影、电影音乐为中心进行作曲和编曲工作，同时也为许多艺人写作曲子。所属事务所为Legendoor。代表作包括电视剧《医龙-Team Medical Dragon-》系列配乐、动画《机动战士高达 UC》、《罪恶王冠》、《进击的巨人》、《KILL la KILL》、《ALDNOAH.ZERO》、《青之驱魔师》、《终结的炽天使》、《甲铁城的卡巴内瑞》系列配乐等。', 'http://p1.music.126.net/0mt7-G73wWrvIlVoUpHR9g==/109951165609483832.jpg');
INSERT INTO `singer` VALUES ('15396', 'sasakure.UK', '', 'http://p1.music.126.net/SfxN0uK4A8awPAGRNe2mNg==/109951165066967203.jpg');
INSERT INTO `singer` VALUES ('156156', 'Jean-Bernard Pommier', '让-伯纳德·波米尔（Jean-Bernard Pommier，1944年8月17日－），法国钢琴家，指挥家。出生于法国贝济耶，1960年，他获得了柏林青年音乐家国际比赛的一等奖，并于次年获得了“法国艺术家协会奖”。他是Northern Sinfonia的艺术总监和Filarmonica di Torino乐团的首席指挥。', 'http://p2.music.126.net/WeqDsYgxwQA6S08vuzjaqQ==/774056185976054.jpg');
INSERT INTO `singer` VALUES ('15690', 'れるりり', '『れるりり(当社比P)』とは、VOCALOIDを使用してオリジナルの楽曲を発表しているP（プロデューサー）の一人である。', 'http://p1.music.126.net/FVWR5v84nHvfPqk2Cx6thg==/1384285151746435.jpg');
INSERT INTO `singer` VALUES ('159291', '桑田佳祐', '桑田佳祐，1956年2月26日出生，日本男歌手。出生在神奈川县的茅崎市，南方之星的主唱及吉他手。妻子为南方之星成员之一的原由子，目前育有2子。', 'http://p1.music.126.net/sweQTwHGyAo5Rb37gYz8Ig==/109951165914899132.jpg');
INSERT INTO `singer` VALUES ('159692', '初音ミク', '初音未来（初音ミク/はつね ミク/Hatsune Miku），部分国人简称为“初音”，是日本Crypton Future Media株式会社企划·开发·贩售的，基于Yamaha的VOCALOID歌声合成引擎所制作的声音库软件及其拟人化形象，也衍生出动漫和游戏人物。是Crypton“角色主唱系列”（Character Vocal Series）的第一作，代号为CV01。', 'http://p1.music.126.net/-QWJunQEsgiYvEoF4VITgQ==/109951164605971338.jpg');
INSERT INTO `singer` VALUES ('15990', '絢香', '绚香（あやか），出生于1987年12月18日，是一名日本流行音乐女歌手，出生于大阪府守口市。前唱片公司公司为日本华纳音乐 (Warner Music (Japan) Inc.)，前经纪公司为研音，现在是个人事务所A station。出道单曲“I believe”在日本ORICON单曲榜最高排第三位，而此曲的手机铃声下载次数在42日内突破100万次，是日本女歌手史上最快纪录。', 'http://p1.music.126.net/rms4XHIYZnlB1SdidwzbNw==/109951163661804204.jpg');
INSERT INTO `singer` VALUES ('16001', 'AI', '               植村爱：AI的原名，本身有意大利的血统。1981年11月2日在美国出身鹿児岛市长大，她是Def Jam在日本签下的第一个日本歌手。1996年进入Performing Art School进修（艾莉西亚凯斯也出自该校），专攻舞蹈。最后她到L.A.深受黑人音乐的洗礼而决定往HIP HOP乐发展。', 'http://p1.music.126.net/-PhTWa0VVUH3aK3hDsRd8A==/109951166336432260.jpg');
INSERT INTO `singer` VALUES ('160347', 'Zico', 'Zico(지코)，本名禹智皓(우지호、Woo Ji Ho)，出生于1992年09月14日，韩国歌手、Rapper、制作人。所属组合Block B队中职务为队长、Rapper、作曲、作词、备用主唱。', 'http://p1.music.126.net/uDSofJiC2ErBDE5u45W6AQ==/109951165102431660.jpg');
INSERT INTO `singer` VALUES ('160729', '中島美嘉', '中島 美嘉（なかしま みか、1983年2月19日 - ）,日本女歌手、女演员。也是继天后滨崎步后又一位新生代流行天后。中岛美嘉在2001年以主演日剧《新宿伤痕恋歌》及演唱单曲《STARS》同时出道。其美艳的外型及神秘感等个人风格，使中岛美嘉获得新时代完美歌姬、百变天后的美誉。2005年中岛美嘉主演电影《NANA》，成为该年日本国片年度票房冠军，更引起一股风潮。而随着电影在各国的发行，更让中岛的人气直线上升，声势遍及全亚洲。 中岛美嘉的歌曲以曲风多元著名，诸如摇滚、雷鬼、爵士等曲风，其中又以情歌最为著名；再加以她独特的唱腔及裸足演唱的习惯，在日本乐坛独树一格。', 'http://p1.music.126.net/rMj-tPTTGkmz2o6hMI7xVg==/109951165956020749.jpg');
INSERT INTO `singer` VALUES ('160947', 'IU', '李知恩 (IU)，1993年5月16日出生于韩国首尔特别市，韩国女歌手、演员、主持人。2008年以一首《迷儿》正式出道，历经一年的练习生生涯。2011年以一首《好日子》在韩国走红，随后于2011年末推出正规二辑《Last Fantasy》 PK记录74次，AK约90次。2013年IU发行正规三辑《MODERN TIMES》再次获得关注。2012年~2015年分别位列韩国福布斯名人榜第三、第八、第十和第十四位。2015年，发行迷你专辑《CHAT-SHIRE》，并被《Billboard》认可为韩国流行音乐百强榜的领跑者；同年，获得韩国大众文化艺术奖国务总理表彰奖；2017年4月，发行第四张正规专辑《Palette》。透过正规专辑《Palette》、翻唱专辑《花书签2》等音乐作品，于韩国盖洛普民调中心的“年度闪耀歌手”排行榜中登上冠军宝座,于甜瓜音乐奖凭正规专辑《Palette》获得年度专辑大赏, 于2018年举行的金唱片奖中获得音源大赏，以及Gaon Chart K-POP大奖中取得五个奖项。2018年10月10日发行出道10周年纪念数位单曲《BBI BBI》,2019年11月携第五张迷你专辑《Love Poem》回归歌坛，2020年2月1日，参与演唱tvN戏剧《爱的迫降》OST.5月6日,推出全新数位单曲《Eight》。2021年1月9日，IU在韩国第35届金唱片奖颁奖典礼中获颁最大殊荣的“音源大赏”\n李知恩还涉足主持以及表演领域，2011年1月，出演校园剧《dream high》；3月，成为SBS音乐节目《人气歌谣》的固定主持人。2013年，凭借周末剧《最佳李顺心》获得KBS演技大赏新人女演员奖 。2015年，主演KBS金土剧《制作人》。2016年，主演古装穿越《步步惊心：丽》。2018年3月，出演《我的大叔》,该剧在中国的影评网站豆瓣中拿到9.4分，居该站2018年度韩剧首位,获得了第6届APAN Star Awards “中篇电视剧——女子最优秀演技赏”,2019年4月，IU出演Netflix出品的韩国独立单元剧《Persona》,2019年7月13日，IU主演的《德鲁纳酒店》首播。2020年7月，参加tvN 综艺节目《带轮子的家》，2021年1月24日，IU发行正规5辑先行曲《Celebrity》，2021年3月25日，IU发行正规5辑《LILAC》', 'http://p2.music.126.net/LPhIplO6lWpDDs7kvRiAQA==/109951165832914019.jpg');
INSERT INTO `singer` VALUES ('161216', '鬱P', '', 'http://p1.music.126.net/mOxDvUPjPAjGMuBlPmIFqg==/1369991502578355.jpg');
INSERT INTO `singer` VALUES ('161330', 'Trouble Maker', 'Trouble Maker是由韩国CUBE娱乐公司于2011年推出的双人限定组合，由韩国歌手张贤胜与女子演唱组合4Minute成员金泫雅组成。\n2011年12月1日，Trouble Maker发行首张同名专辑《Trouble Maker》。2012年11月30日凭借同名歌曲《Trouble Maker》获得第14届Mnet亚洲音乐大奖最佳合作奖  ；同年12月14日获得Melon音乐奖潮流歌曲奖。\n2013年10月28日，Trouble Maker发行第二张迷你专辑《Chemistry》 ，主打曲为《没有明天》。', 'http://p1.music.126.net/vA1MR2xoGMI50zOiPwDkfQ==/1343603209199874.jpg');
INSERT INTO `singer` VALUES ('161545', '倉木麻衣', '仓木麻衣（1982年10月28日－），日本女歌手，生于日本千叶县船桥市，现居东京。现隶属NORTHERN MUSIC公司LOOP事务所（2007年－）。她的父亲是电影导演、实业家山前五十洋。祖父是诗人山前实治。2007年之前曾隶属GIZA Studio。2001年4月进入立命馆大学产业社会学院人文科学系就读，并于2005年3月毕业。截止2014年12月，她举办了超过300次的个人演唱会。CD总销量突破1600万枚（日本公信榜ORICON调查）。', 'http://p1.music.126.net/FDex21LtVXjdlB8Y90VCWQ==/109951166026826057.jpg');
INSERT INTO `singer` VALUES ('16664', 'JUJU', '			JUJU从12岁开始便希望可以成为一个爵士乐歌手。当在京都定居的时候，她曾经参与过不同的音乐活动，而在18岁的时候她独自到纽约定居。在纽约定居期间，她接触了爵士乐，R&B，Hip-hop，灵魂音乐，拉丁音乐和浩室音乐等多种不同的音乐风格，拓展了她的音乐知识。2001年，JUJU开始为一些其他歌手的作品作featuring演出。2002年，她为电影《凶気の桜》创作了主题曲。2004年以单曲“光の中へ”出道，同时也回到日本开始作现场演出。第三张单曲“奇迹を望むなら...”曾于USEN榜登上第一名并停留了22周。2009年4月29日，JUJU发行了第十张单曲“明日がくるなら”，作为电影“生命最后一个月的花嫁”的主题曲，也采用了与R&B男歌手JAY\'ED合作的featuring形式，成为2009年日本其中一首最受欢迎的情歌。次年2月，JUJU更是以单曲“明日がくるなら”，获得日本唱片业协会主办的“第24回日本金唱片大赏”5首年度最佳歌曲的奖项。', 'http://p2.music.126.net/2lMM0PF8E_-4KEdfKfOM_w==/109951166361922439.jpg');
INSERT INTO `singer` VALUES ('16995', 'LiSA', 'LiSA（日语：リサ，1987年6月24日－）是日本女歌手，本名織部里沙（おりべ りさ），岐阜县出身，血型为B型，曾为摇滚乐团“Love is Same All”的主唱，现所属唱片公司为日本索尼音乐娱乐旗下的SACRA MUSIC。\n演唱歌曲也被用作许多知名TV动画的片头曲和片尾曲，如《刀剑神域》、《Fate/Zero》、《鬼灭之刃》系列、《Angel Beats》、《伪恋》、《魔法科高中的劣等生》、《穿透幻影的太阳》等。\n2017年10月配信下载突破170万。被称为“摇滚精灵”、“幽浮社御用歌姬”、“摇滚女神”等。\n座右铭：今日もいい日だっ。', 'http://p2.music.126.net/s30j34kiVYmlmZS7dJYUCQ==/109951166541142271.jpg');
INSERT INTO `singer` VALUES ('18131', '内田光子', '内田光子（日语：內田光子，英语：Dame Mitsuko Uchida，1948年12月20日 - ），英国日本裔古典钢琴家、指挥家。生于日本静冈县热海市，现定居伦敦。她以对莫扎特和舒伯特的诠释而闻名，是公认的“莫扎特专家”。', 'http://p2.music.126.net/it8WWkUDTGCBUU3BCH9GbA==/903798558081494.jpg');
INSERT INTO `singer` VALUES ('18771', 'back number', 'back number是日本的三人摇滚乐队。通称：「バクナン」、「bn」。2004年结成。所属演艺事务所是 id ENTERTAINMENT。所属唱片公司是环球音乐，厂牌是UNIVERSAL SIGMA。官方粉丝俱乐部是“one room”。', 'http://p2.music.126.net/40rRyoi5IfniRfPueYRgag==/109951166501656671.jpg');
INSERT INTO `singer` VALUES ('188558', 'Aki阿杰', '歌手，以厚重有质感的御姐音成名。\n代表作：《牵丝戏》、《东风志》、《何以歌》、《叙世》等。', 'http://p1.music.126.net/fFHdhgnhLukfzsbGzT6hug==/1390882223811519.jpg');
INSERT INTO `singer` VALUES ('188565', '银临', '以音为帆，以歌为筏，以真作舵，以梦载风。\n原创音乐人，2020年发布最新个人专辑《琉璃》，代表作《腐草为萤》《锦鲤抄》《牵丝戏》。', 'http://p2.music.126.net/SC4xC0MMlPC4nViAO0768g==/109951163676566884.jpg');
INSERT INTO `singer` VALUES ('189347', 'CRITTY', 'CRITTY，古风歌手、百度音乐人，5sing原创音乐基地推荐音乐人，其作品多为古风、中国风歌曲，嗓音甜美大气。\n微博：@熙影CRITTY 熙影CRITTY官方群：543885651 CC果冻①群：84323275；CC果冻②群：181884897', 'http://p1.music.126.net/pJ3907H7voYM1CfKD7o4yA==/109951162939901937.jpg');
INSERT INTO `singer` VALUES ('190527', '鏡音レン', '镜音连是由日本克里普敦未来媒体有限公司（Crypton Future Media, INC.）开发贩售的虚拟歌手软件（声库）及其形象，是Crypton旗下“角色主唱系列”的第二作，与镜音铃（V2）一同于2007年12月27日发售。（其V2，V4X，V4E版本是基于Yamaha开发的VOCALOID歌声合成引擎开发的）\n与初音未来、镜音铃、巡音流歌、MEIKO、KAITO共称作Piapro Characters（Piapro角色）。', 'http://p2.music.126.net/3Hm_7_jxfeHhEsQlMxqZeA==/18524571906602849.jpg');
INSERT INTO `singer` VALUES ('190861', 'IA', 'IA是基于VOCALOID3的虚拟歌姬，使用语言为日语和英语。原声声源提供者为Lia。角色设计由漫画家赤坂アカ担任。', 'http://p2.music.126.net/dBSp_2kYfbBI82ZdPOaGKA==/18830236139120861.jpg');
INSERT INTO `singer` VALUES ('19353', 'EGOIST', '	EGOIST是在2011年10月TV动画《罪恶王冠》中设定的拥有超高人气及超大影响力的的网络歌手，在剧中演唱OP/ED以及插曲。而实际上这位歌手则是由supercell的ryo担任制作、并由ryo选出的chelly担任演唱的角色。在该动画结束后仍继续以团体名称活跃，所属唱片公司为SACRA MUSIC。', 'http://p1.music.126.net/aQDNTJbTXFyk6MG3Ky9HaA==/109951166630376176.jpg');
INSERT INTO `singer` VALUES ('2116', '陈奕迅', '陈奕迅（Eason Chan），1974年7月27日出生于中国香港，祖籍广东省东莞市，中国香港流行乐男歌手、演员、作曲人，毕业于英国金斯顿大学。\n1995年参加第14届新秀歌唱大赛并获得冠军，同年正式出道。1996年发行个人首张专辑《陈奕迅》。1997年主演个人首部电影《旺角大家姐》。1998年凭借歌曲《天下无双》在乐坛获得关注。2000年发行的歌曲《K歌之王》奠定其在歌坛的地位。2001年发行流行摇滚风格的专辑《反正是我》。2003年发行个人首张概念专辑《黑·白·灰》，专辑中的歌曲《十年》获得第4届音乐风云榜十大金曲奖；同年凭借专辑《Special Thanks to》获得第14届台湾金曲奖最佳国语男歌手以及最佳专辑奖。\n2005年发行粤语专辑《U87》，专辑中的歌曲《浮夸》成为其歌唱生涯的代表作品之一。2006年起连续九年获得叱咤乐坛流行榜颁奖典礼我最喜爱的男歌手奖。2007年获得十大劲歌金曲最受欢迎男歌星奖。2010年凭借剧情片《金钱帝国》获得星光大典港台年度电影男演员奖。2012年发行舞曲风格的粤语专辑《…3mm》。2015年凭借专辑《米·闪》获得第26届台湾金曲奖最佳国语男歌手奖。2016年举行“Another Eason\'s LIFE世界巡回演唱会”。2018年凭借专辑《C\'mon in~》获得第29届台湾金曲奖最佳国语男歌手奖 ；同年发行专辑《L.O.V.E.》；同年，其主演的电影《卧底巨星》上映。 2020年7月11日在香港举办《Live is so much better with Music Eason Chan Charity Concert》慈善音乐会。\n			', 'http://p1.music.126.net/w_vuv9hBWq2hlJxJcmJrjg==/109951166115915081.jpg');
INSERT INTO `singer` VALUES ('22300', 'UVERworld', '2005年夏出道的新时代日本mixture,pop,rock乐队。UVER=OVER（德语），UVERworld=OVER THE WORLD。“成为超越世界的乐队”，他们怀着这一信念，乐队名也由此而来。乐队作品在富有透明感的旋律里，夹杂着酷酷的rap，刮碟，human beat box，还有重重的吉他重奏，创作出“日本摇滚流行混合体”全新的音乐风格的5人乐队。', 'http://p2.music.126.net/SW7KCI-uRhGVgs9I67349A==/109951166627354511.jpg');
INSERT INTO `singer` VALUES ('231393', 'Pyotr Ilyich Tchaikovsky', '彼得·伊里奇·柴可夫斯基（俄语：Пётр Ильич Чайковский，转写：Pyotr Ilyich Tchaikovsky，1840年5月7日－1893年11月6日），俄国浪漫乐派作曲家，其作品有民族乐派特征，但仍以浪漫风格为基准。其风格直接和间接地影响了很多后来者。知名作品有六部交响曲（第六“悲怆”），四部协奏曲，芭蕾《天鹅湖》《胡桃夹子》《睡美人》，幻想序曲《罗密欧与朱丽叶》，1812序曲，管弦乐《意大利随想曲》《斯拉夫进行曲》，三首弦乐四重奏，钢琴三重奏，钢琴独奏《四季》，歌剧《叶甫盖尼·奥涅金》《黑桃皇后》。', 'http://p2.music.126.net/rIwm13Yv7Y086FVAAR0EDw==/109951165867911239.jpg');
INSERT INTO `singer` VALUES ('231434', 'Joseph Cooper', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('27821448', 'ДЕТИ RAVE', '', 'http://p1.music.126.net/_ZTnPVOD4eqjDxe6-kZdDw==/109951165642101165.jpg');
INSERT INTO `singer` VALUES ('28083351', 'CORSAK胡梦周', '代表作品：《溯》、《芽》、《归》、《DIFFERENT WORLD》、《Sad Sometimes》\n来自上海的CORSAK，是一位唱作词曲编全能的音乐才子、DJ和制作人，他将自身所受到的古典音乐教育与创新的EDM完美地相结合在一起。\n3岁时，他第一次接触音乐，并由此开启了他的钢琴生涯。后来，CORSAK高中时读音乐学校成为吴莫愁的师哥，之后到国内著名的上海音乐学院求学，并在那里学习了作曲与音乐制作。为了追求他的国际知名DJ音乐梦想，他放弃与国内某一影视公司签约的演员生涯。\n2017年发行首张单曲《溯Reverse》，截止目前获得14亿次播放量。\n2018年与国际知名DJ Alan Walker共同制作其首张个人专辑主打歌《Different World》。其后又与Alan Walker合作了《Sad Sometimes》，与国际知名DJ组合 Yellow Claw合作《Take Me Back》。\n2019年登上全球最大最大电音节比利时Tomorrowland舞台，被誉为华人之光。并被评选为2019年度30岁以下福布斯精英榜年度青年精英。\n这位来自Liquid State厂牌的正能量励志偶像，展示他特有的能够将中国传统文化和现代化完美结合的混合曲风, 蕴藏着巨大的商业潜能。这样独特的音乐天赋，让人不容错过。', 'http://p2.music.126.net/qGBIol8skoSjxfSEYTc3Lw==/109951164856155372.jpg');
INSERT INTO `singer` VALUES ('28211479', 'Bell Nipada', '', 'http://p1.music.126.net/P41RRwCaRPbklhocWwEZUQ==/109951165708812501.jpg');
INSERT INTO `singer` VALUES ('28276929', 'Rauf & Faik', '劳夫·法克（Rauf＆Faik）是来自阿塞拜疆的俄罗斯音乐二重唱，由孪生兄弟Rauf和Faik Mirzaev组成。于1999年7月7日生于伊热夫斯克。', 'http://p1.music.126.net/Bm7egH6y43H8Sksp8LOwJQ==/109951164624811054.jpg');
INSERT INTO `singer` VALUES ('28491908', 'Yui Mugino', '', 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('28527997', 'Jonasu', 'Jonas David Kröper, also known by his stage name Jonasu, is a German DJ, record producer and songwriter based in Amsterdam, the Netherlands. His single \"Black Magic\" charted in the top 5 in the UK and Ireland in July 2021.', 'http://p1.music.126.net/t4BZeuSmstSQhgXkJDj9-g==/109951164274270647.jpg');
INSERT INTO `singer` VALUES ('28585', 'Alexei Lubimov', '阿列克谢·波里索维奇·鲁比莫夫（俄语：Алексе́й Бори́сович Люби́мов，罗马化：Alexey Borisovich Lyubimov，1944年－），俄罗斯钢琴家。', 'http://p2.music.126.net/qaRA77HgCRi6_pz1rzifDQ==/109951163448329767.jpg');
INSERT INTO `singer` VALUES ('28702', 'Arthur Grumiaux', '亚瑟·格鲁米欧（Arthur Grumiaux，1921年3月21日 - 1986年10月16日），比利时小提琴家。\n\n格鲁米欧的演奏，音色纯净、典雅，经常是一种柔美中的静谧，有一种清香高洁之美。格吕米奥留下的大量录音中，第一位的是对莫扎特与舒伯特的演绎，第二位是对巴赫的演绎，然后才是贝多芬、勃拉姆斯与其他作曲家。他有一把名为“泰坦”的斯特拉迪瓦里琴，但在音乐会上通常使用一把1744年制造的“瓜纳里”琴。', 'http://p1.music.126.net/pftO8EOqd6PBeN6FFLegNQ==/109951165921247562.jpg');
INSERT INTO `singer` VALUES ('28727308', 'RAIM', null, 'http://p1.music.126.net/pv1ishWxzWAQO0xbVosT9Q==/109951165649156512.jpg');
INSERT INTO `singer` VALUES ('28899273', '柊キライ', '2019年『ビイドロ』を投稿しボカロPとしてデビュー。\n一作目からおしゃれなメロディーラインや心にくる歌詞と\n人間と機械の中間のようなflowerの調声が話題となり、\nニコニコ動画での週間ボカロランキングに載るなど\n「期待の新人」とボカロファンの間で話題となる。\nそして代表曲である『オートファジー』がニコニコ動画では30万再生、\nYouTubeでは80万再生を達成。現在はそれぞれ75万回、205万回を超えている。', 'http://p2.music.126.net/VcEyiXYcmyabaOPnHegFaw==/109951165827900368.jpg');
INSERT INTO `singer` VALUES ('28998', 'Aldo Ciccolini', '阿尔多·齐科里尼（Aldo Ciccolini，1925年8月15日－2015年2月1日），意大利钢琴家。就学于那不勒斯音乐学院，1942年在那不勒斯演奏肖邦的第二协奏曲而崭露头角，1949年获玛格丽特·隆国际比赛一等奖。奇科利尼擅长演奏弗雷、圣桑、萨蒂等法国作曲家的作品，其录制的萨蒂钢琴作品全集，获得极高的赞誉。', 'http://p2.music.126.net/CXxzpn5p5RnT6ni-im8Abw==/840026883626982.jpg');
INSERT INTO `singer` VALUES ('29205329', 'Masew', 'Masew本名Lê Tuấn Anh(黎俊英)，越南DJ，1996年8月6日出生于越南广宁省。代表作品有《Buồn Không Em》《Túy Âm》《2 Phút Hơn》等。', 'http://p1.music.126.net/riBkluz5NxZe7ssyUy4BxQ==/109951165640174356.jpg');
INSERT INTO `singer` VALUES ('29392693', '邵帅', '工作联系经纪人王晨雨 vx：wangchenyu2520\n自信并谦卑的为音乐发声。\n希望自己的音乐，能替你讲一段你或者我，或者他和他们的故事。', 'http://p1.music.126.net/8_cpEv3Qt-0puHoq89elbA==/109951165027027385.jpg');
INSERT INTO `singer` VALUES ('29393658', '流宇', '漂流的梦幻岛屿 开往云层的帆 独自走在光晕下的梦境 无声无息的坠落 一千零一个夏天 一千零一个四季', 'http://p1.music.126.net/TwdQjkMJzNDnpGWskyKOHw==/109951163524686684.jpg');
INSERT INTO `singer` VALUES ('29627842', 'sakehands', '欧美流行歌曲组合，电子音乐制作人，歌手。', 'http://p2.music.126.net/kIteyRnBJBQacIfnfN1J1A==/109951163766638871.jpg');
INSERT INTO `singer` VALUES ('296416', 'DJ Snake', '威廉·萨米·艾蒂安·格里加西恩（William Sami Etienne Grigahcine，1986年6月13日－），艺名DJ Snake，是一名法国DJ及音乐制作人。\nDJ Snake在2013年发表了《Bird Machine》及《Turn Down For What》，前者与法国艺人Alesia合作，并由知名DJ Diplo所经营的Mad Decent收录及发行。 2013年6月，Diplo邀请DJ Snake至他的广播秀\"Diplo & Friends\"演出。\nDJ Snake与Diplo在2014年合作，2015年与Diplo所带领的Major Lazer以及丹麦歌手MØ共同推出了单曲《Lean On》。', 'http://p1.music.126.net/LWGY903Jcet2Zh7KKkLnow==/109951166074381217.jpg');
INSERT INTO `singer` VALUES ('29738970', 'Pop Jirapat', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('29811710', 'PEARWAH', '妮查潘·查采芃纳，全名：Nichaphat Chatchaipholrat（ณิชาภัทร ฉัตรชัยพลรัตน์），小名：Pearwah（แพรวา），出生于1995年9月17日，泰国女演员、女歌手，影视代表作品《荷尔蒙》《朋友圈》。', 'http://p1.music.126.net/kYbw-59U5boBTvlEGn2Iaw==/109951166116538820.jpg');
INSERT INTO `singer` VALUES ('29968', 'Calvin Harris', 'Calvin Harris是一位来自英国苏格兰的创作歌手、音乐制作人和DJ。在2007年他以单曲《Acceptable in the 80s》出道，开始引起主流媒体的注意。至今，他已发行了三张录音室专辑，并为许多国际巨星制作了多首热门单曲。2011年底，由Calvin Harris一手创作并制作，由巴巴多斯小天后Rihanna演唱的《We Found Love》获得了全球范围内的巨大成功，也为Calvin Harris迅速打开了知名度。现在他已是全球炙手可热的流行舞曲制作人，在2014年全球百大DJ排名中名列第11位。2015年5月，获得2015公告牌音乐奖最佳舞蹈/电子歌手。同年11月，发行第四张录音室专辑《Motion》。2019福布斯100名人榜排名第95位。2013年至2018年，他连续六年荣登福布斯全球薪酬最高DJ榜首。', 'http://p2.music.126.net/YSpmUEAfarPUy13YWOCdUA==/109951166044910506.jpg');
INSERT INTO `singer` VALUES ('30000975', '空匪', '音乐爱好者 2001.0725 现在还不行 但是在努力 任何事宜微博私信空匪kongfei', 'http://p2.music.126.net/qQLunrjrB_LDTLMDOA2Mag==/109951165568405671.jpg');
INSERT INTO `singer` VALUES ('30116848', '阿冗', '歌手阿冗，不要音乐旗下艺人，代表作《与我无关》《你的答案》\n合作请联系：hlh@buyao.com', 'http://p2.music.126.net/2yq5iRTyrwxJr8WyWQuGGw==/109951166447412013.jpg');
INSERT INTO `singer` VALUES ('30140937', 'Pinkfong', 'Pinkfong是韩国教育娱乐公司SmartStudy的儿童教育品牌。 Pinkfong主要由儿童歌曲组成，其中最着名的是“小鲨鱼”(Baby Shark)，在YouTube上有超过20亿的观看次数。', 'http://p2.music.126.net/wLsMH3nXfGg_TlPjmCI4Lw==/109951163907008077.jpg');
INSERT INTO `singer` VALUES ('30285885', '等什么君', '偏爱古风，热爱弹唱。感谢聆听，荣幸之至。愿做一个热爱音乐的温婉女子，被岁月温柔以待。', 'http://p2.music.126.net/3R0sqO3zORdsp9vyPXEEgA==/109951164481818280.jpg');
INSERT INTO `singer` VALUES ('30315468', 'ElDark', null, 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('30471229', '宋雨琦', '宋雨琦（YUQI，우기），1999年9月23日出生于北京市，中国内地女歌手，韩国女子演唱组合(G)I-DLE成员。\n2021年5月13日，发行首张个人专辑《A Page》，共收录2首歌曲，其中歌曲《GIANT》由她本人作词作曲；宋雨琦参与作词作曲歌曲《i\'M THE TREND》、《LOST》；翻唱歌曲《Shallow》《Rise Up》。\n宋雨琦拥有和外貌截然不同的低沉烟嗓，活力十足、反应敏捷，拥有可爱开朗的性格和超强的综艺感。\n', 'http://p2.music.126.net/DM-7OMIk4nlx6TCtF9z8ZQ==/109951166646721679.jpg');
INSERT INTO `singer` VALUES ('30475544', 'Wz11', '别看了别看了,\n我是大白菜他妈给大白菜开门,\n菜到家了T_T', 'http://p2.music.126.net/L1EP2D4hS0husJwnJeMiLA==/109951166028170385.jpg');
INSERT INTO `singer` VALUES ('30483044', 'Tricolor', 'Tricolor，来自江苏南京，由主唱丁祾、小新，吉他王磊，贝斯朱磊，鼓手周鹤为主要成员，音乐风格r&b', 'http://p1.music.126.net/ft5b4ksIhIWdsEG5BxsYsQ==/109951163597686835.jpg');
INSERT INTO `singer` VALUES ('30529389', 'Lika Kosta', null, 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('30549371', 'FrogMonster', '华人电音组合，于 2018 年 11 月成立，由 John 和 Norvin 两位成员组成。\n化学博士生 John 和影视编曲系 Norvin 曾就读美国同一所大学，看似毫不相关的两人却因对\n电音的热爱而结缘相识。相识后的两人惊奇地发现彼此音乐品味相投，并且都不仅仅满足于\n欣赏 EDM 而是更想创作出优秀的国人原创 EDM，于是一拍即合成立了 FrogMonster 组合\n并开始潜心创作。2020 年 7 月一首热情洋溢的《Remember Our Summer》问世后，迅速在国\n内受到广泛好评与关注，火遍全网各大平台，FrogMonster 这一华人电音组合也因此被越来\n越多的人所了解关注。', 'http://p1.music.126.net/K6-iLRTdCH0BsFXUKjcWEA==/109951165598556065.jpg');
INSERT INTO `singer` VALUES ('30561182', 'SOZZA', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('30704161', 'mac ova seas', '\nMac Ova Seas，20XX CLUB音乐厂牌歌手。川渝地区迅速崛起的音乐新生力量，作为国内最成熟运用Autotune技术的唱作人之一，他一直以超前的想法进行音乐制作。其作品通常将多元的文化，与中国城市特色紧密结合，创作了属于自己独一无二的风格，同时也在极力追求更新的听感和极致的音乐品质。', 'http://p2.music.126.net/LS_qsMeMUGSFPd585_mnmg==/109951164277744352.jpg');
INSERT INTO `singer` VALUES ('30796777', 'SUNK', 'SUNK，Producer/DJ，现居北京。\nNew generation DJ / electronic music producer, active in major underground electronic clubs in China. As a producer, her music has brought different mysterious colors, and she is committed to making electronic music with distinctive Oriental cultural style, bringing this style to the world.', 'http://p1.music.126.net/OMgo7jYuT83kDybTViO9lA==/109951165544079922.jpg');
