INSERT INTO `singer` VALUES ('30955486', 'Bo Peep', '就像人在黄昏时分读书，读啊读，没有察觉光线渐暗；直到她停下来休息，才猛烈发现白天已经过去，天已经很暗，再低头看书却什么都看不清了，书页已不再有意义。', 'http://p1.music.126.net/aMdzsJnky3BtNiQZmoDkHA==/109951164505277016.jpg');
