INSERT INTO `singer` VALUES ('30980', 'Claudio Arrau', '克劳迪奥·阿劳·利昂（西班牙语：Claudio Arrau León，1903年2月6日－1991年6月9日），智利钢琴家。他被认为是20世纪最伟大的钢琴家之一。他的演奏范围很广，从巴洛克到20世纪的古典音乐均有建树。录制了大量的唱片，是贝多芬、舒伯特、肖邦、舒曼、李斯特、勃拉姆斯作品的权威演奏家。阿劳在表现上追求纯正严谨的古典风格与深刻的感情之间的结合，在演奏中强调重音的效果，追求结构严谨与细腻情感表达的结合。阿劳演奏的贝多芬全套奏鸣曲，在唱片史中有相当的地位，其演绎以严谨与情感细腻著称。', 'http://p2.music.126.net/EZ8NhyOiVUfbQAP2asAH2w==/109951165964972677.jpg');
