INSERT INTO `singer` VALUES ('32424549', 'Billkin', 'Billkin，中文名：马群耀，中文译名：普提蓬·阿萨拉塔纳功，大名：Putthipong Assaratanakul（พุฒิพงศ์ อัสสรัตนกุล），小 名：Billkin（บิวกิ้น），出生于1999年10月8日，泰国男演员、歌手、主持人，目前就读于泰国国立法政大学 ，主修工商管理（BBA），泰国男演员、歌手、模特、主持人 。星 座：天秤座、血 型：B型、身 高：178 cm、体 重：62 kg。', 'http://p2.music.126.net/IiIzdz73tZDe0uqGGa_1OQ==/109951166366050197.jpg');
INSERT INTO `singer` VALUES ('32540734', '塞壬唱片-MSR', '塞壬唱片MSR(Monster Siren Records)，泰拉世界十世纪最大的音乐发行商之一。从异教重金属乐队至偶像产业， 塞壬唱片MSR旗下的签约艺人涉猎音乐各方面。根据最新统计数据，塞壬唱片MSR占有泰拉世界30%以上的音乐市场。 (*注：塞壬唱片MSR为游戏明日方舟世界观中虚构的唱片公司，与一切实际生活中的组织、公司无关。）', 'http://p2.music.126.net/P4AH7I3NDtSq4FX07e5Lwg==/109951164481881457.jpg');
