INSERT INTO `singer` VALUES ('33059', 'Edward Elgar', '爱德华·威廉·埃尔加爵士（英语：Sir Edward William Elgar，1857年6月2日－1934年2月23日），英国作曲家，代表作包括《谜语变奏曲》和《威仪堂堂进行曲》。\n\n埃尔加先是作为一位小提琴家而进入乐坛，他1882年起在斯托克利指挥的伯明翰交响乐团中任第一小提琴，早期创作主要是宗教合唱，如《圣体颂》（Ave，Verum Corpus，Op.2，作于1887年）、《圣歌》（Cantique，Op.3，作于1889年）。第一首在世界范围内获得声誉的作品就是《谜语变奏曲》（1899年由汉斯李希特指挥首演），随后，著名歌唱家克拉拉·巴特在诺里奇音乐节演唱《海景图》、康塔塔《杰隆修斯之梦》又连续获成功，以致理查·斯特劳斯称他是当时最重要的英国作曲家。\n\n埃尔加的创作特点在于把高雅的陈述与流行风格相结合，他的音乐外在表达亲切和蔼，而内里又隐藏着内省的抑郁，两者的融合并不是十分和谐。他对旋律的捕捉非常敏感，属于善于把握乐队技巧的大师之一，在合唱作品中，也善于控制合唱效果。埃尔加喜欢色彩变化，其作品中因充溢着太多的情感往往影响音乐本质的深度，但其中蕴含的丰富人道主义精神也冲破了英国音乐那种稳重、含蓄、有时有些沉闷的固定风格。埃尔加最有名的作品是《谜语》变奏曲、《威仪堂堂》进行曲和《大提琴协奏曲》，其实他最优秀的作品是其清唱剧，比如《杰隆修斯之梦》和《王国》。', 'http://p2.music.126.net/f-I6bKLVUWAG5h1jip97Og==/109951166504493538.jpg');
