INSERT INTO `singer` VALUES ('33737', 'Frédéric François Chopin', '弗雷德里克·弗朗索瓦·肖邦（法语：Frédéric François Chopin，1810年3月1日－1849年10月17日），波兰作曲家和钢琴家，他是历史上最具影响力和最受欢迎的钢琴作曲家之一，波兰音乐史上最重要的人物之一，也是欧洲19世纪浪漫主义音乐的代表人物。\n\n肖邦自幼喜爱波兰民族音乐，7岁时就创作了波兰舞曲，8岁登台演出，不足20岁已出名。肖邦39岁时因病英年早逝，后半生主要生活在法国，创作了大量钢琴作品，如4部叙事曲、十余部波兰舞曲（包括《军队》《英雄》），26首钢琴前奏曲（包括《雨滴》），27首钢琴练习曲（包括《离别》《革命》），4部谐谑曲、4部即兴曲、3部钢琴奏鸣曲、21首夜曲、59首马祖卡、2部钢琴协奏曲、幻想曲、大提琴奏鸣曲和摇篮曲等。\n\n肖邦一生的创作大多是钢琴曲，被誉为“钢琴诗人”。他在国外经常为同胞募捐演出，为贵族演出却很勉强。1837年严辞拒绝沙俄授予他的“俄国皇帝陛下首席钢琴家”的职位。舒曼称他的音乐像“藏在花丛中的一尊大炮”，向全世界宣告：“波兰不会亡”。他晚年生活非常孤寂，痛苦地自称是“远离母亲的波兰孤儿”。临终嘱附亲人把自己的心脏运回祖国。', 'http://p2.music.126.net/3POx0Qw_mQGp9h4ku1ELuA==/109951165885175311.jpg');
