INSERT INTO `singer` VALUES ('33792611', 'ヒプノシスマイク -D.R.B-', 'ヒプノシスマイク–Division Rap Battle (催眠麦克风) 是一个由KING RECORDS和EVIL LINE RECORDS合作推出的男性声优Rap企划。自2017年9月正式启动后，现已发行7张专辑。本作已于2018年年底推出官方漫画，并将在2019年音游化。', 'http://p1.music.126.net/jTGRoiexN3v1v5_p_rDbfQ==/109951164749022476.jpg');
