INSERT INTO `singer` VALUES ('33850', 'Glenn Gould', '格伦·赫伯特·古尔德（英语：Glenn Herbert Gould，1932年9月25日－1982年10月4日），加拿大钢琴家。被公认为是20世纪最著名的古典钢琴家之一，他同时也是一位管风琴家、广播节目主持人与作曲家，以演奏约翰·塞巴斯蒂安·巴赫乐曲而闻名于世。于31岁（1964年）以后停止公开演奏，转向录音和其他项目。\n\n古尔德的演奏曲目从巴赫到爵士乐无所不包，他录制了勋伯格的全部钢琴作品，但最出色的表现还在对巴赫的演绎上。古尔德在处理快速乐段和声部的力度层次方面有非凡的才能，只有他才能出色地表现出巴赫的赋格的层次与魅力，而他在处理慢速时，音粒似是一个一个跳跃出来，快速又是音粒飞溅，有眼花缭乱之感。古尔德是一个拒绝观众、专注于在录音中寻找表现的钢琴家，他兴奋时会边弹边哼，我们在唱片中经常听到他的这种“杂音”，但这丝毫也不损害他演奏的光辉。', 'http://p2.music.126.net/KZN6nrDB5j_iXUiZTR6Mcg==/109951165204805358.jpg');
INSERT INTO `singer` VALUES ('33857606', 'JAYLERR', 'JAYLERR，大名：Kritsanapoom Pibulsonggram (กฤษณภูมิ พิบูลสงคราม)，小名：JJ (เจเจ)，泰国男演员、歌手、Rapper, 1996年8月15日出生于泰国清迈，乐队Nine by Nine成员。', 'http://p2.music.126.net/wbB_l9UgnWeidEQdzrgavw==/109951165772814083.jpg');
INSERT INTO `singer` VALUES ('33858088', 'Mew Suppasit', ' Mew Suppasit，大名：Suppasit Jongcheveevat (ศุภศิษฏ์ จงชีวีวัฒน์)，小名：Mew(มิว)中文译名：苏帕西·宗澈瓦，出生于1991年2月21日，泰国男演员、歌手。本科毕业于泰国农业大学工业工程系，硕士毕业于朱拉隆功大学工业工程系，博士朱拉隆功大学大学工业工程系在读 。', 'http://p2.music.126.net/_v3PWDjjyy5K-7npH6V6AQ==/109951166114302514.jpg');
INSERT INTO `singer` VALUES ('33858089', 'Kaownah Kittipat', '泰国明星kaownah，中文名王敏成，出生于1998年2月11日，毕业于泰国朱拉隆功大学数学理工专业。', 'http://p2.music.126.net/rox0X6HR3BCUkLNIfzK3BQ==/109951166047666153.jpg');
INSERT INTO `singer` VALUES ('33917936', 'Interupt', 'In 2019, two Sydney siders came together with a shared passion for heavy, bassline driven house music. Over the course of 12 months, countless hours of experimentation in the studio brought Interupt to life. Their sound is characterised by a fusion of catchy melodies and hard-hitting basslines; a style that\'s quickly gaining traction. Their bootleg refresh of the classic dance anthem, “Show Me Love”, has racked up over 100,000 plays alone. After releasing their first track with international label Crucast, they gained support from international artists, including Skepsis, TS7 & Notion. With their first original single, \"Think About Me\", signed to renowned dance music label, TMRW Music, Interupt is proving that their unique sound is worth all the attention it receives.', 'http://p2.music.126.net/tlIxlpT5KeXDDpIBbRJzdA==/109951166137355124.jpg');
INSERT INTO `singer` VALUES ('33927412', 'YOASOBI', 'YOASOBI是由VOCALOID制作人Ayase和创作歌手ikura组成的两人组音乐组合。是“将小说故事音乐化”的组合。', 'http://p2.music.126.net/4z1-oSdbCEh7kQ5AcC0WfQ==/109951166393133693.jpg');
INSERT INTO `singer` VALUES ('33942394', 'Stake', 'Stake！（原名 李坤榕 2001年8月8日出生 ）来自中国福建省泉州市南安市的梅山镇的Young boy，早在2018年开始创作制作嘻哈音乐，并交了许多志同道合的朋友，展开了Stake的说唱旅途 2020年发布了《Shining girl》《Lazy boy》获得了许多音乐人的好评 和上亿的播放使用量！Stake！保持自己特有的风格 并与时俱进突破自己', 'http://p2.music.126.net/Km8EZ-k2X_5ZVhp7nBzLTQ==/109951165666424650.jpg');
