INSERT INTO `singer` VALUES ('339594', 'Mili', 'Mili最早是由来自日本的Kasai Yamato a.k.a.HAMO（作曲，编曲）和加拿大的Momocashew（歌手，作曲）所组成的音乐团体，现拥有六名固定成员。他们主张突破风格的束缚、大胆自由地曲风与词作上突破常规，创造出独一无二、充满魅力的世界观。', 'http://p2.music.126.net/K22XYqdOrOEw4l9v2864wQ==/109951163171192039.jpg');
