INSERT INTO `singer` VALUES ('34134424', '低所得Ｐ', '2015年7月、「流星メテエシカ」にてデビュー。\n2作目の「auLelia」がスマッシュヒット。後に自身初の殿堂入りを達成する。\n中の人はビーノ名義で漫画家としての活動も行っている。\n作者の漫画「女子高生の無駄遣い」に低所得Pも登場している。１１話で挿入歌になっている曲‘’little bunny ‘’作っているのは原作者でもある‘’ビーノ‘’氏、ボカロＰとして‘’低所得Ｐとして活躍している。', 'http://p1.music.126.net/BxBcrvLrjIm7PiM48IYkQw==/109951166397696732.jpg');
