INSERT INTO `singer` VALUES ('34183156', 'Quang Hùng MasterD', 'Quang Hùng MasterD本名Lê Quang Hùng(黎光雄)，越南青年男歌手，1997年10月7日生于越南承天顺化省。代表作品有《Đừng Khóc Một Mình》《Đừng Vì Anh Mà Khóc（不要为我哭）》《Hoa Bất Tử（不死花）》《Dễ Đến Dễ Đi》等。', 'http://p1.music.126.net/va_UUJDRZQSkTOarOSQZug==/109951165639615599.jpg');
