INSERT INTO `singer` VALUES ('34452701', 'Tăng Duy Tân', 'Tăng Duy Tân是来自越南的流行男歌手，出生于1995年8月15日，和越南著名音乐家陈桓 (Trần Hoàn)是亲属关系，出生于传统音乐家庭的他从小就展现出对音乐的热爱，在大学期间他参与学校艺术社团的多项工作，2018年年初毕业后签约BigArts Entertainment正式开始娱乐事业。2020年与越南制作人Phong Max打造电子舞曲\"Ngây Thơ\"火爆全网，其大胆个性、突破创新的音乐风格颇受好评，歌曲音乐录像带在Youtube累积破千万点击量。', 'http://p2.music.126.net/ueZX-oS_zfCEgMEYVqxyiA==/109951165561727099.jpg');
