INSERT INTO `singer` VALUES ('34973', 'Herbert von Karajan', '赫伯特·冯·卡拉扬（德语：Herbert von Karajan，1908年4月5日－1989年7月16日），出生于萨尔斯堡，奥地利著名指挥家、键盘乐器演奏家和导演。卡拉扬在指挥舞台上活跃60 年。他带领过欧洲众多顶尖的乐团，并且曾和柏林爱乐乐团有过长达34年的合作关系。他热衷于录音和导演，为后人留下了大量的音像资料，包括众多的管弦乐，歌剧录音和歌剧电影，涵括从巴洛克，到后浪漫主义欧洲作曲家，甚至部分现代乐派的作品。其中一些作品，如贝多芬的交响曲还被多次录制。卡拉扬在音乐界享有盛誉，甚至在华文世界被人称为“指挥帝王”。', 'http://p1.music.126.net/lnmkN6kWa0HTMmxfUutnGg==/18567452859921170.jpg');
