INSERT INTO `singer` VALUES ('35379', 'James Galway', '詹姆斯·高威爵士（SirJamesGalway，1939年12月8日出生）是个来自北爱尔兰贝尔法斯特的长笛演奏家，被誉为“金笛手”。詹姆斯·高威出生在爱尔兰的一个“长笛之家”，他的祖父和父亲都吹得一手好长笛。大师的夫人也是著名的长笛演奏家金妮•高威（Jeanne Galway）。', 'http://p2.music.126.net/gEo8oXhvi63g9BUE-9ZKZA==/5785630185594329.jpg');
INSERT INTO `singer` VALUES ('35415', 'Janos Starker', '斯塔克·亚诺什（匈牙利语：Starker János，1924年7月5日－2013年4月28日），美国籍匈牙利裔大提琴家。\n\n斯塔克有高人的技巧，追求质朴、刚劲的演奏。他重新编订了巴赫的6首无伴奏组曲，强调了那种粗砺、刚劲的表达。他演奏的科达伊的奏鸣曲，把此曲技巧上的高难表现得游刃有余堪称绝活。而他在 Mercury录制的德沃夏克协奏曲，舒曼、拉罗、圣桑的协奏曲，都是他最成熟时期的丰硕成果。', 'http://p2.music.126.net/b0LDrmkhxg3IMDO7zj0dgw==/109951165904619059.jpg');
INSERT INTO `singer` VALUES ('35429589', 'john', '幼少より様々な音楽経験を経て、2019年4月にボカロPとして「インフェリオリティー 」を投稿。その後ハイペースに楽曲を公開し、同年12月公開の「春嵐」がYouTubeで240万再生を達成。編曲からイラスト、動画まで全て一人で手掛けるマルチクリエイター。2020年8月よりソロプロジェクト「TOOBOE」を発足、ボカロ以外にもさらに広く音楽活動を手掛ける。', 'http://p2.music.126.net/Sf2lFlhnP6F3tBqQjoThYw==/109951165040575914.jpg');
INSERT INTO `singer` VALUES ('35478', 'Joshua Bell', '约夏·大卫·贝尔（英语：Joshua David Bell，1967年12月9日－），美国小提琴家、指挥家。出生于美国印第安纳州，4岁开始学习小提琴，受业于吉戈德（Josef Gingold）。1981年14岁时就与费城管弦乐团合作演出。作为索尼古典唱片公司的独家签约艺术家，约夏·贝尔18岁就为迪卡唱片公司录制了自己的第一张唱片，目前他已发行了40多张CD，揽获格莱美奖、奥斯卡奖、水星奖、留声机大奖、古典回声大奖。而曾经在美国地铁通道里的一则小提琴实验，更是引发了许多人的关注。其演奏追求音色的表达与细腻的层次显示，在室内乐方面似有更好的表现。《华盛顿邮报》评论他“是他同世代中最好的小提琴家之一”，英国《泰晤士报》曾把他的琴声评为：“最敏感细致的小提琴，演奏出令人神眩迷惑的琴音。”', 'http://p1.music.126.net/fgoujebZ0gGAJMgxmb1ajg==/223200860455548.jpg');
