INSERT INTO `singer` VALUES ('36490', 'Johann Sebastian Bach', '约翰·塞巴斯蒂安·巴赫（德语：Johann Sebastian Bach，1685年3月31日〔儒略历3月21日〕－1750年7月28日），巴洛克时期的德国作曲家，管风琴、小提琴、大键琴演奏家，也是巴洛克音乐的集大成者。巴赫被认为是音乐史上最伟大、最杰出、最重要的作曲家之一。\n\n巴赫出生于德国中部图林根州小城艾森纳赫的一个音乐世家，在有生之年是一位著名的宫廷乐长，在德国莱比锡圣多马教堂度过了最后27年的时间。\n\n巴赫把西欧不同民族的音乐风格融为一体。他集意大利、法国和德国传统音乐中的精华，曲尽其妙，珠联璧合，天衣无缝。\n\n巴赫自己在一生中并未享有盛名，而且在死后五十年中就已被世人遗忘。但是在近一个半世纪中他的名气却在不断地增长，一般认为他是西方音乐史中最伟大的两三位作曲家之一，而且有些人认为他是其中最伟大的作曲家。\n\n巴赫的知名作品有《平均律钢琴曲集》《勃兰登堡协奏曲》《管弦组曲》《b小调弥撒》《无伴奏大提琴组曲》《马太受难曲》《圣诞神剧》《赋格的艺术》《哥德堡变奏曲》《无伴奏小提琴奏鸣曲与组曲》。', 'http://p2.music.126.net/tPLNdMUrH7mphFL5i6rbYw==/109951166460069131.jpg');
