INSERT INTO `singer` VALUES ('36723470', '優里', '優里（ゆうり）は、日本の男性シンガーソングライター。所属レコード会社はソニー・ミュージックレーベルズで、レーベルはアリオラジャパン。', 'http://p2.music.126.net/BSOv32heRrGg9qtYOiz5Dw==/109951165403100142.jpg');
INSERT INTO `singer` VALUES ('36801559', 'Bác sĩ Hải', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('36919506', 'RAP VIỆT', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('369585', 'Damiano', 'Damiano，原名“김일겸”，韩国Rapper，1993年2月19日生，2014年9月发布首张单曲《살 빼지마》，正式出道。', 'http://p2.music.126.net/8c0O1mseJRME3bMN8rovcA==/3411784582110430.jpg');
INSERT INTO `singer` VALUES ('36968186', 'Gulf Kanawut', '卡纳吾·翟彼帕塔纳朋（Gulf），1997年12月4日出生于泰国，泰国男演员。', 'http://p1.music.126.net/BOoleau4KXSORI3mBjw0HQ==/109951165385927976.jpg');
INSERT INTO `singer` VALUES ('3706', '林子祥', '香港著名歌手和演员。1980年，他凭《在水中央》及《分分钟需要你》两首歌曲在第三届十大中文金曲颁奖音乐会连获两个金曲奖，成为当年的大赢家。而在1994年举行的香港电台第十七届《十大中文金曲颁奖音乐会》上，林子祥获颁“香港乐坛最高荣誉──金针奖”。2003年，林子祥获得CASH音乐成就大奖，是首位唱作人获得此殊荣。综观整个八十年代，在这十年之间，他共有23首歌曲登上香港电台中文歌曲龙虎榜冠军位置，仅次于谭咏麟的28首。他也是众多演艺界人士的偶像或最喜爱的歌手，包括徐小凤、梅艳芳、张国荣、刘德华等等。', 'http://p2.music.126.net/nWi2HOAT6-sgqPM2QR15EA==/253987186033427.jpg');
INSERT INTO `singer` VALUES ('3707', '郎朗', '郎朗，满族人。国际著名钢琴家，1982年生于辽宁沈阳。被数家美国权威媒体称作“当今这个时代最天才、最闪亮的偶像明星”，他是受聘于世界顶级的柏林爱乐乐团和美国五大交响乐团的第一位中国钢琴家。曾被《人物》杂志称为“将改变世界的20名青年”之一。', 'http://p2.music.126.net/xDwh6Q--M2CdxMshEwVIJQ==/18802748346768598.jpg');
INSERT INTO `singer` VALUES ('37088', 'John H. Clarke', '美国著名民间吉他艺人，以弹奏西班牙古典吉他而闻名。目前出版了两张专辑《Acoustik Guitar》和《Classical & Spanish Guitar》。', 'http://p1.music.126.net/NHjYKnb-UntVM4aRQeSqRQ==/5959353022973296.jpg');
INSERT INTO `singer` VALUES ('37153940', 'STAYC', 'STAYC(스테이씨)，为韩国作曲家黑眼必胜公司High Up Entertainment旗下的六人女子团体，由Sumin、Sieun、Isa、Seeun、Yoon、J六名成员组成，并由Sumin担任队长。2020年11月12日，发行首张单曲专辑《Star To A Young Culture》，以主打《SO BAD》正式出道。', 'http://p1.music.126.net/w3zXSDejtfuk7_q3E2217w==/109951165891982020.jpg');
INSERT INTO `singer` VALUES ('37165850', 'DPR IAN', 'DPR IAN是Dream Perfect Regime旗下的说唱歌手，导演和作曲家，曾经作为男子团体C-CLOWN的成员出道，艺名为Rome。2020年10月26日，他以数字单曲“ So Beautiful ”首次亮相。', 'http://p2.music.126.net/CSTElx0urguzZwP5NIS0Aw==/109951165508886065.jpg');
INSERT INTO `singer` VALUES ('37231059', 'Ado', '2002年10月24日 東京生まれ、驚異の新星Adoが、17歳の最後の日にデビューする。', 'http://p2.music.126.net/8fkskCPOhDfCQCxEiKlYqA==/109951165953999675.jpg');
INSERT INTO `singer` VALUES ('37296', 'Julian Lloyd Webber', '朱利安·劳埃德·韦伯（英语：Julian Lloyd Webber，1951年4月14日－）是英国大提琴独奏家，他被称为“英国最资深大提琴演奏家”。', 'http://p2.music.126.net/gtcDvvHTNr6vmOb8DvSgqg==/840026883626979.jpg');
INSERT INTO `singer` VALUES ('37473467', 'PP Krit', 'PP Krit，中文名：林祎凯，中文译名：克里特·安努艾德奇康，大名：Krit Amnuaydechkorn（กฤษฏ์ อำนวยเดชกร），小名：PP（พีพี），出生于1999年4月30日，泰国男演员、歌手、模特。星 座：金牛座 血 型：B型 ,身 高：178 cm 体 重：55 kg, 毕业院校：泰国农业大学 。', 'http://p2.music.126.net/XIbjtVnuXGBYEOJZ_HUC4w==/109951165928233398.jpg');
INSERT INTO `singer` VALUES ('3762', '吕思清', '第一位夺得意大利帕格尼尼国际小提琴大赛金奖的东方人。作为中国最具影响力的杰出小提琴家，吕思清长期受邀与全球知名乐团合作巡演、参加世界各地艺术节及音乐节活动，同时带领他于2011年创办的”美杰三重奏”举行室内乐音乐会，足迹遍布世界四十多个国家和地区。近年吕思清担任国家大剧院”五月音乐节”艺术总监。吕思清曾与Philips、Marco Polo、Naxos、ABC Classics及BIS等在内的世界知名唱片公司合作出版逾20张个人专辑。', 'http://p2.music.126.net/QysH3_BfGgsYAxRmSUDs_g==/680597697619150.jpg');
INSERT INTO `singer` VALUES ('37997', 'Krystian Zimerman', '克里斯蒂安·齐默尔曼（波兰语：Krystian Zimerman，1956年12月5日－），波兰钢琴家和指挥家。出生于波兰扎布热，是现今公认世界上最杰出的钢琴家之一，曾于1975年获得第九届肖邦国际钢琴大赛首奖。齐默尔曼兼具浪漫气质与精湛的技巧，其演奏的肖邦清新而最具特色。他以诠释浪漫主义音乐见长，但亦广泛演奏古典主义作品，此外也非常支持现代音乐的发展，也录制一些浪漫主义和印象派的独奏作品。', 'http://p2.music.126.net/DntSPXLpTc40F6rfmA_TgQ==/3265549615432821.jpg');
INSERT INTO `singer` VALUES ('38127', 'Ludovico Einaudi', '意大利钢琴家和作曲家 Ludovico Einaudi 鲁多维科·艾奥迪 1955年出生于意大利都灵，他的母亲也是一位钢琴家，从小就受到了钢琴音乐的熏陶。在米兰音乐学院学习时获得了意大利著名的作曲家、指挥家和音乐教育家 Luciano Berio 卢西恩·贝利奥 的指导，并获得了作曲学位。他的音乐总被认为是容易接近和可信的，被描述为最低纲领主义者，古典，氛围，当代和深动感人的受欢迎的声音，曲风深受巴哈、莫扎特、肖邦等音乐家的影响，古典大气而不乏现代感。', 'http://p1.music.126.net/O3NRzAxuj-5-EQc3c_wmUQ==/109951163007707637.jpg');
INSERT INTO `singer` VALUES ('38130', 'Lasse Lindh', 'Lasse Lindh，瑞典Indie Pop歌手，出生于1974 年 3 月。在瑞典，Lasse Lindh就是大牌级人物，16岁就开始组建乐队，曾经也签署于瑞典著名唱片Labrador，至今为止发行了7张专辑，1张EP，1张单曲（2007年4月），带有浓重Indie-pop风格，流行味十足的痛苦情歌，以优美的方式诉说悲伤，时而郁闷压抑时而情绪高涨，让人沉迷在他美妙嗓音和悦耳旋律之中；温暖的钢琴和失真吉他声交织缠绵在一起。总体说来，Lasse Lindh的风格倾向于悲伤和近乎于崩溃的吉他流行曲，与美国的EMO一派颇为相似，但难能可贵的是他还是避免了美国的那种极端的心碎和搔首弄姿般的顾影自怜。', 'http://p1.music.126.net/FpjBS8to3V2jJDElTjYywA==/846623953408959.jpg');
INSERT INTO `singer` VALUES ('38731', 'Ludwig van Beethoven', '路德维希·范·贝多芬（德语：Ludwig van Beethoven，1770年12月16日－1827年3月26日），德国作曲家、钢琴演奏家，维也纳古典乐派代表人物。贝多芬上承古典乐派传统，下启浪漫乐派之风格与精神，因而在音乐史上占有非常重要的地位，他是历史上最具影响力和最受欢迎的作曲家之一。自1814年开始，他的听力急剧下降，于是放弃了钢琴演奏和指挥，但却坚持创作。贝多芬一生共创作了9首编号交响曲（其中第三号“英雄”、第五号“命运”、第六号“田园”第七号、第九号“合唱”尤为著名）、36首钢琴奏鸣曲（其中32首带有编号，1首未完成）、5首钢琴协奏曲、1首小提琴协奏曲、10部小提琴奏鸣曲、16首弦乐四重奏、1部歌剧及2部弥撒曲等等。这些作品对音乐发展有着深远影响，贝多芬因此在华语世界中被尊称为“乐圣”。', 'http://p1.music.126.net/iEBu3AGqh4C-3wW-_lT8JQ==/109951165867914165.jpg');
INSERT INTO `singer` VALUES ('38858', '马友友', '马友友（Yo-Yo Ma，1955年10月7日－），祖籍浙江鄞县，生于法国巴黎，美籍华裔大提琴演奏家，曾获得多座格莱美奖。马友友的演奏追求细腻的表达与抒情，追求美妙的音质和自然、清新，他的琴声往往是一种感情倾诉。其演奏的德沃夏克协奏曲，以浸透了浪漫伤感而格外感人，他在处理舒曼的《民间风格小曲》、《柔板与快板》、《幻想曲》时，充分体现出温柔和抒情，而他拉的巴赫6首无伴奏组曲，也以他自己的方式，使其细致而情感化。', 'http://p1.music.126.net/GCcrTVZhUofbfH6Ysz4EIA==/652010395274911.jpg');
INSERT INTO `singer` VALUES ('38956', 'Michael Hoppé', 'Michael Hoppe, 一个获得格莱美奖提名的旋律天才，在流行和古典音乐都有广泛的背景；反映在他多样的唱片品牌和作品上。他的音乐在国际间和众多的节目中被聆听，从HBO的“女高音”到Oprah Winfrey Show。 ', 'http://p2.music.126.net/cE5aGQGpQlgMWZvLpWoP4g==/5985741302105670.jpg');
INSERT INTO `singer` VALUES ('40049', 'Maurizio Pollini', '毛利齐奥·波里尼（Maurizio Pollini，1942年1月5日－），意大利钢琴家。9岁登台，后师从维杜索，1959年毕业于米兰音乐学院，1957年在米兰演奏肖邦练习曲引起注意，1960年参加第六届国际肖邦比赛，获第一名，之后又拜米凯兰杰里为师继续深造，1972年起在基贾娜学院钢琴高级班任教。波里尼善于演奏幅度、力度较强的作品，比如贝多芬。他演奏的贝多芬，无论协奏曲与奏鸣曲，都洋溢着理性的光辉；他演奏的普罗科菲耶夫的奏鸣曲，如同滤去了浮躁的情感，与俄罗斯演奏家的演奏恰成对比。波里尼追求触键的准确、清晰，有“如在无菌室中培养出来的清洁”之称，因为追求理想而常常摒弃感性在演奏中的作用，所以他演奏贝多芬钢琴奏鸣曲的效果远不如吉列尔斯，表现的肖邦也往往过于“坚硬”而流畅、刚柔对比不够。', 'http://p1.music.126.net/o5LDFIrrs7plM15NFcjJfQ==/557452395302898.jpg');
INSERT INTO `singer` VALUES ('408944', 'HKT', 'HKT组合来自越南的三名艺人titi、kiet、hung\"天团”爆红网络，被网友呼为“洗剪吹三人组”。2012年11月6日，HKT组合在新浪上开通微博，不到5个月就迎来了上百万粉丝，三位90后男生以视觉系的风格迅速攻陷网友审美，怪异的“视觉系家族”造型，狗血的MV剧情，山寨的音乐风格，掀起一股“农业重金属”风暴，被誉为“乡村重金属小清新”。', 'http://p1.music.126.net/LPUJZhKhDi-U7AFKUMScYg==/1378787596079396.jpg');
INSERT INTO `singer` VALUES ('4213', '梁凡', '2010年参加湖南卫视快乐男生进入全国 60强。2011年获得省音协举办的陕西省声乐奖冠军。\n2012年参加东方卫视声动亚洲，现场与乐队配合即兴创作演唱博得众赞。2015年转型唱作人参加第二季《中国好歌曲》                  以一首抒情温婉的《阿楚姑娘》赢得了周华健、蔡健雅、刘欢等三位导师的推杆，最终在力邀下加入了刘欢老师的队伍，代表作《阿楚姑娘》也成了大众翻唱的热门歌曲。\n 2015年中旬，在结束中国好歌曲比赛后，以歌手，作曲，编曲，制作人的身份，与广州半音文化发展有限公司合作发行首张个人专辑《倒车Remind Me》。整张专辑七首歌曲风格无一相同，专辑幕后团队汇集祖国南北地域优秀音乐人，还有国外乐手的鼎力支持。\n2015年西安音乐广播FM931 20周年新台歌，担任制作人，作曲，编曲及演唱\n为内地电视剧《美梦成真》演唱主题曲《美梦多重要》\n为著名歌手满文军创作单曲《双城印象》\n 为中国好声音曹寅创作单曲《忽而今夏》\n为中国好声音成彧创作单曲《旁观者》\n为著名歌手孙露创作单曲《听回忆说》\n为中国好歌曲方毅担任作品《模样》《三十》制作人及编曲\n为中国好声音田丹新专辑创作《旧照片》并担任制作人及编曲\n2012年至2014年 西安天声我才K歌争霸赛担任评委与明星导师\n2013年百事最强音校园歌手大赛担任嘉宾评委\n2013年东方卫视中国达人秀西安地面选拔赛评委\n2015年雪碧音碰音西安唱区评委\n2015年星秀娱乐Top Star顶级明星选拔赛担任评委与明星导师\n2015年梦声音青少年公益歌唱比赛担任梦想导师', 'http://p2.music.126.net/LLtGJZEHe1fCUNSHfvBVwA==/18702692789117314.jpg');
INSERT INTO `singer` VALUES ('43746', 'Salvatore Accardo', '萨尔瓦托雷·阿卡多（意大利语：Salvatore Accardo，1941年9月26日－），意大利小提琴家、作曲家，以其帕格尼尼作品诠释而闻名。', 'http://p1.music.126.net/UE0MsFs6AouwpML0oE6M9w==/109951165964958875.jpg');
INSERT INTO `singer` VALUES ('45376', 'Jorge Bolet', '乔治·博列特（Jorge Bolet，1914年11月15日－1990年10月16日），美国古巴裔钢琴家。12岁获美国科蒂斯音乐学院奖学金到该院留学，在萨佩顿(Saperton)班学钢琴，1932-1933年师从戈多夫斯基，1935年拜罗森塔尔为师，接着又从鲁道夫·塞尔金深造。1937年举行独奏会而崭露头角，1938年获霍夫曼钢琴比赛奖，二战中参军，战后继续演奏生涯。博列特被称为浪漫乐派钢琴演奏家的最后代表，他的演奏是抒情与狂想的很好结合，被称为“李斯特的代表”。博列特在Decca录制的9张李斯特作品选集是其代表唱片。他演奏戈多夫斯基改编的肖邦练习曲，也是极为精彩的录音。', 'http://p1.music.126.net/GzBxU7qcQp2MZfXvDZML4Q==/109951165920496770.jpg');
INSERT INTO `singer` VALUES ('45634', 'Vitas', '                          维塔斯（俄文名：Витас，英文名：Vitas）生于1981年2月19日。他成为俄罗斯在克里姆林宫举办个唱的最年轻的歌手。他特别喜欢鱼，而且令人佩服的是，他是个服装设计师。维塔斯第一次出现在俄罗斯舞台上是在2000年12月，其成名曲为《歌剧2》。', 'http://p2.music.126.net/bNf1hhjE1CIrdxUwW8A7Mw==/109951164456232468.jpg');
INSERT INTO `singer` VALUES ('45688', 'Vladimir Horowitz', '弗拉基米尔·萨莫伊洛维奇·霍洛维茨（英语：Vladimir Samoylovich Horowitz，俄语：Владимир Самойлович Горовиц，1903年10月1日－1989年11月5日），美国俄裔钢琴家，一生获24个格莱美奖。\n\n就学于基辅音乐学院，毕业后在哈尔科夫举行了15次独奏会，正式开始演奏生涯，1924-1925年以11台不同曲目的演奏共23场，声名大噪。1928年到伦敦，接着到纽约，因在比彻姆指挥纽约爱乐乐团演奏柴科夫斯基《第一钢琴协奏曲》中的出色表现而真正在世界范围内成名。1933年，他开始与托斯卡尼尼合作贝多芬的钢琴协奏曲，在更大范围获得了世界声誉，不久与托斯卡尼尼的女儿结婚，1940年定居美国，1944年入美国籍。霍洛维茨曾多次从舞台退隐，最长的一次是从1953年至1965年，他以神经系统受损害为由，整整12年不再露面，潜心于研究克莱门蒂的作品。1965年5月9日，他在卡内基音乐厅重返舞台，举行一系列音乐会，4年后再度退隐，直至1974年才再度出山。1986年在他82岁高龄时重返苏联，于莫斯科和列宁格勒各举办了一场音乐会。\n\n霍洛维茨是一个有争议的钢琴家，因为他的演奏极端追求表情与效果。在技巧方面，他对速度和力度的控制出类拔萃，尤其是在八度表达上，有惊人的能力，既能发出铿锵有力的金属声音，又有梦幻般的柔美音色；他擅长强音，擅长制造快速的音效，追求美妙的连音效果，他强调的是极端的对比和极端的表情，他的演奏能创造最出色的效果。霍洛维茨最擅长挖掘类似舒曼、肖邦、斯克里亚宾、拉赫玛尼诺夫、克莱门蒂等作曲家的神秘因素，他演奏的舒曼的《童年情景》、《克莱斯勒偶记》、《梦幻曲》以及斯克里亚宾与克莱门蒂的奏鸣曲、拉赫玛尼诺夫的前奏曲与练习曲都有极强的造型感。晚年他醉心于莫扎特，但他的莫扎特是极端效果化的莫扎特，他认为他对作品效果的追求，是他的音乐创造。', 'http://p2.music.126.net/IsvvsiepmzS1P2STsGf3cA==/109951165964977540.jpg');
INSERT INTO `singer` VALUES ('45746', 'Vladimir Ashkenazy', '弗拉基米尔·达维多维奇·阿什肯纳齐（俄语：Влади́мир Дави́дович А́шкенази、冰岛语：Vladímír Ashkenazy，1937年7月6日－），又译阿什克纳济，冰岛籍俄罗斯钢琴家、指挥家。阿什肯纳济作为俄罗斯钢琴家，感情充沛，追求表达的抒情性、诗意与浪漫气质，作为奥伯林的学生，又有莫斯科学院派那种不同于德奥学院派的严谨。阿什肯纳济的最突出长处是其手指的高超技巧，而在音色上比起类似里赫特这样的俄罗斯钢琴家略逊一筹。阿什肯纳济演奏曲目极广，但其长处还是在表现俄罗斯作曲家，尤其是拉赫玛尼诺夫与斯克里亚宾的作品中。他与帕尔曼、哈雷尔组成的三重奏，在演奏柴科夫斯基的室内乐作品中体现了自己的特色。', 'http://p1.music.126.net/BgnHqZe-Gf9hA_QNpoExew==/109951164090164477.jpg');
INSERT INTO `singer` VALUES ('46325856', '库妮珂', '库妮珂，女，汉族，原名刘阳, 音乐唱作人。\n代表作（作曲）：《和田玫瑰》《梦中的巩乃斯河》《丢失》《杏花吟》《女人还是女人》等，2019年与著名诗人俞心樵合作的《近忧远虑》《逆流：你和我》《不容易之诗》被星外星音乐收录进2020年7月发行的诗已成歌第二辑《这一夜持续了一生》。\n2012年，库妮珂以真名刘阳的身份参加了湖南卫视音乐综艺节目《女人如歌》的录制。', 'http://p2.music.126.net/-tfboZcBZUTk15GMcu5g2w==/109951165789353694.jpg');
INSERT INTO `singer` VALUES ('46326089', 'kanaria', '18歳。使用ボーカロイドは初音ミク、ＧＵＭＩ。\n2020年5月に「百鬼祭」投稿でボーカロイドPデビュー、自身初の殿堂入りを達成。若干17歳での投稿、その楽曲性の高さに多くのリスナーに注目を浴びることなった。2020年8月2日には2作目「ＫＩＮＧ」にて、自身初のミリオンを達成。\n日々歌ってみた・踊ってみた等、多くの2次創作が様々なSNS・プラットフォームで投稿され2020年下半期で最もトピックなボカロ曲となっている。今後の活躍が最も注目される若手クリエイターである。\n', 'http://p2.music.126.net/_n1cYzIyoesfwBF7Pv9PjA==/109951165545662017.jpg');
