INSERT INTO `singer` VALUES ('47131872', 'PHONO RECORDS', 'PHONO RECORDS (留声唱片) 是冰弦音乐旗下独立厂牌项目，由D3REZ等人管理/运营，于 2021 年 2 月 26 日官宣成立。\n\n留声唱片成立的初衷，是以旗下优秀制作人为发展中心，以让我们的资源更好的服务于每一位艺术家。能为制作人们提供作曲作词/专业歌手/全球发行/封面设计以及硬件母带等一系列服务。\n\n目前 PHONO RECORDS 已与多名海内外艺人拥有着密切的合作联系。有着完善，全方位的专业运营团队的我们，将以严谨高质量的态度服务每一首发行作品，为国电输出强劲血液。\n\nPHONO RECORDS 也将在未来逐步扩大，成为一个集音乐发行、线下活动、视觉艺术、潮流文化、泛娱乐产品等多方面发展的综合性大型 IP 品牌。', 'http://p1.music.126.net/qzjf4ZJ2upsnmHoH4NDHiw==/109951165777630136.jpg');
