INSERT INTO `singer` VALUES ('4873', '奇然', '奇然，中国古风歌手，国风音乐人，平行世界工作室室长。代表作《琵琶行》、《离骚》《燃犀照夜》、《雨过昔年》。毕业于上海戏剧学院，建立平行世界工作室，专注国风音乐创作十余年。17年创作“高考背书系列歌曲”：《琵琶行》、《离骚》等歌曲被数千家官方媒体、新闻报道，为年轻人了解古文和国风文化起到建设性作用。', 'http://p1.music.126.net/LnLSDqRXqBB5vXdG77rozw==/109951163647956392.jpg');
