INSERT INTO `singer` VALUES ('50467834', '杉本新 (THE SIXTH LIE)', '◆Profile\n姓名：Arata (杉本 新 / Sugimoto Arata)\n出生日期：1992年12月3日\n出生地：熊本县\nHT174\n\n◆Web Site / SNS / YouTube\n（个人）\nhttps://twitter.com/Arata_T6L \nhttps://www.instagram.com/tsl_arata/ \n\n（乐队）\nhttps://thesixthlie.jp \nhttps://twitter.com/thesixthlie\nhttps://www.youtube.com/c/thesixthlie_t6l \n\n◆主要活动经历\n现任摇滚乐队「THE SIXTH LIE 」主唱。\n\n-THE SIXTH LIE-\n●TV动画\n【2018年】\n演唱TV动画《黄金神威》第一季片尾曲。\n以片尾曲《Hibana》在NBCUniversal Entertainment Japan正式出道。该歌曲在日本国内iTunes动画部门获得第1名。\n　　　　　\n【2019年】\n演唱TV动画《某科学的一方通行》片头曲。\n片头曲「Shadow is the Light」在Spotify的播放量突破400万次!!\n\n【2020年】\n演唱TV动画《黄金神威》第三季片尾曲。\n片尾曲《融雪》入围日本国内ROCK排行榜。\n\n●LIVE\n【2016年】KNOT FEST JAPAN2016开场嘉宾\n【2017年】Animethon(加拿大)演唱 / HYPER JAPAN(伦敦)演唱\n【2018年】HYPER JAPAN(伦敦)演唱\nJAPAN EXPO(巴黎/曼谷/吉隆坡)演唱\n\n', 'http://p1.music.126.net/Sv89FizXIEwMEBygZLIqtQ==/109951166622626980.jpg');
INSERT INTO `singer` VALUES ('50467946', 'Shou', 'Shou\n出生于石川县。因小时候学习和太鼓开始对音乐感兴趣。在长达8年的乐队活动中，担任歌手和吉他手。随后，作为自由职业歌手开展音乐活动。现在每年演唱60首以上的歌曲。除了出演LIVE弹唱歌曲，还担任主持人、主播等，朝多个领域发展。', 'http://p2.music.126.net/AEDGsrL5EQRSd92qgCLF7g==/109951166622629882.jpg');
INSERT INTO `singer` VALUES ('50468286', 'Kaede(Sweet Licious)', 'Kaede\n2007年 组成女歌手组合「Sweet Licious」\n亲自参与作词作曲，于2021年10月以专辑《Sweet Licious》正式出道。首张单曲《Winter Kiss 〜冬がくれたラブストーリー〜》成为「WINTER SPORTS FESTA season11 冬スポ!! 」的TVCM歌曲在全国范围播放。中村杏出演的MV引起话题。\n2012年，发行的2nd album《Girlicious》收录小室哲哉创作的歌曲以及人气歌曲。\n2013年10月移籍到波丽佳音并EDM翻唱Shampoo的人气歌曲《Delicious》。2nd EP《My Valentine 》成为《sweet》杂志的CM歌曲。2020年作为「Coffee Creamers」主唱发行歌曲。\n2021年作为「Launa Mele」主唱发行歌曲。\n\n', 'http://p2.music.126.net/f8VdbKL1xyMdkokAJv-owA==/109951166626087343.jpg');
