INSERT INTO `singer` VALUES ('55350', 'Deep Side', 'Deep Side，(目前已改名为\"Git Fresh)是一支来自美国迈阿密的R&B + Hip-Hop 团体，四名成员分别为：Rudy (Rude Boi), Brent Pendergast (Penny), Mike Espinosa (Mike Ezay), 和Sly (Pretti Sly)。建团最初，成员都还是青春迸发的少年，怀着一颗满载理想的雄心踏上这条与音乐相关的远征路。很幸运他们的才华得到了大牌公司“Jive Records”的赏识，随后便首推第一张同名的大碟，不过在这之后6年里组合便没有大动作，直到加盟了新唱片公司，Deep Side重出江湖，更名以\"Git Fresh\"为头衔发布了新专辑\"Git Fresh\"，单曲\"Booty Music\"更是火得一塌糊涂，各种版本相继推出，让歌迷再次领略到了Deep Side的风光魅力。', 'http://p1.music.126.net/vaiGEtVwLpHCrXp1hLYSyw==/5997835929942840.jpg');
INSERT INTO `singer` VALUES ('5568', 'Winky诗', '歌手、词曲作者、制作人。没啥代表作。或者每首都算代表作。', 'http://p1.music.126.net/j8IConD2leR_O5msR9V4UA==/109951163783841048.jpg');
INSERT INTO `singer` VALUES ('56598', 'Ellie Goulding', 'Ellie Goulding（1986年12月30日－）英国唱作女歌手。她是“2010 BBC年度之声”最高票选得主，并得到2011年全英音乐奖评委的一致青睐，从此后便累积大量人气，名气与之俱增。2009年签约Polydor唱片公司，同年发行自己第一弹延伸剧目《An Introduction to Ellie Goulding》，接下来在2010年发行了第一张录音室专辑《Lights》以及改版专辑，重新更名为“Bright Lights”。英国卫报形容Ellie Goulding的歌声仿佛是空灵乐派的Cocteau Twins乐团唱起了流行乐的感觉，给听众带来新鲜的感觉！第二张录音室专辑《Halcyon》2012年10月5日正式发行。\n', 'http://p2.music.126.net/u5Z5sgV1ga1ZG4zohE6kuQ==/109951165006818703.jpg');
INSERT INTO `singer` VALUES ('5768', '萧敬腾', '从选秀节目出道成为华语音乐市场巨星，喜欢尝试音乐发展的各种可能性，从歌手、演员、主持人到作家，他勇敢挑战自我，他是从不害怕跟别人不一样的老萧。\n 出生于台湾花莲县丰滨乡，在台北市万华区成长。歌声浑厚高亢，唱腔丰富且有爆发力。他原本在餐厅驻唱，2007年因为参加台湾电视歌唱选秀节目第一届《超级星光大道》的踢馆单元而一举成名。2008年3月，华纳唱片公司宣布与萧敬腾签约，同年推出个人首张专辑《萧敬腾同名专辑》正式发行。\n\n2020年底，萧敬腾推出全新单曲〈萨哈星球〉，上线不到一周，成绩即疯狂登上各大数字音乐榜冠军宝座 。继〈萨哈星球〉后，萧敬腾又推出了酝酿近一年的「神秘计划」－与「知名YouTuber」老高所推出的全新单曲〈星期三〉。\n\n萧敬腾个人的YOUTUBE频道《萧房车》 更受到了大家的喜爱，短时间内创下了破百万高点击率。', 'http://p1.music.126.net/Ps0mwB_ncAfOlbyEb6tWEQ==/109951166530814275.jpg');
INSERT INTO `singer` VALUES ('5781', '薛之谦', '薛之谦（Joker Xue），1983年7月17日出生于上海，中国内地流行乐男歌手、影视演员、音乐制作人，毕业于格里昂酒店管理学院。\n2005年，因参加选秀节目《我型我秀》而正式出道。2006年，发行首张同名专辑《薛之谦》，随后凭借歌曲《认真的雪》获得广泛关注。2007年，凭借专辑《你过得好吗》获得MusicRadio中国TOP排行榜内地年度最受欢迎男歌手奖。2008年，发行专辑《深深爱过你》，同年在上海举行个人首场演唱会“谦年传说”。2013年，专辑《几个薛之谦》获得MusicRadio中国TOP排行榜内地推荐唱片。2014年，凭借专辑《意外》获得第21届东方风云榜颁奖最佳唱作人；同年他还获得音悦V榜年度盛典年度创作歌手奖。\n2015年6月，薛之谦首度担当制作人并发行原创EP《绅士》；同年，他还主演都市励志剧《妈妈像花儿一样》。2016年，凭借EP《绅士》、《一半》获得第16届全球华语歌曲排行榜最受欢迎男歌手、五大最受欢迎男歌手奖、上海地区杰出歌手奖及最受欢迎创作歌手奖，而歌曲《初学者》则获得年度二十大金曲奖。2017年4月，开启“我好像在哪见过你”全国巡回演唱会；同年，薛之谦获得第7届全球流行音乐年度盛典年度最佳男歌手及MusicRadio榜中国TOP排行榜内地最佳男歌手。\n2018年7月，薛之谦“摩天大楼”世界巡回演唱会于北京站启程，整个巡演横跨4大洲，8个国家，21个城市，累计上演场次23场。2020年12月31日，发行第11张个人专辑《天外来物》。', 'http://p1.music.126.net/LCWqYYKoCEZKuAC3S3lIeg==/109951165034938865.jpg');
INSERT INTO `singer` VALUES ('5997', '小曲儿', '小曲儿，知名古风音乐唱作人。2012年发行的个人首张原创古风专辑《曲倾天下》倍受好评。2014年发行的个人第二张原创古风专辑《曲终人未散》更赢得了广大粉丝的追捧。其中《上邪》、《忘川》等歌曲，深受听众喜爱。2017年个人第三张音乐专辑《十念》已发行。', 'http://p1.music.126.net/ahFZYenRB8roG1q0G2LeuA==/109951162895990149.jpg');
INSERT INTO `singer` VALUES ('60310', 'Ingrid Haebler', '海布勒Ingrid Haebler 1929-奥地利女钢琴家，父母为波兰人，11岁在萨尔茨堡公开演奏，在萨尔茨堡莫扎特音乐学院学习，后进维也纳音乐学院、日内瓦音乐学院、巴黎音乐学院深造，是玛格丽特·隆班上的学生。1952年参加日内瓦国际钢琴比赛获二等奖，1954年参加慕尼黑国际钢琴比赛和日内瓦舒伯特钢琴比赛，均获一等奖。海布勒的演奏追求一种清新、清纯的效果，追求音色的微妙层次区分与音阶性经过句中颗粒型音色的效果。海布勒好像天生是为演奏莫扎特而出生的，她从小在莫扎特的氛围中长大．她演奏的莫扎特，无论是协奏曲、奏鸣曲还是小品，都被认为是最有味道的莫扎特。她所演奏的舒伯特全套奏鸣曲以及与格吕米奥三重奏团合作的《鳟鱼》．也被认为是最有味道的舒伯特。', 'http://p1.music.126.net/iLvH_IeJSjopSEfY5CWn4Q==/109951163752884172.jpg');
INSERT INTO `singer` VALUES ('60942', 'Johannes Brahms', '约翰内斯·勃拉姆斯（德语：Johannes Brahms，1833年5月7日－1897年4月3日），浪漫主义中期德国作曲家。\n\n勃拉姆斯是当代维也纳的音乐领袖，其大部分的创作时期也是在维也纳度过的（1869年后定居于此）。他笔下的曲类包括钢琴曲、室内乐、交响乐、合唱曲，以及艺术歌曲等，尤其擅长将民谣旋律辅以精致化的笔法呈现之。此外，勃拉姆斯本人的钢琴演奏技巧亦相当杰出，他并和许多杰出的音乐家合作首演了自己的作品，与他有密切合作的音乐家包括：钢琴演奏家克拉拉·舒曼，小提琴演奏家约瑟夫·约阿希姆等人。在创作路线上，勃拉姆斯是纯粹音乐的拥护者及实践者，与当时的新音乐一派壁垒分明。\n\n勃拉姆斯以其完美主义著称，研究显示，未能令其满意的创作经常遭到他本人销毁，他未正式发表的作品也所在多有。迄今，勃拉姆斯的作品已成为现代音乐会的主要曲目之一。汉斯·冯·彪罗将勃拉姆斯与巴赫、贝多芬并称为“三B”。', 'http://p1.music.126.net/HgjnVWuOR57BO6JtHzez9Q==/3421680186487987.jpg');
INSERT INTO `singer` VALUES ('62627', 'Jacqueline du Pré', '杰奎琳·玛丽·杜·普蕾（法语：Jacqueline Mary du Pré，1945年1月26日－1987年10月19日），英国大提琴演奏家。杜·普蕾的演奏技巧十分全面，歌唱性旋律表现迷人，音色变化丰富多彩。她最出色的演奏就是对埃尔加协奏曲的处理，她最珍贵的录音是1971年与巴伦勃伊姆合作的肖邦和弗兰克（由小提琴奏鸣曲改编）的大提琴奏鸣曲，这是她的最后录音。', 'http://p1.music.126.net/BZAAWq5FcwiWZ2aC3Fyblg==/793847395254553.jpg');
INSERT INTO `singer` VALUES ('6309', 'Mai', '【新浪微博】 @Mai_NoLabel\n【E-mail】 prodbymai@163.com\n有偿的编曲、后期混音服务、专辑购买、合作邀约等，请私信以上的新浪微博，或发送电子邮件。 Mai(Young Mai) AKA Mason,来自中国西安的说唱艺术家,歌手/制作人/录音师/混音师.\nMai 自2007年活跃于中国Hip-Hop舞台，曾创立西安知名团体X.A.E.R及xXx。\n录音、混音、编曲、词曲、演唱合为一体的Mai现以制作人身份依然保持每年300＋首单曲制作高质产出的恐怖速度。\n融合多变的风格、亚洲与欧美的混合理念是Mai的制作理念，除作为红花会的团体制作人外，也曾为爱奇艺、网易云音乐、腾讯等平台担当Hip-Hop制作人，与满舒克、T T、海尔兄弟、Jony J、陈奂仁 等等国内一线艺术家保持长期合作。', 'http://p1.music.126.net/U1S-m3mpjQl4SBzZWmwnOQ==/109951165823289965.jpg');
INSERT INTO `singer` VALUES ('63650', 'Kathleen Battle', '凯瑟琳·迪安娜·芭特尔 (英语原名: Kathleen Deanna Battle) 生于1948年8月13日，是美国歌剧乐坛上知名的轻抒情花腔女高音(light lyric-coloratura)，以的她银玲般甜蜜轻巧的音色而闻名乐坛。最初在20世纪70年代早期和中期芭特尔通过与各大乐团合作演出女高音作品而知名。1975年首次出演歌剧并在20世纪80年代和90年代出演众多歌剧中的抒情女高音和花腔女高音角色。如今，虽然芭特尔不再频繁出现在歌剧剧目中，但她仍然活跃在音乐会和独唱演出中。', 'http://p1.music.126.net/fbHcVYeDL58LrMRoU1SnJg==/8900546627195958.jpg');
INSERT INTO `singer` VALUES ('6472', '张杰', '张杰，华语LIVE王。\n出道16年来，发行了14张专辑，200多首高品质音乐作品，40多首OST金曲，拥有众多被广为传唱的歌曲。近年来，他创新运用MIX-POP曲风，开辟音乐发展新征程。\n170多个音乐奖项，让他实现内地音乐奖项大满贯。2010年，获得韩国Mnet亚洲音乐盛典“亚洲之星”大奖；2014年，获得第42届全美音乐奖“年度国际艺人大奖”，成为内地首位获得该奖项的歌手。\n至今为止，举办了 61场大型演唱会，巡演足迹踏过海内外30余座城市，累计130万人观看。2018、2019连续两年打破鸟巢单场演唱会票房纪录。', 'http://p2.music.126.net/nYcbvtFppDltDtt3XhQZDg==/109951166308996364.jpg');
INSERT INTO `singer` VALUES ('648933', 'Shiza', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('66396', 'Martha Argerich', '玛尔塔·阿格里奇（西班牙语：Martha Argerich，1941年6月5日－），阿根廷钢琴家。第七届肖邦国际钢琴比赛首奖得主，被视为当代最伟大的钢琴大师之一。\n\n5岁首次登台，1946年师从斯卡拉穆扎（Scaramuzza）接受严格训练，1955-1957年在维也纳师从古尔达，后又在日内瓦拜李帕蒂夫人和马加洛夫为师。1957年获布梭尼国际钢琴比赛奖、日内瓦国际钢琴比赛一等奖。1960年从米凯兰杰利继续深造，1965年在华沙第七届国际肖邦钢琴比赛中获一等奖，波兰唱片公司在现场录制了她演奏的肖邦《第一钢琴协奏曲》的唱片，一下子使她名扬四海。阿格里奇曾两次退出舞台，但每次重返舞台就显示出种对自己的超越。阿格里奇的演奏充分展示出她的吉卜赛奔放、热情的性格，她以女性少有的有力触键以及对速度的敏感把握，在表达中显示出极亮丽的音质。阿格里奇善于表达情感充沛、能充分体现色彩感的作品，诸如肖邦、柴科夫斯基这类作曲家的丰富情感表达，在她的演绎下都能呈现出极夺目的光彩。她善于在乐队衬托下，被乐队刺激出激情，所以其协奏曲一般都好于独奏曲与室内乐。当然，也有例外，她演绎的肖邦《船歌》和舒曼的《童年情景》，可以说是最有味道的解读。', 'http://p2.music.126.net/y6nbeUaHeMo8fVb88Dx9LQ==/900500023154525.jpg');
INSERT INTO `singer` VALUES ('711683', '好妹妹', '好妹妹乐队 是由两个热情洋溢青春逼人的社会青年组成。“好妹妹乐队”的成员是两个清新干净的大男生：随性不羁的浪客秦昊和憨态可掬的张小厚。他们健康快乐积极向上，活泼进取热情开朗。他们英俊潇洒美丽婉约。是21世纪不可多得的大龄文艺青年。', 'http://p1.music.126.net/Lq1OiHWhO0vvzB0p_fRmgA==/109951163251486248.jpg');
INSERT INTO `singer` VALUES ('72609', 'Pascal Rogé', '帕斯卡·罗杰（Pascal Rogé，1951年4月6日－），法国钢琴家。\n帕斯卡·罗杰在9岁进入巴黎高等音乐院学习，师从迪卡芙（Lucette Descaves），并曾获美国钢琴家卡钦的指导。帕斯卡·罗杰在16岁得到罗马尼亚恩奈斯可钢琴大赛冠军，20岁得到隆-提博大赛冠军。\n帕斯卡·罗杰是一位唯美主义者，他的演奏触键精致细腻，声音清澈透亮，在表现法国印象派作品时，其轻灵雅致、朦胧与虚幻的意境极为迷人，其诠释的圣桑、弗雷、萨蒂等人的作品，都极有意境。', 'http://p2.music.126.net/wROcwjyVzAoLSSADPTeQvg==/109951165787113673.jpg');
INSERT INTO `singer` VALUES ('73708', '波丹.尤莉娅', '乌克兰美女波丹.尤莉娅 ，Юлія Рай。有人也叫她 Юлія Бодай，英文名叫RossTallanma。她以一首慢摇单曲lubov（Рiчка）走红国际乐坛。', 'http://p1.music.126.net/XvPtr3MJog0H4SvrXQ2LyQ==/5954954976462158.jpg');
INSERT INTO `singer` VALUES ('74625', 'Sia', 'SiA，全名Sia Kate Isobelle Furler.生于1975年12月18日，澳大利亚。父母均从事音乐工作，\"I only owned 2 CDs: a Jackson 5 anthology and Jeff Buckley\'s Grace.\"SiA在真正从事音乐之前，她听的音乐真的很少很少。因为在和Zero 7一起巡回演出之后，SiA才非常认真的去听各种不同的音乐作品。', 'http://p2.music.126.net/KLyFXQiVlA0OuD6bnBcrTw==/109951165434732124.jpg');
INSERT INTO `singer` VALUES ('747030', 'Vicetone', '自2012年成立以来，荷兰DJ双人组Vicetone的所有作品提现了他们优秀的制作能力和无穷的想象力。音乐人/制作人Ruben den Boer和Victor Pool定居于Nashville，在他们的家庭工作室中，他们从零开始制作每首歌曲的，亲自完成每个细节，打造了一个充满情感的舞曲风格。迄今为止，他们的作品在所有平台上的播放量已达到10亿。多年来，Vicetone完美的旋律感和高超的制作技巧让他们享誉全球。他们也因自己对电音的独到了解而多次进入DJ mag的榜单\n2014年DJ Mag百大DJ，排名36。 \n2015年DJ Mag百大DJ，排名50。  \n2016年DJ Mag百大DJ，排名81。 \n2019年重新入围DJ Mag百大DJ，排名83。', 'http://p1.music.126.net/cQK0UiVmN_GaLh0xqXIhcA==/109951165852222406.jpg');
INSERT INTO `singer` VALUES ('74843', 'Sara Nusara Poongprasert', '泰国一名老姐类歌手，歌曲均能首首唱到经典，现在已经退出歌坛了。', 'http://p2.music.126.net/zYV5bCAH_9Y8o__LXVtJ3Q==/5796625301871947.jpg');
INSERT INTO `singer` VALUES ('7570', '邓丽君', '邓丽君（1953年1月29日-1995年5月8日），出生于中国台湾省云林县褒忠乡田洋村，祖籍河北省大名县，中国台湾女歌手，日本昭和时代具有代表性的日语女歌手之一。\n1967年，推出首张个人专辑，从而开始其歌唱生涯。1969年，因演唱台湾首部连续剧《晶晶》的同名主题曲而在台湾成名。20世纪70年代初期，以《千言万语》、《海韵》等作品打开香港及东南亚唱片市场。1974年，凭借日文歌曲《空港》获得日本唱片大赏“新人赏”，并由此奠定其在日本的演艺事业基础。1976年，于香港利舞台举行首次个人演唱会。1980年，当选台湾金钟奖首位最佳女歌星。80年代初期，先后受邀于林肯中心、洛杉矶音乐中心、拉斯维加斯凯撒皇宫等地举行演唱会。1983年，举行华人歌手首次巡回演唱会，此后终止商业演出活动。1984至1986年间，先后以《つぐない》、《爱人》、《时の流れに身をまかせ》三曲三次获得日本有线大赏和全日本有线放送大赏两项日本音乐颁奖礼大奖的最高奖项。1987年起，呈半隐居状态并淡出乐坛。\n1995年5月8日，邓丽君因支气管哮喘发作于泰国清迈逝世；同年香港十大中文金曲颁奖礼追认授予邓丽君“金针奖”；全日本有线放送大赏、日本有线大赏、日本唱片大赏分别追认授予邓丽君“特别功劳赏”。1996年，台湾金曲奖追认授予邓丽君“特别贡献奖”。2007年，邓丽君成为日本古贺政男音乐博物馆“大众音乐殿堂”表彰者。', 'http://p2.music.126.net/P3kTsKOpXLSAh4Cw41eF0Q==/109951165621465376.jpg');
INSERT INTO `singer` VALUES ('761018', '李洪基', '李弘基（이홍기），1990年3月2日出生于韩国首尔，韩国歌手、演员，韩国摇滚乐队F.T.Island成员之一。李弘基童星出身，2002年拍摄儿童剧集《魔法儿童Masuri》 。2007年6月以F.T.Island主唱身份正式出道。', 'http://p1.music.126.net/qEA2iEbAyzKvkQZMpLMi6Q==/109951164353541468.jpg');
INSERT INTO `singer` VALUES ('762511', '3LAU', '美国拉斯维加斯DJ，制作人Justin David Blau生于1991年1月9日，以艺名3LAU为人熟知（读作Blau），以融合了electro house, dubstep, deep house, progressive house等诸多风格且旋律性极强的舞曲为乐迷所知。自2011年起，3LAU发行了三张Mixtape以及数张单曲，曾在纽约Electric Zoo以及拉斯维加斯的EDC音乐节上进行演出，随后在辗转了如Dim Mark, Revealed, Aramda 等多个知名电音厂牌后2016年3LAU签约了Blume厂牌，并在2018年2月推出了自己大获成功的处女专辑《Ultraviolet》。', 'http://p2.music.126.net/swUH6oVud_hNHPF3txn23g==/109951164744862166.jpg');
INSERT INTO `singer` VALUES ('768159', 'CL', '李彩麟(이채린 / Faith Lee)，艺名：CL，韩国女歌手，1991年2月26日出生于韩国首尔，著名女子组合2NE1的队长。她以出众的实力、个性鲜明的风格与优秀的语言能力闻名，而自幼就在国外成长的经历也令多元的文化在她的身上碰撞出了奇妙的火花。自出道以来，她领导2NE1打破韩国女子组合的传统风格，积聚了超高的人气，开创了韩国女子组合的新气象，是2NE1的灵魂人物。', 'http://p2.music.126.net/WAJw0uLuiAzhbP8XLlJNEQ==/109951165763020087.jpg');
INSERT INTO `singer` VALUES ('768193', 'DISH//', 'DISH//（ディッシュ）は、日本のダンスロックバンド。スターダストプロモーションに所属するタレントで構成されたアーティスト集団「EBiDAN」から結成された。', 'http://p2.music.126.net/dQwmERok4VyVwsX4YubOIw==/109951165690710346.jpg');
INSERT INTO `singer` VALUES ('774157', 'Bumkey', 'Bumkey，是SOLO歌手，制作人，组合 Troy 的队长，发行个人SOLO歌曲《疯狂恋爱》《BAD GIRL》。所属公司：Brand NewMusic。', 'http://p2.music.126.net/c2q8ovo4Vxx_BABl28f4Bg==/109951164434215540.jpg');
INSERT INTO `singer` VALUES ('775075', 'ATOLS', '1999年就开始作为音乐人活动，当时的名义是better，2007年变更为Atols；2010年在niconico开始以ATOLS名义活动并投稿了第一首VOCALOID作品.\n不仅是音乐制作人，还是beatboxer。作为DJ演出时也会穿插beatbox.\n喜爱马卡龙，和ATOLS有关的地方总是伴随着马卡龙的出现.\n风格是实验音乐，以techno和dubstep为主。在niconico，他的最著名的风格为感性の反乱β.\n歌曲题材常常涉及宗教、哲学和马卡龙.\n除了音乐，他所制作的PV也有强烈的个人特色.', 'http://p1.music.126.net/27ZDreQeKjsw-gAFB1hlqw==/109951164631286042.jpg');
INSERT INTO `singer` VALUES ('77564', 'Sviatoslav Richter', '斯维亚托斯拉夫·特奥菲洛维奇·里赫特（Sviatosláv Teofílovich Ríkhter，又译里希特或李希特，1915年3月20日－1997年8月1日），乌克兰德裔钢琴家。里赫特被公认为是20世纪最伟大的钢琴家之一，他以极广的曲目范围，举重若轻的技术以及富有诗意的分句闻名。', 'http://p1.music.126.net/H0G9Ga7DBTh21fvbKGuHIg==/683896232488487.jpg');
INSERT INTO `singer` VALUES ('7763', 'G.E.M.邓紫棋', '邓紫棋（G.E.M.），本名邓诗颖，1991年8月16日出生于上海市，中国香港流行乐女歌手、词曲作者、音乐制作人。\n2008年，发行个人首张音乐EP《G.E.M.》，凭该EP获得香港叱咤乐坛流行榜“叱咤乐坛生力军女歌手（金奖）”。2009年，发行个人首张音乐专辑《18...》。2011年，成为首位登上香港体育馆开唱的90后华语女歌手。2012年，凭借音乐专辑《Xposed》入围第24届台湾金曲奖“最佳国语女歌手奖”，并获得IFPI香港唱片销量大奖“全年最高销量女歌手奖”和“最高销量国语唱片奖”。2013年，举行邓紫棋“X.X.X.”世界巡回演唱会。2014年，获得湖南卫视歌唱真人秀节目《我是歌手第二季》总决赛亚军；同年，获得第27届美国儿童选择奖“最受欢迎亚洲艺人奖”。\n2015年，登上2015年中央电视台春节联欢晚会，弹唱歌曲《多远都要在一起》；同年，位列《2015年福布斯中国名人榜》第11名。2016年，入选福布斯《全球30岁以下最具潜力音乐人榜单》；同年，获得MTV欧洲音乐奖“中国内地及香港地区最佳艺人奖”。2018年，成为美国国家航空航天局“科学突破奖”首位亚洲颁奖女艺人；同年，入选英国广播公司BBC发布的《全球最具影响力百大女性榜单》。2019年，《光年之外》MV在视频平台YouTube突破2亿次点击量。2020年，凭借音乐专辑《摩天动物园》获得第31届台湾金曲奖“评审团奖”；同年，获得Mnet亚洲音乐大奖“最佳亚洲艺人奖”。', 'http://p2.music.126.net/W42LIbHIkxcccJfQYWzSIA==/109951164561122718.jpg');
INSERT INTO `singer` VALUES ('780003', 'Martin Garrix', '马丁·盖瑞斯（Martin Garrix），原名马亭·杰拉德·嘉伟森（Martijn Gerard Garritsen），1996年5月14日生于荷兰阿姆斯特丹，荷兰DJ、音乐制作人，毕业于赫尔曼育学院。\n2012年，马丁·盖瑞斯签约荷兰斯宾尼唱片公司，并发行无人声电音单曲《Error 404》。2013年6月，发行浩室电音单曲《Animals》，该首歌曲进入了十几个国家的音乐榜单前十。2014年4月，发行首张迷你专辑《Gold Skies》。2015年10月，马丁·盖瑞斯获得MTV欧洲音乐奖“最佳电音艺人”奖项 。2016年10月被《DJ Mag》评选为百大DJ第一名，成为该杂志创办之后最年轻的百大DJ第一名。同年11月，再次获得MTV欧洲音乐奖“最佳电音艺人”奖项 。2017年10月，马丁·盖瑞斯蝉联百大DJ第一名。2018年2月，在平昌冬奥会闭幕式上进行表演。2018年10月，马丁·盖瑞斯第三次获得百大DJ第一名。2019年10月，被《DJ Mag》评选为百大DJ第二名；11月3日，获得MTV欧洲音乐奖最佳电子乐奖。2020年，他在化身Ytram上连续发布3首单曲，并获得百大DJ第三名。', 'http://p2.music.126.net/SmqNVtVJpe_Uf-UZY-WIOA==/109951165973089945.jpg');
INSERT INTO `singer` VALUES ('783124', 'BTS (防弹少年团)', 'BTS (防弹少年团)，是韩国BigHit Entertainment旗下2013年出道的男子演唱组合，由RM、Jin、SUGA、j-hope、Jimin、V、Jung Kook 7名成员组成。BTS (防弹少年团)的含意是\"具有承受像子弹一样的时代偏见和压力的音乐团体\"，2017年7月4日则加入了“不安于现状，朝着梦想不断成长的青春”的涵义，原先以“防弹少年团”为英文缩写的“BTS”（BangTan Sonyeon Dan），也增添了“Beyond The Scene”超越现状的意思。BTS (防弹少年团)的官方歌迷名称为“A.R.M.Y”（韩语：아미），这个名称是在2013年7月9日通过官方网站首度亮相，来自于英文“Adorable Representative M.C for Youth”的缩写，意指“值得人们景仰的青年代表”，由成员们阅读约1000个粉丝意见后亲自选出，官方应援物为炸弹造型的手灯“A.R.M.Y BOMB”。2013年6月12日，发行出道专辑《2 COOL 4 SKOOL》；6月13日，以Mnet《M! Countdown》为出道舞台。', 'http://p1.music.126.net/iuOHZKWUBFMA-qi_jKZX9g==/109951166161837643.jpg');
INSERT INTO `singer` VALUES ('784257', 'Jony J', '独立音乐人，说唱歌手，来自SHOOC.Studio', 'http://p1.music.126.net/Wj6YO6c3JIRVTm7Qmc7Iyg==/1383185640161007.jpg');
INSERT INTO `singer` VALUES ('791534', '戴荃', '戴荃，新国风实践者，C-pop （Chinese pop ）独立音乐人，音乐唱作人、制作人，代表作《悟空》、《老神仙》、《渡人》、《喝汤》、《上海三月》、《嫦娥》、《同时》、《青山白云》、《过客归人》、《二郎》。', 'http://p2.music.126.net/J9nBr5oAZjTV0xYXirs5MQ==/109951164592113447.jpg');
INSERT INTO `singer` VALUES ('804174', 'Wolfgang Amadeus Mozart', '沃尔夫冈·阿马德乌斯·莫扎特（德语：Wolfgang Amadeus Mozart，1756年1月27日－1791年12月5日），出生于萨尔兹堡，逝世于维也纳，是欧洲最伟大的古典主义音乐作曲家之一，他也是一位共济会成员。35岁便英年早逝的莫扎特，留下的重要作品总括当时所有的音乐类型。根据当代的考证显示，在钢琴和小提琴相关的创作，他无疑是一个天分极高的艺术家，谱出的协奏曲、奏鸣曲、交响曲、小夜曲、嬉游曲等等成为后来古典音乐的主要形式，他同时也是歌剧的专家，成就至今仍能顺应时代的变迁而不朽。此外其作曲风格兼具旋律及艺术性，悦耳而活泼开朗，令其作品地位足与巴赫及贝多芬相提并论，亦让人感受到音乐由巴洛克时期转向古典主义时期的不同。', 'http://p2.music.126.net/OoacxY8P6mFUiH8M_8n-Zg==/8000046605925044.jpg');
INSERT INTO `singer` VALUES ('804355', 'ギガP', 'ギガP，VOCALOID著名P主(Producer)之一，经常使用镜音リン・レン(镜音双子)，Megpoid(GUMI)进行音乐创作，作品常常被贴上「神调教 」的标签。经常帮助唱见们后期处理，自己也有很多翻唱作品。\n', 'http://p1.music.126.net/BTpHh0GZjo-12xJVegAm-g==/109951165341206335.jpg');
INSERT INTO `singer` VALUES ('810011', 'Martynas', 'Martynas Levickis在8岁时开始在?iauliai音乐学院接受严格的手风琴教育，在立陶宛、美国、意大利、法国、荷兰、波兰、爱沙尼亚和秘鲁参加比赛并获奖。 2004年 Martynas 成为第一位获得立陶宛 ‘Queen Morta’ 奖的手风琴家。 他曾在立陶宛与几个室内音乐管弦乐队联袂表演, 在英国他曾参加BBC 音乐会、BBC交响乐团和伯明翰交响乐团的演出. 还曾在BBC的特别受欢迎的 ‘The One Show’节目中出现, 2009年闯进了‘Lithuania’s Got Talent’比赛的半决赛。\n2008年 Martynas 来到伦敦皇家音乐学院, 师从 Owen Murray教授。 Martynas 是立陶宛手风琴家协会的活跃分子。 今后的计划包括 Park Lane乐队在伦敦浦契尔厅2011年系列音乐会, 他的首场演出将是2010年10月在Barbican 中心。', 'http://p1.music.126.net/LbqNFuzGFHs2ys_1bJq0Dw==/5924168650893251.jpg');
INSERT INTO `singer` VALUES ('8103', '花粥', '音乐工作者', 'http://p2.music.126.net/KLsHaBhm7QSejQa8JB9ZtA==/109951162845812387.jpg');
INSERT INTO `singer` VALUES ('818678', '宣美', '李宣美（Lee Sun Mi），艺名宣美，1992年5月2日出生于韩国庆州青旦县、韩国女歌手，Wonder Girls组合成员。\n2007年2月10日，以演唱团体Wonder Girls出道，年末获得第17届首尔歌谣大赏新人奖，2007年度韩国最受欢迎歌手奖；2010年2月20日，因学业暂时退出Wonder Girls组合；\n2013年8月20日，以Solo歌曲《24小时也不够》回归乐坛；2014年2月17日，发行迷你专辑《Full Moon》；12月3日，获得2014Mnet亚洲音乐大奖最佳舞蹈表演奖。\n2015年8月3日，Wonder Girls以乐队形式回归，宣美归队担任贝斯手。', 'http://p2.music.126.net/bWN_4JsmKNZMavp9IFU8ow==/109951166254899748.jpg');
INSERT INTO `singer` VALUES ('824090', '祖堅正慶', '祖堅 正慶（そけん まさよし、1975年1月10日 - ）は、日本の作曲家、音響エンジニア。現スクウェア・エニックス所属サウンドエディター。', 'http://p2.music.126.net/lyHCEqh8qKgI1FXMfjI5Kg==/3223768094536604.jpg');
INSERT INTO `singer` VALUES ('830062', 'TAIBIAN', 'TAIBIAN，由韩国歌手Rapsta和King Clap组成的二人组合。2013年以单曲《Queen》出道并进行活动。代表作有《배영하는 물고기》，《Romantic Harmony》等。', 'http://p2.music.126.net/X5D36WlzyabQwPweWwHgVA==/3413983618275356.jpg');
INSERT INTO `singer` VALUES ('840746', 'Ash', null, 'http://p1.music.126.net/f8MSbwID3-0T1JLDJA1SuQ==/528865109167212.jpg');
INSERT INTO `singer` VALUES ('847346', 'Glass Animals', 'Glass Animals是一支来自英伦牛津郡的四人另类摇滚乐队，被Wolf Tone相中，作为旗下第一支乐队被签下。乐队成员有主唱Dave Bayley、吉他/键盘Drew MacFarlane、贝斯/键盘Edmund Irwin-Singer和鼓手Joe Seaward。\nGA的音乐似乎充满着近乎神经质的端庄和诡异的典雅。他们的音乐聪明，而富有动机。或许因为主唱学习的是神经系统科学？自然声场与电子声并重下，依然裹附着动人的R&B节奏，绵延悠扬，十首曲目浑然一体，如一剂药方，让听者仿佛走不出那个“原始森林”的角落，只能兀自惊叹他们的才华。', 'http://p1.music.126.net/atlBBxGvPM61o9e9lGy6BQ==/109951166370757788.jpg');
INSERT INTO `singer` VALUES ('858026', 'Touliver', null, 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('86032', 'Academy of St. Martin in the Fields', '圣马丁室内乐团（英语：Academy of St Martin in the Fields），世界著名室内乐团之一，乐队名称来自于乐队早期演出的地点——伦敦圣马田教堂。圣马丁室内乐团于1958年创立，最初是一支由伦敦交响乐团成员组成的弦乐队，在乐季休息期间在无指挥的情况下演奏巴洛克音乐。不久后加入了管乐演奏员，由内维尔·马里纳爵士接过指挥一职。马里纳一直担任乐队终身主席（Life President），直至2016年逝世。\n\n穆雷·佩拉西亚自2000年来担任首席客座指挥，约夏·贝尔2011年起担任音乐总监。\n\n圣马丁室内乐团现今不仅演奏巴洛克音乐，也涉足浪漫主义音乐和当代古典音乐。乐队是有史以来录音最多的室内乐团，有超过500张唱片，他们还录制了《莫扎特传》、《英国病人》和《泰坦尼克号》等电影的配乐。', 'http://p1.music.126.net/enBp-rTjuMZA1ce7MAyLqw==/1390882223055943.jpg');
INSERT INTO `singer` VALUES ('869001', 'Gary', 'Gary，姜熙健（강희건），1978年2月24日出生在韩国首尔特别市松坡区蚕室洞。韩国歌手、主持人。是韩国男子组合Leessang的成员，毕业于龙仁大学警护学。', 'http://p2.music.126.net/kYycjzMTkHscq7g2AihMig==/7914284698005977.jpg');
INSERT INTO `singer` VALUES ('886043', 'N.Flying', 'N.Flying（朝鲜语：엔플라잉；日语：エヌフライング），是韩国FNC Entertainment公司旗下第三个男子流行摇滚乐团，最初由权光珍、李承协、车勋、金宰铉所组成，并由李承协担任队长。经成员变动后，现任成员包括李承协、车勋、金宰铉、柳会胜、徐东成。与CNBLUE相同，N.Flying于韩国正式出道前，以独立乐团方式在日本展开活动。 韩国时间2015年5月11日零时FNC Entertainment透过官方脸书宣布 N.Flying 将于5月20日推出首张迷你专辑《Awesome》（朝鲜语：기가막혀）正式出道，并公开团体概念照。', 'http://p2.music.126.net/Vb3-yZO5A663sPdDfFv3yA==/109951166065161971.jpg');
INSERT INTO `singer` VALUES ('893484', 'The Chainsmokers', 'The Chainsmokers，是来自美国纽约的DJ组合。由成员安德鲁·塔格特和亚历克斯·鲍尔组成，2014年因一曲#SELFIE而走红，2016年凭借单曲Don\'t Let Me Down与Closer获得商业成功。', 'http://p1.music.126.net/0yUqMkYTpPzrpwwaHkFHGQ==/109951166425641467.jpg');
INSERT INTO `singer` VALUES ('896042', 'Madnap', null, 'http://p2.music.126.net/RMVtnQwgtFJj4mYj-RA0VQ==/109951164815075183.jpg');
INSERT INTO `singer` VALUES ('905037', 'High4', 'HIGH4，是韩国N.A.P Entertainment 推出的韩国男子团体组合，于4月8日与IU合作歌曲《除了春天爱情和樱花》出道。\n由崔甲源制作人推出的High4组合由两名Vocal和两名Rapper组成。HIGH4这个名字有成员四人一起达到演艺界的顶峰之意。', 'http://p2.music.126.net/aw1dhssFWAgJT26qDefirg==/18762066418191391.jpg');
INSERT INTO `singer` VALUES ('905156', 'Getsunova', 'Getsunova，泰国GMM Grammy旗下四人乐队，于2007年正式出道。成员包括Prakarn Raiva， Panoth Khunprasert， Natee Osathanugrah， Komkadeach Sangwatanaroj。2016年获得Mnet亚洲音乐大奖泰国地区最佳年度艺人。Getsunova的《多远才算近在咫尺》、《一个无人解答的问题》和泰剧荷尔蒙的片尾曲《差异》等歌曲受歌迷的喜爱。', 'http://p2.music.126.net/6jmUSiSsP3IEPsjbnkfwow==/109951164036747851.jpg');
INSERT INTO `singer` VALUES ('93062', 'Feint', '出生于英国的制作人安德鲁·胡（Andrew Hu）建立了自己独特的鼓和低音音乐风格，长期以来一直在电子领域引起轰动。 他的首张专辑发行是在Monstercat历史的早期出现的，并使其登上了001-Launch Week专辑的位置。 Feint的成功与他在Monstercat的连续发行，以及在Liquicity Records的首张发行一起不断增长，此后与他建立了密切的关系。 Feint与歌手和词曲作者Laura Brehm共同创作的重磅曲目“ We Wo n\'t Be Alone”和“ Words”继续在鼓乐和贝斯领域中崭露头角，这两者在Spotify的数百万部剧中都达到了顶峰。Feint的风格为Drum and Bass，也就是鼓打贝斯，节奏紧凑，并且运用轻灵的女声来修饰，使得他的电音更加具有空灵感，适合在一个人的时候听。', 'http://p2.music.126.net/P38DpK_FkUMRFiPSwmW7aQ==/109951165638990997.jpg');
INSERT INTO `singer` VALUES ('93082', 'F.O.O.L', '', 'http://p1.music.126.net/iQmRI5VKm7IfoRndFnKPqw==/6620159511128799.jpg');
INSERT INTO `singer` VALUES ('94779', 'Imagine Dragons', 'Imagine Dragons，美国独立摇滚乐队，由主唱丹·雷诺斯、贝斯手本·麦基、吉他手韦恩·瑟蒙和鼓手丹尼尔·普拉兹曼组成。\n2008年，该乐队在拉斯维加斯成立；同年，发行首张EP《Speak to Me》。2012年，发行首张录音室专辑《Night Visions》，专辑内的单曲《Radioactive》在公告牌百强单曲榜创下了87周的在榜纪录。2014年，凭借歌曲《Radioactive》获得第56届格莱美奖最佳摇滚表演奖；同年，献唱网络游戏《英雄联盟》全球总决赛主题曲《Warriors》和《变形金刚4》电影主题曲《Battle Cry》。2015年2月，发行第二张录音室专辑《Smoke + Mirrors》。2017年6月，发行第三张录音室专辑《Evolve》，该专辑入围了第60届格莱美奖最佳流行专辑奖；11月，获得第45届全美音乐奖最受欢迎流行或摇滚组合奖。2018年1月，凭借歌曲《Thunder》入围第60届格莱美奖最佳流行团体或组合表演奖；5月，获得第25届公告牌音乐奖最佳组合或乐队奖、最佳摇滚艺人等四个奖项；11月，发行第四张录音室专辑《Origins》。2019年，获得第26届公告牌音乐奖最佳摇滚艺人奖。', 'http://p1.music.126.net/_yDVvfmDLOTPxkQ_vCKVDg==/109951166366047050.jpg');
INSERT INTO `singer` VALUES ('95435', 'Lube', 'Любэ/Lube/柳拜（音译），俄罗斯的流行-民谣-摇滚乐队，被誉为是二十世纪九十年代以来俄罗斯最杰出、最伟大的乐队。由于其对国家在文化和艺术领域及对巩固民族之间的团结友谊所作出的杰出贡献，乐队主唱尼古拉·拉斯托尔古耶夫和已故的伴唱阿纳托利·库列绍夫被俄罗斯联邦总统授予俄罗斯联邦功勋演员称号。', 'http://p2.music.126.net/uqV79ngdnls8H0Fzwfu8iA==/18568552371704848.jpg');
INSERT INTO `singer` VALUES ('961358', '不才', '独立音乐人 、歌手，代表作《化身孤岛的鲸》、《寻常歌》、《夜航星》 \n2020年担任制作人发布第一张个人专辑《山止川行》', 'http://p2.music.126.net/j-4dVsdH2Vg_vzpNbraPBA==/109951163551854183.jpg');
INSERT INTO `singer` VALUES ('963067', 'Lillo', '', 'http://p1.music.126.net/fS40ZzKkK5Cw7wsMhESxkA==/109951163462489561.jpg');
INSERT INTO `singer` VALUES ('963431', '陈致逸', '陈致逸，男，汉族，作曲家、音乐制作人。代表游戏配乐作品米哈游《原神》。', 'http://p2.music.126.net/74UZk4iXGOUHWbmAol1vAQ==/109951163100243732.jpg');
INSERT INTO `singer` VALUES ('964049', 'Heize', 'Heize，本名张多蕙，韩国CJ E&M旗下的女歌手，1991年8月9日出生，2014年1月17日通过单曲《再多徘徊一会》正式出道。2015年，参与韩国大型女饶舌歌手比赛《Unpretty Rap Star Vol.2》，从而得到大众关注 。', 'http://p1.music.126.net/q2cFD61opquSXS6bPLLn4w==/109951165098354503.jpg');
INSERT INTO `singer` VALUES ('973004', '程璧', '程璧，独立音乐人，词曲创作者。 2015华语金曲奖年度最佳国语女新人。\n2018华语金曲奖年度最佳民谣艺人。 嗓音\"优美沉静，清亮崭新\"，被称为\"离诗歌最近的声音\"。 北京大学日文系硕士毕业，曾工作于日本设计中心原研哉设计研究所。现居东京，独立从事艺术创作与写作。 她以一把古典吉他进行音乐创作，为诗歌谱曲，包括中国诗人北岛、西川、张枣，日本诗人谷川俊太郎、金子美铃，土耳其诗人塔朗吉，叙利亚诗人阿多尼斯等国际诗人作品。 目前已发表音乐专辑作品《晴日共剪窗》、《诗遇上歌》、《我想和你虚度时光》、《早生的铃虫》、《步履不停》、《然后，我拥抱你》等。 跨国文化的音乐元素，某些质朴情感的共通，体现\"朴实、含蓄、留白\"的生活审美。为中国民谣界带来一股回溯过往与正视简单生活的清风，以及些许童趣。 国际美学大师原研哉，对程璧音乐作品的评价广为流传：透过程璧的音乐，能够感受到现在中国年轻女性在追逐着什么。', 'http://p1.music.126.net/CmRQZ8MlVqgn88QJ3rGdgQ==/109951165118887058.jpg');
INSERT INTO `singer` VALUES ('977173', '3Bangz', '3Bangz是全球唯一的三胞胎说唱组合。 老大“一棒子”定居在缅甸、曾在佤联军担任二等兵、除了上山狩猎野生动物外，也在闲暇时间开始尝试抛开传统道德观念，围绕暴力美学进行艺术创作。在一次地方武装冲突中，组织13人的小分队摧毁敌方坦克3辆，在大面积燃烧弹空袭中失踪。（1995-2016） 老二“二棒子”，被1万5千伏高压触电、30米大桥坠落、高速遭遇车祸，曾经3次死里逃生，使他觉得留在世界上是有原因的！他肩负了用艺术感染人类的使命！ 老三“三棒子”，极其浪漫的完美男人，现留美归国。代表喜剧说唱杀入《中国新说唱》、克服语言障碍参加吵架节目《奇葩说》、受邀Versace、Gucci、Adidas等国际一线品牌为其拍摄广告、为地下攻占主流增添了强劲的力量。但多次因为作风问题登上热搜，目前在面壁思过中。', 'http://p2.music.126.net/6mTq5hla4rwN7jOx_0bQsA==/109951164434625084.jpg');
INSERT INTO `singer` VALUES ('981141', '伦桑', '伦桑，平纱落雁原创音乐团队歌手。2014年12月发行第一张古风原创专辑《桑道伦回》。声线温柔清润，擅长中低音。古风原创歌曲《天地缓缓》《烟雨行舟》《十方天下》《山有木兮》等作品广受好评，并为倩女幽魂，剑网3，天下3，龙之谷等网络游戏演唱歌曲。翻唱作品风格多变，驾驭各种曲风，《人质》《红颜》《告白气球》等翻唱作品个人特色鲜明。', 'http://p2.music.126.net/uXzSEe2qo-yZXyZQ1-OA9A==/109951163552619098.jpg');
INSERT INTO `singer` VALUES ('983028', '言和', '言和，Vsinger旗下第二位出道的虚拟歌手。代表作《阴阳先生》、《刀剑春秋》、《梦之雨》等。', 'http://p2.music.126.net/a2ljyYQkTz0ndUtp1W5wHQ==/109951165575762858.jpg');
